INSERT INTO `products` VALUES (9212,'3989 5 Eye Brogue Bex Sole','/pm/drmar/drmar9212_450882_jb1.jpg;/pm/drmar/drmar9212_450882_jb2.jpg;/pm/drmar/drmar9212_450882_jb3.jpg;/pm/drmar/drmar9212_450882_jb4.jpg;/pm/drmar/drmar9212_450882_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dr. Martens 3989 5 Eye Brogue Bex Sole Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                5 Eyelet Brogue Bex sole in the classic black and white color run.\n            \n                Leather: Smooth leather is a hard wearing corrected grain leather with an unblemished finish.\n            \n                This is a Goodyear-welted product. The upper and sole are sewn together, not merely glued, like many footwear constructions. This, together with our Z welt-stitch and heat-sealing process, makes it unique to Dr. Martens.\n            \n                <p> </p> <p><b>Dr. Martens Size Chart (orders placed in UK sizes):</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/drmar/DrMartensAdultsizechart.jpg?yocs=c_f_&amp;yoloc=ap\">\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Leather\');\">Leather</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            BEX</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(14482,'Champion Oxford Canvas Sneaker','/pm/wolve/wolve14482_4168_jb1.jpg;/pm/wolve/wolve14482_4168_jb2.jpg;/pm/wolve/wolve14482_4168_jb3.jpg;/pm/wolve/wolve14482_4168_jb4.jpg;/pm/wolve/wolve14482_4168_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keds Champion Oxford Canvas Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                It\'s not a running shoe, it\'s a run the world shoe. The Keds Champion Oxford Canvas Sneaker for women is designed with a classic canvas upper in essential colors like white, black, and gray. A 4 eyelet lace-up front completes the upper of this iconic sneaker. Cushioned latex insole with arch support and soft breathable lining keeps feet happy for all-day wear, and the flexible textured rubber outsole provides traction and grip.  Signature Keds blue heel patch certifies the Champion as the original sneaker.\n            \n                <ul class=\"detail_comp\"><li>Canvas upper\n</li><li>4 eyelet lace-up front\n</li><li>Cushioned latex insole\n</li><li>Breathable lining\n</li><li>Flexible textured rubber outsole\n</li><li>Signature Keds blue heel patch\n</li></ul>\n            \n                <br><b><a href=\"/keds-champion/category_13820\"><font color=\"blue\"> <br>Shop more of the Keds Champion Collection here</font></a></b>\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Canvas\');\">Canvas</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Outsole\');\">Outsole</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Upper\');\">Upper</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(29635,'Arizona Suede Sandal','/pm/birke/birke29635_23867_jb1.jpg;/pm/birke/birke29635_23867_jb2.jpg;/pm/birke/birke29635_23867_jb3.jpg;/pm/birke/birke29635_23867_jb5.jpg;/pm/birke/birke29635_23867_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Arizona Suede Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Birkenstock Arizona sandal is famous for its comfortable fit and easy style.This breezy slide is the quintessential Birkenstock style with two sets of straps fastened by individual, adjustable buckles for a custom fit. Suede construction is soft, flexible, and on-trend. Classic Birkenstock contoured cork footbed includes double jute layer for better-than-barefoot comfort. Raised toe bar, roomy toe box, arch support, and deep heel cup with suede footbed liner combine to align your foot naturally for even weight distribution and proper support.\n            \n                <ul class=\"detail_comp\"><li>Adjustble buckle closure\n</li><li>Suede upper\n</li><li>Contored cork footbed\n</li><li>Double jute layer\n</li><li>Raised toe bar\n</li><li>Roomy toe box\n</li><li>Arch support\n</li><li>Deep heel cup\n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Arch\');\">Arch</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Buckle\');\">Buckle</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Cork\');\">Cork</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=EVA\');\">EVA</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Footbed\');\">Footbed</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Heel\');\">Heel</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Jute\');\">Jute</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Suede\');\">Suede</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Upper\');\">Upper</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a unisex item available in two widths.  The narrow width fits like a ladies Medium \"B-C\" width and is a true narrow for Men.  The Regular width fits like a women\'s wide \"D\" width and fits like a Men\'s medium.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Suede</div>\n            \n		</div><!--end product_specs-->\n	</div>',125.00,125.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(55059,'Energy Downforce','/pm/skech/skech55059_41823_jb1.jpg;/pm/skech/skech55059_41823_jb2.jpg;/pm/skech/skech55059_41823_jb3.jpg;/pm/skech/skech55059_41823_jb5.jpg;/pm/skech/skech55059_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Energy Downforce Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Take \'em down in our leather webbed eyerow jogger - fueled and on the move.\n            \n                Leather and nubuck upper.\n            \n                Trubuck upper.\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Nubuck\');\">Nubuck</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Leather\');\">Leather</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Upper\');\">Upper</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 9 1/2, we recommend purchasing a size 9. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Nubuck </div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(117115,'Helen Sandal','/pm/mephi/mephi117115_59301_jb1.jpg;/pm/mephi/mephi117115_59301_jb2.jpg;/pm/mephi/mephi117115_59301_jb3.jpg;/pm/mephi/mephi117115_59301_jb4.jpg;/pm/mephi/mephi117115_59301_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Mephisto Helen Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Go Greek with the Mephisto Helen sandal. This classically inspired footbed sandal features leather or nubuck straps with an adjustable buckle for an individualized fit. SOFT-AIR technology in the footbed features 100% natural latex and cork to conform to your foot and provide extra cushioning and personalized support. Rubber midsole provides traction. The Helen is one of Mephisto\'s most-loved warm-weather options so whether you\'re trying them for the first time or adding a new color to your collection, you\'ll be comfortable and stylish in this easy summer staple. \n            \n                <ul class=\"detail_comp\"><li>Adjustable leather or nubuck straps\n</li><li>Buckle closure\n</li><li>SOFT-AIR cushioning\n</li><li>Latex/cork footbed\n</li><li>Rubber midsole\n</li><li>Wide range of color/style options\n</li></ul>\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Cork\');\">Cork</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run small.  If you normally order a 1/2 size it is recommended that you order the next full size up. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 7.</div>\n            \n		</div><!--end product_specs-->\n	</div>',148.95,148.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(117144,'Match','/pm/mephi/mephi117144_59349_jb1.jpg;/pm/mephi/mephi117144_59349_jb2.jpg;/pm/mephi/mephi117144_59349_jb3.jpg;/pm/mephi/mephi117144_59349_jb4.jpg;/pm/mephi/mephi117144_59349_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Mephisto Match Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The latex-mousse used in the design of the innersoles of all Mephisto shoes is your guarantee of exceptional comfort at all times.\n            \n                The built-in layer of \"latex-mousse\" in the soles offers the entire body the sensation of walking on a \"carpet made of soft cushions\".\n            \n                All styles in the Golf collection by Mephisto are built in the tradition and with the technology of Mephisto using the best natural leathers possible.\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Leather\');\">Leather</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size.  Mephisto shoes are designed to fit loosely in the heel.  For maximum comfort, the heel should be cradled, not fit snugly.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Latex-Mousse</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',374.95,374.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(124184,'Original Tennis','/pm/filau/filau124184_65293_jb1.jpg;/pm/filau/filau124184_65293_jb2.jpg;/pm/filau/filau124184_65293_jb3.jpg;/pm/filau/filau124184_65293_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Fila Original Tennis Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Add classic court style to your casual collection with this retro tennis shoe.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style runs a half (1/2) size small.  If you normally wear a size 7 please purchase a size 7.5 to assure a correct fit.</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(126580,'Colton','/pm/wolve/wolve126580_376554_jb1.jpg;/pm/wolve/wolve126580_376554_jb5.jpg;/pm/wolve/wolve126580_376554_jb6.jpg;/pm/wolve/wolve126580_376554_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Colton Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Is a classic penny loafer.\n            \n                Has a new outsole.\n            \n                Great for special occasions.\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Outsole\');\">Outsole</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 12, we recommend purchasing a size 12 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather and Suede</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(141381,'Authentic Original','/pm/wolve/wolve141381_374892_jb1.jpg;/pm/wolve/wolve141381_374892_jb5.jpg;/pm/wolve/wolve141381_374892_jb6.jpg;/pm/wolve/wolve141381_374892_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Authentic Original Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The A/O includes a razor siped EVA outsole that is lightweight and flexible.\n            \n                Classic, authentic, original styling.\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Nubuck\');\">Nubuck</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Outsole\');\">Outsole</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=EVA\');\">EVA</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Upper\');\">Upper</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 12 1/2, we recommend purchasing a size 12. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Ethyl Vinyl Acetate Outsole</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(153663,'Gizeh Birkibuc','/pm/birke/birke153663_24004_jb1.jpg;/pm/birke/birke153663_24004_jb2.jpg;/pm/birke/birke153663_24004_jb3.jpg;/pm/birke/birke153663_24004_jb5.jpg;/pm/birke/birke153663_24004_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Gizeh Birkibuc Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Not your typical thong.\n            \n                Experience maximum comfort in this modern thong-style sandal.\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Women</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-womens.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Thong\');\">Thong</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large.  If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 6. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Birkibuc</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(153669,'Arizona Birko-Flor Sandal','/pm/birke/birke153669_84467_jb1.jpg;/pm/birke/birke153669_84467_jb2.jpg;/pm/birke/birke153669_84467_jb3.jpg;/pm/birke/birke153669_84467_jb5.jpg;/pm/birke/birke153669_84467_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Arizona Birko-Flor Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Two straps are better than one when it comes to the iconic Birkenstock Arizona Sandal in Birko-Flor. This footbed sandal features straps made of a unique leather-like synthetic material that is tear-resistant and comfortable. Buckle closures on the straps give you the option of an adjustable fit. Comfortable soft footbed incorporates a layer of foam in between the lower cork and upper suede layers. The high degree of rebound in the foam makes for long-lasting comfort. Light and flexible, the EVA outsole is durable and shock-absorbent for the most comfortable experience possible. \n            \n                <ul class=\"detail_comp\"><li>Birko-Flor upper\n</li><li>Buckle closure for adjustable fit\n</li><li>Soft footbed\n</li><li>EVA outsole\n</li></ul>\n            \n                <br><b><a href=\"/birkenstock-arizona-collection.htm?dnl=1\"><font color=\"blue\"> <br>Shop more of the Birkenstock Arizona Collection</font></a></b>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Arch\');\">Arch</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Buckle\');\">Buckle</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Cork\');\">Cork</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glos