luid motion while running. These technology advanced shoes feature patented, removable Aetrex orthotics and PRS (Presssure Relief System allows for easy customization and comfort by trimming the insole at the areas of pressure) insoles for customization of fit and comfort.\n            \n                Biomechanically engineered multi-density midsoles provide medial support and stability. In addition, the midsole features a carboplast foot bridge that crosses the shoe for extra control.\n            \n                The outsole features strategically placed pods for floating independent suspension and shock attenuation. The unique last is semi straight to fit many foot types and provide a comfortable, snug heel fit for stability.\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Breathable\');\">Breathable</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Midsole\');\">Midsole</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Outsole\');\">Outsole</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Heel\');\">Heel</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Insole\');\">Insole</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Last\');\">Last</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Upper\');\">Upper</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',144.95,144.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(185670,'Striper CVO','/pm/wolve/wolve185670_300913_jb1.jpg;/pm/wolve/wolve185670_300913_jb2.jpg;/pm/wolve/wolve185670_300913_jb3.jpg;/pm/wolve/wolve185670_300913_jb5.jpg;/pm/wolve/wolve185670_300913_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Striper CVO Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Vulcanized construction providing a secure bond between upper and outsole.\n            \n                High quality cotton canvas  upper providing breathability and comfort.\n            \n                Padded tongue and collar for added comfort around the foot.\n            \n                Non-marking rubber outsole with Wave-Siping for the ultimate in wet/dry traction.\n            \n            <div class=\"head info\">Definitions</div>\n         \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Canvas\');\">Canvas</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Outsole\');\">Outsole</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Tongue\');\">Tongue</a>\n                , \n                <a href=\"javascript:definitionsPop(\'/info-pop/glossary?term=Upper\');\">Upper</a>\n                \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',42.25,42.25,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(256109,'Newport H2 Sandal','/pm/keenf/keenf256109_142620_jb1.jpg;/pm/keenf/keenf256109_142620_jb2.jpg;/pm/kee