lly purchase a size 8, we recommend purchasing a size 8 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(256115,'Newport H2 Sandal','/pm/keenf/keenf256115_465313_jb1.jpg;/pm/keenf/keenf256115_465313_jb2.jpg;/pm/keenf/keenf256115_465313_jb6.jpg;/pm/keenf/keenf256115_465313_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Newport H2 Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Introducing Keen\'s Newport H2 Sandal, children\'s edition. This sandal features a quick-drying polyester webbing upper, perfect for outdoor play. Elastic cord lace and adjustable hook and loop straps allow for flexibility and easy on-and-off. Underfoot, Keen\'s patented toe guards protect your kid\'s feet during various activities while the EVA midsole maximizes cushioning and support. Finally, the H2 Sandal\'s non-marking rubber outsole provides durability and traction on wet surfaces, making these Keen Sandals the ideal playtime shoe for kids.  \n            \n                <ul class=\"detail_comp\"><li>Quick-Drying Webbing Upper\n</li><li>Elastic Cord Lace\n</li><li>Hook and Loop\n</li><li>Synthetic Mesh Lining\n</li><li>Patented Toe Guards\n</li><li>EVA Midsoles \n</li><li>Rubber Outsole\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 10, we recommend purchasing a size 10 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,4,0,0,'2018-04-30 09:5