 <br><b><a href=\"/vans-slip-on-shoes/category_51972\"><font color=\"blue\"> <br>Shop more Vans slip-on shoes here</font></a></b> \n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(288664,'Old Skool Sneaker','/pm/vansi/vansi288664_434351_jb1.jpg;/pm/vansi/vansi288664_434351_jb2.jpg;/pm/vansi/vansi288664_434351_jb3.jpg;/pm/vansi/vansi288664_434351_jb6.jpg;/pm/vansi/vansi288664_434351_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Old Skool Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                You don\'t need to wait for throwback Thursday to rock the vintage-inspired Vans Old Skool Sneaker. One of the first Vans silhouettes designed with the signature side stripe, these sneakers for men have been keeping it cool since 1977 with their suede or canvas low-top upper, classic lace-up front, and rubber waffle outsole. Updated comfort features like a padded tongue and soft sock liner provide modern comfort in a retro silhouette. Shop a diverse collection of color and pattern options to find the style that\'s right for you.\n            \n                <ul class=\"detail_comp\"><li>Suede or Canvas Upper\n</li><li>Low top\n</li><li>Lace-up\n</li><li>Rubber waffle tread outsole\n</li><li>Padded tongue\n</li><li>Cotton sock liner\n</li></ul>\n            \n                <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/SB7uFMFFllU?rel=0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\n            \n                <a href=\"/vans-old-skool-collection.htm?dnl=1\"><font color=\"blue\"> <br><b>Shop more Vans Old Skool Sneaker Collection</b></font></a>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(288665,'Authentic Sneaker','/pm/vansi/vansi288665_338546_jb1.jpg;/pm/vansi/vansi288665_338546_jb2.jpg;/pm/vansi/vansi288665_338546_jb3.jpg;/pm/vansi/vansi288665_338546_jb6.jpg;/pm/vansi/vansi288665_338546_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Authentic Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                No need to waffle on your decision to buy these Vans Authentic Sneakers. This easy oxford-style shoe features an upper made of canvas, leather, or other materials, a lace up front, and Vans\' distinctive Waffle Outsole. Our impressive array of available colors and patterns allows you to put multiple twists on this classic silhouette. These retro originals will let you skate through your day in comfort without sacrificing your individual sense of style.\n            \n                <ul class=\"detail_comp\"><li>Signature Vans Waffle Outsole\n</li><li>Lace up front \n</li><li>Diverse patterns and colors \n</li><li>Classic design for men and women\n</li></ul>\n            \n                <br><b><a href=\"/vans-authentic-collection/category_51976\"><font color=\"blue\"> <br>Shop more Vans Authentic Sneakers here</font></a></b> \n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(288666,'Era Sneaker','/pm/vansi/vansi288666_28450_jb1.jpg;/pm/vansi/vansi288666_28450_jb2.jpg;/pm/vansi/vansi288666_28450_jb3.jpg;/pm/vansi/vansi288666_28450_jb4.jpg;/pm/vansi/vansi288666_28450_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Era Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Designed for skaters but co-opted by the in crowd, the Vans Era sneaker is a classic low top lace-up style meant to last. Durable canvas upper is double stitched and finished with a padded tongue. Signature waffle outsole is made of rubber for exceptional traction. EVA insert adds comfort to these minimalist vans shoes. \n            \n                <ul class=\"detail_comp\"><li>Low top silhouette\n</li><li>Lace-up \n</li><li>Double-stitched canvas upper\n</li><li>Padded tongue\n</li><li>Rubber outsole\n</li><li>Signature waffle tread pattern\n</li><li>EVA insert \n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Weight:</span>\n            \n            13 oz</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(293386,'Neima Slingback','/pm/lowel/lowel293386_103978_jb1.jpg;/pm/lowel/lowel293386_103978_jb2.jpg;/pm/lowel/lowel293386_103978_jb3.jpg;/pm/lowel/lowel293386_103978_jb4.jpg;/pm/lowel/lowel293386_103978_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Softspots Neima Slingback Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                We don\'t need to give you the hard sell to convince you to buy these Softspots Neima Slingback high- heeled shoes. Sophistication and style shine though in these strappy slingbacks. Leather upper combines includes an adjustable slingback heel strap with buckle closure. Pillow Top comfort footbed helps cushion feet, and 2.5-inch two-toned hand-painted stacked heel makes these shoes as elegant as they are comfortable. Polyurethane outsole ensures lightweight durability and traction. \n            \n                <ul class=\"detail_comp\"><li>Slingback silhouette\n</li><li>Leather upper\n</li><li>Adjustable heel strap\n</li><li>Buckle closure\n</li><li>Pillow Top comfort footbed \n</li><li>2.5-inch two-toned hand-painted stacked heel\n</li><li>Polyurethane outsole\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Latex Pillowtop</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(295051,'Whisper Sandal','/pm/keenf/keenf295051_368536_jb1.jpg;/pm/keenf/keenf295051_368536_jb2.jpg;/pm/keenf/keenf295051_368536_jb3.jpg;/pm/keenf/keenf295051_368536_jb5.jpg;/pm/keenf/keenf295051_368536_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Whisper Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                From hidden coves to rushing rivers, the KEEN Whisper sandal can handle any aquatic adventure. In the upper, the quick draw elastic cord lacing system adjusts for a comfortable and secure fit in and out of the water. The washable polyester straps feature water resistant hydrophobic mesh liners. Underfoot, Keen\'s ergonomically designed Metatomical EVA footbed and midsole mold to your feet for a comfortable fit with excellent arch support. Non-marking rubber outsole features multidirectional lug pattern for increased traction and a TPU shank for enhanced stability.  Washable, durable, and odor resistant, these keen sandals will quickly become some of your most wearable water shoes. \n            \n                <ul class=\"detail_comp\"><li>Quick draw elastic lacing system\n</li><li>Washable polyester straps\n</li><li>Hydrophobic mesh liner\n</li><li>Metatomical EVA footbed\n</li><li>Molded EVA midsole\n</li><li>Non-marking rubber outsole\n</li><li>TPU stability shank\n</li><li>Odor resistant\n</li></ul>\n            \n                <br><b><a href=\"/keen-sandals/category_2444\"><font color=\"blue\"> <br>Shop more Keen Sandals here</font></a></b>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(303687,'Sk8-Hi','/pm/vansi/vansi303687_384650_jb1.jpg;/pm/vansi/vansi303687_384650_jb2.jpg;/pm/vansi/vansi303687_384650_jb3.jpg;/pm/vansi/vansi303687_384650_jb6.jpg;/pm/vansi/vansi303687_384650_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Sk8-Hi Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Sk8-Hi is Vans original out-of-the-box skate performance shoe. These \"Off the Wall\" kicks have dressed the feet of pro and amateur skaters since 1966 and today\'s model is just as authentic as the originals.\n            \n                You\'ll enjoy the perfect fit, flexible grip and board feel of these timeless hi tops.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5.</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(310327,'Navajo Sandal','/pm/jackr/jackr310327_402757_jb1.jpg;/pm/jackr/jackr310327_402757_jb2.jpg;/pm/jackr/jackr310327_402757_jb3.jpg;/pm/jackr/jackr310327_402757_jb5.jpg;/pm/jackr/jackr310327_402757_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Jack Rogers Navajo Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The preppy Jack Rogers Navajo Sandal has been the embodiment of easy summer chic since the style was popularized by the likes of Jaqueline Kennedy and Lilly Pulitzer some 50 years ago. This women\'s slide sandal with roots in Native American culture features leather uppers with classic whipstitched detailing, a leather sole, and an internal wooden shank that provides arch support and stability.\n            \n                The Navajo silhouette comes in several unique color and pattern combinations each named for an essential vacation hot spot. So whether you\'re into the glam metallics of the Hamptons, West Hamptons, Nantucket, and glittery Marian collections, or you want to keep it classic with the matte Palm Beach, Linen Cici, or Cork Nappa Valley collections, you\'re sure to find the perfect Navajo sandal for your next getaway. \n            \n                <ul class=\"detail_comp\"><li>Whipstitched leather upper\n</li><li>Leather sole \n</li><li>Internal wooden shank\n</li><li>Unique colors and patterns\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            The upper part of the shoe increases with every half size.  Please note the upper does stretch with wear.  Customers should buy sandals to fit snug because the leather will stretch with wear.  Please note, a size 9 sole is the same length as a 9.5 sole.  \n\nThe Jack Rogers Navajo Flat is handmade and each one has the size handwritten in the upper or on the sole next to the vamp.  Whole sizes are noted with just the size.  Half sizes are noted with the numerical size plus a dash.  For example, a size 9 regular width is \"9M\" and a size 9.5 regular width is \"9-M.\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Made in:</span>\n            \n            USA</div>\n            \n		</div><!--end product_specs-->\n	</div>',117.95,117.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(317733,'Blunnies','/pm/blund/blund317733_129636_jb1.jpg;/pm/blund/blund317733_129636_jb2.jpg;/pm/blund/blund317733_129636_jb4.jpg;/pm/blund/blund317733_129636_jb5.jpg;/pm/blund/blund317733_129636_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Blundstone Blunnies Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Say Hi! To Blunnies for kids. Parents will love the durability and versatility! No laces to trouble tiny fingers or even tinier attention spans.\n            \n                Non-marking soles make life easier for Mom and Dad, too. Full-length removable footbeds help kids get more wear out of every pair.\n            \n                As little feet grow, simple remove the footbeds and voila-more room to grow! Kids love \'em!\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(332289,'Samba Classic','/pm/adida/adida332289_32471_jb1.jpg;/pm/adida/adida332289_32471_jb2.jpg;/pm/adida/adida332289_32471_jb3.jpg;/pm/adida/adida332289_32471_jb4.jpg;/pm/adida/adida332289_32471_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>adidas Samba Classic Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                This indoor soccer shoe has a leather and synthetic upper, a synthetic lining, an EVA insole, and a non marking rubber IN outsole for use on indoor surfaces.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',69.95,69.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(349366,'Milano Oiled Leather','/pm/birke/birke349366_189316_jb1.jpg;/pm/birke/birke349366_189316_jb2.jpg;/pm/birke/birke349366_189316_jb3.jpg;/pm/birke/birke349366_189316_jb5.jpg;/pm/birke/birke349366_189316_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Milano Oiled Leather Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Twin strap, sling-back sandal has individual buckles for an adjustable fit you\'ll really appreciate. Oiled leather upper for durable comfort and style. With Birkenstock\'s signature cork footbed with double Jute layer for better than barefoot comfort. Raised toe bar, footbed form, arch support and deep heel cup with footbed liner combine to align your foot naturally for even weight distribution and proper support.\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a unisex item available in two widths.  The narrow width fits like a ladies Medium \"B-C\" width and is a true narrow for Men.  The Regular width fits like a women\'s wide \"D\" width and fits like a Men\'s medium.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork, Latex, Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Oiled Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',125.00,125.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(349374,'Mayari Birkibuc','/pm/birke/birke349374_164706_jb1.jpg;/pm/birke/birke349374_164706_jb2.jpg;/pm/birke/birke349374_164706_jb3.jpg;/pm/birke/birke349374_164706_jb5.jpg;/pm/birke/birke349374_164706_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Mayari Birkibuc Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A criss-cross strap at the toe adds a delicate touch to the women\'s Birkenstock Mayari Birkibuc sandal. Made with a soft and supple synthetic upper that offers a nubuck-like texture along with a supportive backing. The straps at the upper are adjustable with buckle closures for an easy fit and feel. This Birkenstock sandal for women is designed with a contoured cork footbed that molds to your foot for enhanced arch support and a deep heel cup all lined with suede. The Birkenstock Mayari is constructed with an EVA sole that is extremely durable and lightweight while offering shock-absorption. \n            \n                <ul class=\"detail_comp\"><li>Synthetic upper\n</li><li>Supportive backing\n</li><li>Adjustable buckle straps\n</li><li>Contoured cork footbed \n</li><li>Arch support\n</li><li>Deep heel cup\n</li><li>EVA sole\n</li><li>Shock-absorbing \n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Women</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-womens.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large.  If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 6. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork, Latex, Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Birkibuc</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(349376,'Arizona Oiled Leather','/pm/birke/birke349376_24557_jb1.jpg;/pm/birke/birke349376_24557_jb2.jpg;/pm/birke/birke349376_24557_jb3.jpg;/pm/birke/birke349376_24557_jb5.jpg;/pm/birke/birke349376_24557_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Arizona Oiled Leather Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The classic Birkenstock Arizona oiled leather sandal is the style you know and love, crafted in a durable oiled nubuck leather. The enduring Arizona silhouette features individually adjustable buckle straps fastened to a cork footbed and backed by an EVA outsole. Double jute layer, pronounced arch support, a roomy toe box, deep heel cup, raised toe bar, and other ergonomic features contribute to Birkenstocks famous \"better than barefoot\" feel. Nubuck straps feature an open selvage finish for a handcrafted natural look.   \n            \n                <ul class=\"detail_comp\"><li>Oiled nubuck leather straps\n</li><li>Individually adjustable buckle straps\n</li><li>Cork footbed\n</li><li>EVA outsole\n</li><li>Double Jute layer\n</li><li>Ergonomic design\n</li><li>Open selvage finish\n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a unisex item available in two widths.  The narrow width fits like a ladies Medium \"B-C\" width and is a true narrow for Men.  The Regular width fits like a women\'s wide \"D\" width and fits like a Men\'s medium.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork, Latex, Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',125.00,125.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(349379,'Mayari Birko Flor','/pm/birke/birke349379_264986_jb1.jpg;/pm/birke/birke349379_264986_jb2.jpg;/pm/birke/birke349379_264986_jb3.jpg;/pm/birke/birke349379_264986_jb5.jpg;/pm/birke/birke349379_264986_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Mayari Birko Flor Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Birkenstock Mayari Birko Flor is an essential toe loop sandal with classic Birkenstock features. Crafted in synthetic Birko-Flor, these footbed sandals\' leather-like straps have adjustable buckle closures and a soft backing. Suede-lined contoured cork footbed is ergonomically designed with pronounced arch support, a deep heel cup, and a roomy toe box backed by an EVA sole for shock absorption. With such advanced comfort features, you won\'t have to sacrifice style for comfort in these Birkenstock sandals. \n            \n                <ul class=\"detail_comp\"><li>Birko-Flor straps with soft backing\n</li><li>Adjustable buckle closure\n</li><li>Suede sockliner\n</li><li>Contoured cork footbed\n</li><li>EVA outsole\n</li><li>Made in Germany\n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Women</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-womens.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large.  If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 6. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork, Latex, Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Birko Flor</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(349381,'Arizona Soft Footbed Oil Leather Sandal','/pm/birke/birke349381_24557_jb1.jpg;/pm/birke/birke349381_24557_jb2.jpg;/pm/birke/birke349381_24557_jb3.jpg;/pm/birke/birke349381_24557_jb5.jpg;/pm/birke/birke349381_24557_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Arizona Soft Footbed Oil Leather Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The classic Birkenstock Arizona sandal is famous for its comfortable fit and easy style. This Breezy slide sandal has double straps made of oiled leather that is breathable, durable, comfortable, and softens over time. Individual, adjustable buckles on the straps make for a custom fit. The soft footbed incorporates a foam layer between the cork layer and the suede liner which means that millions of microscopic air bubbles cushion your feet as you walk while providing moderate arch support. EVA sole is flexible, durable, lightweight, and shock-resisting. Slip into these timeless favorite Birkenstock sandals today. \n            \n                <ul class=\"detail_comp\"><li>Slide sandal\n</li><li>Oiled leather straps\n</li><li>Buckles for adjustable fit\n</li><li>Soft footbed\n</li><li>EVA sole\n</li></ul>\n            \n                <br><b><a href=\"/birkenstock-soft-footbed-collection.htm?dnl=1\"><font color=\"blue\"> <br>Shop more Birkenstock Soft Footbed sandals</font></a></b>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a unisex item available in two widths.  The narrow width fits like a ladies Medium \"B-C\" width and is a true narrow for Men.  The Regular width fits like a women\'s wide \"D\" width and fits like a Men\'s medium.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork, Latex, Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',110.00,110.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(349384,'Granada Soft Footbed','/pm/birke/birke349384_24557_jb1.jpg;/pm/birke/birke349384_24557_jb2.jpg;/pm/birke/birke349384_24557_jb3.jpg;/pm/birke/birke349384_24557_jb5.jpg;/pm/birke/birke349384_24557_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Granada Soft Footbed Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Named after the breathtaking medieval Spanish city, the Birkenstock Granada Soft Footbed Sandal features intricate cutouts and breathtaking design worthy of its famous namesake. The premium oiled leather upper with dual adjustable straps is anchored by Birkenstocks famous soft footbed which incorporates a foam layer between the cork footbed and suede liner for a soft feel. Deep heel cup, roomy toe box, arch support, and EVA outsole are characteristic of all Birkenstock sandals. \n            \n                <ul class=\"detail_comp\"><li>Dual strap oiled leather upper \n</li><li>Cutout detailing\n</li><li>Adjustable buckle closures\n</li><li>Soft footbed\n</li><li>Biomechanically designed\n</li><li>EVA outsole\n</li><li>Made in Germany\n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Women</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-womens.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork, Latex, Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Oiled Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',135.00,135.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(350735,'St Johnsbury','/pm/rockp/rockp350735_23915_jb1.jpg;/pm/rockp/rockp350735_23915_jb2.jpg;/pm/rockp/rockp350735_23915_jb3.jpg;/pm/rockp/rockp350735_23915_jb5.jpg;/pm/rockp/rockp350735_23915_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dunham St Johnsbury Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Summer plans are always changing. So why not have a sandal that can change with them? Introducing the St. Johnsbury, a three-strap wonder with a removable backstrap you can slip off and tuck into your beach bag in a moment\'s notice. The <b>St. Johnsbury</b>. It\'s as spontaneous as you are.\n            \n                <li>Adjustable hook and loop closure allows for personalized comfort and fit</li><li>Full grain leather upper</li><li>Pigskin and Textile Footbed cover</li><li>Removable molded EVA and Memory Foam footbed</li><li>Solid rubber outsole</li><li>Waterproof materials</li><li>Soft, breathable linings</li><li>Available in whole sizing only</li>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Weight:</span>\n            \n            11.6 oz.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',114.95,114.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(354843,'Authentic Lo Pro Sneaker','/pm/vansi/vansi354843_28642_jb1.jpg;/pm/vansi/vansi354843_28642_jb2.jpg;/pm/vansi/vansi354843_28642_jb3.jpg;/pm/vansi/vansi354843_28642_jb4.jpg;/pm/vansi/vansi354843_28642_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Authentic Lo Pro Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A low profile rubber outsole defines the silhouette of the cool Vans authentic Lo Pro sneaker. Classic canvas construction meets practical metal eyelets and a lace-up front in the upper. EVA insert cushions for all-day comfort. Vans flag label and micro waffle tread pattern certify this style as a Vans authentic original. \n            \n                <ul class=\"detail_comp\"><li>Low-profile rubber outsole\n</li><li>Canvas upper\n</li><li>Metal eyelets\n</li><li>Lace-up\n</li><li>Vans flag label\n</li><li>Micro waffle tread pattern\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes. For example, if you wear a Women\'s size 6, please order a size 4.5</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',29.95,29.95,2,0,0,'2018-04-30 09:50:25','2018-04-30 09:50:25'),(357984,'Arroyo II','/pm/keenf/keenf357984_299596_jb1.jpg;/pm/keenf/keenf357984_299596_jb2.jpg;/pm/keenf/keenf357984_299596_jb3.jpg;/pm/keenf/keenf357984_299596_jb5.jpg;/pm/keenf/keenf357984_299596_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Arroyo II Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Arroyo II combines all the best features of a trail shoe and a sandal. Open vents on the side of the waterproof leather upper provide maximum breathability. The multi directional lug outsole bites into varied terrain with determination. This hybrid design redefines outdoor footwear with performance you can count on.\n            \n                Features Removable metatomical Footbed, S3 Heel support structure, Secure foot lace capture system, Torsion stability ESS shank, and Washable waterproof leather upper.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 8 1/2, we recommend purchasing a size 8. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Waterproof Leather, Nylon, Hydrophobic Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(365818,'Kayla Sandal','/pm/yalee/yalee365818_216493_jb1.jpg;/pm/yalee/yalee365818_216493_jb2.jpg;/pm/yalee/yalee365818_216493_jb3.jpg;/pm/yalee/yalee365818_216493_jb4.jpg;/pm/yalee/yalee365818_216493_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Naot Kayla Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Nestle into the softness and luxury of Naot shoes and sandals. Feel the relaxation envelop your being as you slip into the natural fit of Naot\'s stylish women\'s footwear.\n            \n                The Kayla is from the Elegant collection by Naot Footwear. This is a three-strap sandal features a hook and loop strap at the instep and a backstrap for added stability and support.\n            \n                Features our patented footbed which combines a blend of natural latex and light flakes of cork designed to adapt to the shape of the foot, absorb shock and remove moisture. Coated in high quality, pampering suede that helps absorb moisture. A layer of natural latex sponge padding absorbs shock and provides a caressing softness while walking.\n            \n                Hallux support enables natural hold by the big toe, prevents the foot from slipping forward, and improves the foots hold on the shoe. The elevated center of the insole releases pressure in the joints of the central part of  the foot. Arch support enables the weight of the body to be correctly distributed and reduces pressure generated by the spinal column and joints. A deep heel indentation helps the body\'s balance and maintains the natural shape of the pad of the heel that protects the heel bone.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',134.95,134.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(382180,'SRT Elliot','/pm/wolve/wolve382180_374590_jb1.jpg;/pm/wolve/wolve382180_374590_jb5.jpg;/pm/wolve/wolve382180_374590_jb6.jpg;/pm/wolve/wolve382180_374590_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Stride Rite SRT Elliot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Sensory Response Technology (SRT) Elliot features moisture-wicking, eco-friendly lining for comfort and breathability and a self-molding footbed with contoured heel cradle.\n            \n        </span></div><!--end product_des