/pm/birke/birke641700_313675_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Arizona Amalfi Leather Sandal with Soft Footbed Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The quintessential Birkenstock silhouette gets a comfort upgrade in the Birkenstock Arizona Amalfi Leather Sandal with a Soft Footbed. High-quality leather with a durable patina finish softens and conforms to your foot over time. In the soft footbed, contoured cork features a deep heel cup, roomy toe box, and foam cushioning covered by a suede sockliner. EVA outsole provides traction and absorbs shock. These classic Birkenstocks are finished with individually adjustable buckle straps for a personalized fit, essential Birkenstock look, and unparalleled comfort. \n            \n                <ul class=\"detail_comp\"><li>Leather upper\n</li><li>Ergonomically designed cork footbed\n</li><li>Foam cushioning\n</li><li>Suede sockliner\n</li><li>EVA outsole\n</li><li>Individually adjustable buckle straps\n</li><li>Made in Germany\n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a unisex item available in two widths.  The narrow width fits like a ladies Medium \"B-C\" width and is a true narrow for Men.  The Regular width fits like a women\'s wide \"D\" width and fits like a Men\'s medium.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork/Latex/Suede</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Oiled Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',135.00,135.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(654750,'2750 Classic','/pm/steve/steve654750_456659_jb1.jpg;/pm/steve/steve654750_456659_jb2.jpg;/pm/steve/steve654750_456659_jb4.jpg;/pm/steve/steve654750_456659_jb5.jpg;/pm/steve/steve654750_456659_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Superga 2750 Classic Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                An international favorite, the Superga 2750 Classic puts a European spin on the classic lace-up sneaker. This canvas kick features a wide variety of essential colors, lace-up front with metal eyelets, and a natural rubber crepe-textured outsole. The cushioned footbed enhances comfort for all-day wear and incorporates a 1-inch platform. The canvas upper is cotton lined for a more comfortable experience, and the side features a signature Superga tag. \n            \n                <ul class=\"detail_comp\"><li>Cotton-lined canvas upper\n</li><li>Lace-up front\n</li><li>Cushioned footbed\n</li><li>1-inch platform\n</li><li>Signature Superga side tag\n</li></ul>\n            \n                <a href=\"/superga-casual/category_286708\"><font color=\"blue\"> <br><b>Shop more Superga Shoes here.</b></font></a>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(655245,'2976 Chelsea Boot','/pm/drmar/drmar655245_406553_jb1.jpg;/pm/drmar/drmar655245_406553_jb2.jpg;/pm/drmar/drmar655245_406553_jb3.jpg;/pm/drmar/drmar655245_406553_jb4.jpg;/pm/drmar/drmar655245_406553_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dr. Martens 2976 Chelsea Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                This utilitarian Dr. Martens 2976 Chelsea boot feels so fresh and modern with its leather upper, easy side elastic gore, branded pull tab and Chelsea silhouette you almost forget its historical beginnings as a equestrian and farming shoe. Durable Goodyear welt where the sole is heat sealed and sewn to the upper extends the lifetime of these boots, while air-cushioned sole is slip resistant and comfortable.  With multiple leather options like airwairs original smooth, Carpathian, Inuck, crazy horse, Temperley, and more you\'ll find there\'s a Dr. Martens Chelsea boot to fit every lifestyle.  \n            \n                <ul class=\"detail_comp\"><li>Leather upper\n</li><li>Side elastic gore\n</li><li>Branded back pull tab\n</li><li>Chelsea silhouette\n</li><li>Goodyear welt \n</li><li>Air-cushioned, slip resistant sole \n</li></ul>\n            \n                <p> </p> <p><b>Dr. Martens Size Chart (orders placed in UK sizes):</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/drmar/DrMartensAdultsizechart.jpg?yocs=c_f_&amp;yoloc=ap\">\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Rugged Crazy Horse Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',144.95,144.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(657669,'Vigor 2.0 Serpentine','/pm/skech/skech657669_70674_jb1.jpg;/pm/skech/skech657669_70674_jb2.jpg;/pm/skech/skech657669_70674_jb3.jpg;/pm/skech/skech657669_70674_jb5.jpg;/pm/skech/skech657669_70674_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Vigor 2.0 Serpentine Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Classic athletic style meets even more comfort with the SKECHERS Vigor 2.0 - Serpentine shoe. Smooth leather and synthetic upper in a lace up athletic training sneaker with stitching, overlay and perforation accents.\n            \n                Padded collar and tongue. Soft fabric shoe lining. Memory Foam topped full length cushioned comfort insole. Shock absorbing midsole. Stabilized midfoot and heel. Flexible rubber traction outsole.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 9, we recommend purchasing a size 9 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(658728,'Classic','/pm/bogsw/bogsw658728_243710_jb1.jpg;/pm/bogsw/bogsw658728_243710_jb2.jpg;/pm/bogsw/bogsw658728_243710_jb3.jpg;/pm/bogsw/bogsw658728_243710_jb4.jpg;/pm/bogsw/bogsw658728_243710_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Bogs Classic Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                This 100% waterproof boot features a durable hand-lasted rubber over a four-way stretch inner bootie. Also includes easy pull-on handles along with a 7mm Bogs Neo-Tech insulation and Bogs Max-Wick moisture-wicking lining to stay dry and comfortable; nonmarking and self-cleaning outsole; and DuraFresh anti-odor odor protection insole. Comfort rated from temperate to -30°F.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run small. If you normally order a 1/2 size it is recommended that you order the next full size up.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Rubber</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(658918,'Authentic','/pm/vansi/vansi658918_28450_jb1.jpg;/pm/vansi/vansi658918_28450_jb2.jpg;/pm/vansi/vansi658918_28450_jb3.jpg;/pm/vansi/vansi658918_28450_jb6.jpg;/pm/vansi/vansi658918_28450_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Authentic Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Authentic is the shoe that has stayed true to its roots and has not changed since its 1966 origin. Now it has become a classic for any casual occasion. The Authentic is the first lace-up skate shoe featuring our signature waffle bottom construction. The Toddler version is made with a softer and more pliable construction making it easier when learning to walk.\n            \n                Now it has become a classic for any casual occasion. The Authentic is the first lace-up skate shoe featuring our signature waffle bottom construction, original vulcanized sole and canvas uppers.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',29.95,29.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(668120,'Sophie Sandal','/pm/dansk/dansk668120_456422_jb1.jpg;/pm/dansk/dansk668120_456422_jb2.jpg;/pm/dansk/dansk668120_456422_jb3.jpg;/pm/dansk/dansk668120_456422_jb5.jpg;/pm/dansk/dansk668120_456422_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dansko Sophie Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Sophie is your go-to sandal that balances fun and function.  Two adjustable bands provide a secure fit while your foot is cushioned and supported for all-day comfort.\n            \n                <ul class=\"detail_comp\"><li>Durable soft leather linings for optimal interior comfort.</li><li> Leather wrapped, dual-density PU footbed for superior underfoot cushioning.</li><li> Dual-density board insole with steel shank for ground insulation and stability.</li><li> Lightweight PU outsole for all-day comfort.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small. For an accurate fit we recommend purchasing a Euro size larger than you typically purchase. For example, if you normally purchase a size 35, we recommend purchasing a size 36.</div>\n            \n		</div><!--end product_specs-->\n	</div>',83.95,83.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(673768,'Tide II Sandal','/pm/vioni/vioni673768_291562_jb1.jpg;/pm/vioni/vioni673768_291562_jb2.jpg;/pm/vioni/vioni673768_291562_jb3.jpg;/pm/vioni/vioni673768_291562_jb4.jpg;/pm/vioni/vioni673768_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Tide II Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                With the extreme comfort of the Voinic Tide II Sandal with Orthaheel technology the world is your oyster. Orthaheel technology is biomechanically designed to support your arches and heels for all-day comfort. Great for those with plantar fasciitis heel stress, the Tide II\'s built-in orthotics have been shown to reduce heel pain in a peer-reviewed clinical study. Additionally, the lightweight, flexible, medium-density EVA midsole absorbs shock and reduces stress, while the TPR rubber outsole provides traction. A simple woven and leather upper strap and toe post ensure your sandals stay put. Fun colors and patterns make the Tide II perfect for any warm weather adventure. \n            \n                <ul class=\"detail_comp\"><li>Orthaheel Technology\n</li><li>Built-in heel orthotic\n</li><li>Lightweight flexible EVA midsole\n</li><li>TPR rubber outsole\n</li><li>Leather/woven upper straps and toe post\n</li><li>American Podiatric Medical Association seal of approval \n</li></ul>\n            \n                <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/jd7GasBFXoc?rel=0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\n            \n                <p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/vionic/NaturalAlignment.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large.  If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 6. \n\n<br>For the greatest comfort, Vionic recommends wearing your new Tide II sandal for just a few hours for the first few days to allow your feet to adjust to the new level of orthotic comfort and support. Within one to two weeks you should find the product completely comfortable and supportive.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TPR</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Woven/Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(674596,'Vigor 2.0 Trait Cross Training Shoe','/pm/skech/skech674596_41823_jb1.jpg;/pm/skech/skech674596_41823_jb2.jpg;/pm/skech/skech674596_41823_jb3.jpg;/pm/skech/skech674596_41823_jb5.jpg;/pm/skech/skech674596_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Vigor 2.0 Trait Cross Training Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Get even more sporty style and comfort out of the SKECHERS Vigor 2.0 - Trait shoe. Leather, synthetic and mesh fabric upper in a lace up athletic training sneaker with stitching and overlay accents.\n            \n                Soft fabric shoe lining. Memory Foam full length cushioned comfort insole. Shock absorbing supportive midsole. Stabilized midfoot and heel. Flexible rubber traction outsole. 1 1/4 inch heel.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 9 1/2, we recommend purchasing a size 9. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Trubuck Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',48.00,48.00,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(677833,'Milano Amalfi Leather with Soft Footbed','/pm/birke/birke677833_313675_jb1.jpg;/pm/birke/birke677833_313675_jb2.jpg;/pm/birke/birke677833_313675_jb3.jpg;/pm/birke/birke677833_313675_jb5.jpg;/pm/birke/birke677833_313675_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Milano Amalfi Leather with Soft Footbed Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Birkenstock Milano Amalfi Leather with Soft Footbed adds refreshing interest to an everyday classic with its adjustable heel strap. Featuring a smooth and supple leather at the upper with a patina finish. The Milano Amalfi by Birkenstock offers a soft, contoured cork footbed that molds to the shape of your foot for a custom fit at the midsole. The cushion support allows for added arch support with its soft foam cushioning and a heel cup. This Birkenstock slide sandal is made with a durable and flexible EVA outsole with shock-absorbing features. The straps are adjustable.\n            \n                <ul class=\"detail_comp\"><li>Adjustable heel strap\n</li><li>Leather upper with patina finish\n</li><li>Countoured suede cork footbed\n</li><li>Custom fit molding at midsole\n</li><li>Arch support\n</li><li>Heel cup\n</li><li>EVA outsole\n</li><li>Shock-absorption\n</li><li>Adjustable straps \n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Adult Unisex</b></p> <img src=\"https://cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-unisex.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a unisex item available in two widths.  The narrow width fits like a ladies Medium \"B-C\" width and is a true narrow for Men.  The Regular width fits like a women\'s wide \"D\" width and fits like a Men\'s medium.</div>\n            \n		</div><!--end product_specs-->\n	</div>',135.00,135.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(679584,'Cobb Hill Aubrey T Strap Sandal','/pm/thero/thero679584_424156_jb1.jpg;/pm/thero/thero679584_424156_jb2.jpg;/pm/thero/thero679584_424156_jb5.jpg;/pm/thero/thero679584_424156_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Rockport Cobb Hill Aubrey T Strap Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Influenced by European styles, the low-heeled Cobb Hill Aubrey T-Strap sandal is crafted in burnished leather and lends a sophisticated air to any ensemble. This detailed shoe features an adjustable strap and buckle closure with stretch gore for a flexible, sure fit. Contoured EVA footbed covered in pigskin and textile provides arch support to enhance comfort. Stability shank embedded into midsole contributes to a smoother, more confident gait. Thermoplastic rubber (TR) outsole provides traction control. Slip into these comfy Cobb Hill sandals to make a chic statement. \n            \n                <ul class=\"detail_comp\"><li>Burnished leather upper\n</li><li>Adjustable strap and buckle closure\n</li><li>Side elastic gore\n</li><li>Contoured EVA footbed \n</li><li>Stability shank in midsole\n</li><li>Thermoplastic rubber (TR) outsole\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Weight:</span>\n            \n            8.7 oz.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TR Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Full Grain Burnished Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(691750,'Bella II Sandal','/pm/vioni/vioni691750_291562_jb1.jpg;/pm/vioni/vioni691750_291562_jb2.jpg;/pm/vioni/vioni691750_291562_jb3.jpg;/pm/vioni/vioni691750_291562_jb4.jpg;/pm/vioni/vioni691750_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Bella II Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Long-lasting cushion comfort is ensured in the women\'s Vionic Bella II Sandal. Made with a smart EVA midsole that reduces foot fatigue and pain throughout your knees and ankles. The Vionic Bella II Sandal offers a biomechanical orthotic footbed and a deep heel cup for plush support and enhanced stability. The rubber outsole is constructed with a grip texture for advanced traction protection and durability on a variety of sufaces.<br>\n            \n                <br><p></p><ul class=\"detail_comp\"><li>EVA midsole\n</li><li>Biomechanical orthotic footbed\n</li><li>Deep heel cup\n</li><li>Rubber grip outsole \n</li><li>Multi-surface traction protection\n</li></ul>\n            \n                <br><p>Scientifically Proven to Alleviate Heel Pain*</p><p><br>*Based on a peer-reviewed clinical study partially funded by Vionic on people experiencing moderate, non-traumatic heel pain. Vionic contoured sandals were shown to be comparable in effectiveness to Vionic orthotic inserts. \n            \n                </p><p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"http://www.shoebuy.com//images/desc/vionic/NaturalAlignment.jpg\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(691751,'Amber Sandal','/pm/vioni/vioni691751_339336_jb1.jpg;/pm/vioni/vioni691751_339336_jb2.jpg;/pm/vioni/vioni691751_339336_jb3.jpg;/pm/vioni/vioni691751_339336_jb4.jpg;/pm/vioni/vioni691751_339336_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Amber Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A cute strappy slingback sandal perfect for any warm weather occasion, the Vionic Amber Sandal has four adjustability points for a personalized fit and exceptional comfort features that have earned this sandal the American Podiatric Medical Association seal of approval and commendation from Dr. Andrew Weil. \n            \n                <ul class=\"detail_comp\"><li>Manmade or natural cork upper\n</li><li>Microfiber lining\n</li><li>Molded EVA midsole\n</li><li>Rubber outsole with patterned tread\n</li><li>Arch support\n</li><li>APMA seal of approval\n</li><li>Recommended by Dr. Andrew Weil\n</li><li>Helps alleviate heel pain\n</li><li>Flexible\n</li><li>Shock absorbing \n</li></ul>\n            \n                <p> </p>\n<p><b>Support Technology:</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/vionic/NaturalAlignment.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Front Height:</span>\n            \n            1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Weight:</span>\n            \n            8 oz</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size\n<br> For the greatest comfort, Vionic recommends wearing your new footwear for just a few hours for the first few days to allow your feet to adjust to the new level of orthotic comfort and support. Within one to two weeks you should find the product completely comfortable and supportive.</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(694873,'Z/1 EcoTread','/pm/wolve/wolve694873_399649_jb1.jpg;/pm/wolve/wolve694873_399649_jb2.jpg;/pm/wolve/wolve694873_399649_jb3.jpg;/pm/wolve/wolve694873_399649_jb5.jpg;/pm/wolve/wolve694873_399649_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Chaco Z/1 EcoTread Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Let your kid have fun in the eco-friendly Z/1® EcoTread. This sandal has a custom injection molded ladder lock for a secure fit and a sturdy LUVSEAT polyurethane footbed for comfort. The non-marking EcoTread rubber outsole contains 25% recycled content with 2mm lug depth for all-purpose traction.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EcoTread Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Polyester</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(694881,'ZX/1 EcoTread','/pm/wolve/wolve694881_160268_jb1.jpg;/pm/wolve/wolve694881_160268_jb2.jpg;/pm/wolve/wolve694881_160268_jb3.jpg;/pm/wolve/wolve694881_160268_jb4.jpg;/pm/wolve/wolve694881_160268_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Chaco ZX/1 EcoTread Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Your kid will enjoy walking in the comfortable, soft ZX/1® Ecotread. This classic basket weave inspired sandal features polyester jacquard webbing double straps, adjustable and sturdy high tensile webbing risers, and custom injection molded ladder lock for correct fit. It comes with sturdy LUVSEAT polyurethane footbed and non-marking EcoTread rubber outsole containing 25% recycled content.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EcoTread Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Polyester</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.95,44.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(696675,'Reggae Zig Swag','/pm/skech/skech696675_41827_jb1.jpg;/pm/skech/skech696675_41827_jb2.jpg;/pm/skech/skech696675_41827_jb3.jpg;/pm/skech/skech696675_41827_jb5.jpg;/pm/skech/skech696675_41827_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Reggae Zig Swag Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                \"Swomfort.\" That\'s what it\'s called when you combine the swag of a cool design with the comfort of a great experience, and more importantly, that\'s what you get with the Skechers Reggae Zig-Swag Sandal. Soft woven canvas crisscross upper features a zig zag design and signature Sketchers branding imbuing this sandal with major swag. Cushioned comfort footbed, adjustable hook and loop closure, and traction outsole combine to create a comfortable base with a 1-inch footbed platform. These swaggy sketchers sandals will liven up any summer style.\n            \n                <ul class=\"detail_comp\"><li>Woven canvas upper\n</li><li>Zig-zag print\n</li><li>Crisscross straps\n</li><li>Cushioned footbed\n</li><li>Traction outsole\n</li><li>Adjustable hook and loop closure\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Canvas Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',34.95,34.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(697883,'Bushnell','/pm/conso/conso697883_995_jb1.jpg;/pm/conso/conso697883_995_jb2.jpg;/pm/conso/conso697883_995_jb3.jpg;/pm/conso/conso697883_995_jb5.jpg;/pm/conso/conso697883_995_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>OTBT Bushnell Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The strappy stylish Bushnell wedge sandal from OTBT is a perfect platform wedge for warm-weather weddings, casual cocktails, or anything in between. The reasonable 3-inch synthetic wedge heel and 1-inch platform makes the Bushnell a comfortable option that still adds height. The crisscrossing elastic and leather straps in contrasting colors keep your shoes secured and add a stylish touch to this practical platform. Explore the array of color and pattern options to put the perfect finishing touch on your date night outfit. \n            \n                <ul class=\"detail_comp\"><li>Synthetic platform wedge sandal\n</li><li>3-inch heel\n</li><li>1-inch platform\n</li><li>Leather and elastic straps\n</li><li>Diverse color and pattern options\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            3 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Synthetic</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Elastic</div>\n            \n		</div><!--end product_specs-->\n	</div>',91.45,91.45,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(700748,'Old Skool V','/pm/vansi/vansi700748_28642_jb1.jpg;/pm/vansi/vansi700748_28642_jb2.jpg;/pm/vansi/vansi700748_28642_jb3.jpg;/pm/vansi/vansi700748_28642_jb6.jpg;/pm/vansi/vansi700748_28642_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Old Skool V Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The classic Old Skool V is the perfect hip shoe for your growing kid. With the easy hook and loop closure, breathable canvas uppers, padded insole, and cool design, your kid will be a fan of Vans for life.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(701271,'Seacamp II CNX','/pm/keenf/keenf701271_341268_jb1.jpg;/pm/keenf/keenf701271_341268_jb2.jpg;/pm/keenf/keenf701271_341268_jb3.jpg;/pm/keenf/keenf701271_341268_jb5.jpg;/pm/keenf/keenf701271_341268_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Seacamp II CNX Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The new essential hybrid water sandal for active kids who like to splash around. This low-profile KEEN.CNX allows little feet increased flexibility and freedom. With a grippy rubber sole that won\'t mark up the floor and KEEN\'s Secure Fit Lace Capture System, they will be ready for anything.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 1, we recommend purchasing a size 1 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(701277,'Seacamp II CNX','/pm/keenf/keenf701277_341268_jb1.jpg;/pm/keenf/keenf701277_341268_jb2.jpg;/pm/keenf/keenf701277_341268_jb3.jpg;/pm/keenf/keenf701277_341268_jb5.jpg;/pm/keenf/keenf701277_341268_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Seacamp II CNX Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                High energy kids need a high-quality shoe that can keep up, especially when warm weather brings waterfront play. The Keen Seacamp II CNX shoe for kids is the perfect cross between a sandal and a sneaker. Low profile quick-drying webbed upper features drawcord Secure Fit Lace Capture system, durable polyester construction, and flexibility and breathability. Hook and loop strap makes for easy on and off while Hydrophobic mesh lining is comfortable next to kids\' feet. Metatomical EVA footbed cradles and supports arches to enhance comfort. Nonmarking multi-directional lug outsole provides traction and extends into a toe guard for extra protection. The CNX designation means that these sandals weigh under 10oz for an efficient lightweight experience. The best part? These Keen shoes for kids are machine washable which means they can stand up to whatever your kids throw at them. \n            \n                <ul class=\"detail_comp\"><li>Low profile\n</li><li>Polyester webbing\n</li><li>Secure Fit Lace Capture system\n</li><li>Hook and loop strap\n</li><li>Hydrophobic mesh lining\n</li><li>Metatomical EVA footbed\n</li><li>Nonmarking \n</li><li>Multi-directional lug sole\n</li><li>Toe guard\n</li><li>Lightweight \n</li><li>Machine washable\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 12, we recommend purchasing a size 12 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(703320,'Bolt Plus X2 Lighted','/pm/bbcin/bbcin703320_446609_jb1.jpg;/pm/bbcin/bbcin703320_446609_jb5.jpg;/pm/bbcin/bbcin703320_446609_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Bolt Plus X2 Lighted Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A trendy low profile sneaker that has a power strap and elastic lace closure. Features an embossed X2 logo on quarter, motion activated lights on quarter and 2x2 double wheels.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',45.00,45.00,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(703322,'Launch Sneaker','/pm/bbcin/bbcin703322_153032_jb1.jpg;/pm/bbcin/bbcin703322_153032_jb2.jpg;/pm/bbcin/bbcin703322_153032_jb3.jpg;/pm/bbcin/bbcin703322_153032_jb5.jpg;/pm/bbcin/bbcin703322_153032_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Launch Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Don\'t just walk; launch, with the Heelys Launch sneaker for kids.  Classic style elements like a canvas upper, lace-up front, and rubber outsole are consistent with classic skate shoe styling while a concealed ABEC 1 Bearing and 1 FATS low profile wheel means that kids don\'t just look the part of a skater, they live it. Mesh lining, padded collar, and ninja grip tread pattern ensure both comfort and safety. \"Wheel-ize\" your potential for fun with these Heelys shoes. \n            \n                <ul class=\"detail_comp\"><li>Canvas upper\n</li><li>Lace-up front\n</li><li>Rubber outsole with Ninja Grip tread\n</li><li>ABEC 1 bearing\n</li><li>1 FATS low profile wheel\n</li><li>Mesh lining\n</li><li>Padded collar\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',32.99,32.99,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(703835,'Chandler CNX','/pm/keenf/keenf703835_449058_jb1.jpg;/pm/keenf/keenf703835_449058_jb2.jpg;/pm/keenf/keenf703835_449058_jb6.jpg;/pm/keenf/keenf703835_449058_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Chandler CNX Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Streamlined and flexible, light and secure, the Chandler CNX performs. Quick-d