we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Microfiber/Polyester</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(713846,'Chranson','/pm/thero/thero713846_5414_jb1.jpg;/pm/thero/thero713846_5414_jb2.jpg;/pm/thero/thero713846_5414_jb3.jpg;/pm/thero/thero713846_5414_jb5.jpg;/pm/thero/thero713846_5414_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Rockport Chranson Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                From casual strolling to walking, the Chranson rocks. Sturdy and athletic, yet casual and built for comfort, they\'ve got the grip to keep you moving forward. The rubber outsole provides a durable grip on a variety of surfaces and EVA provides lightweight shock absorption to help reduce foot fatigue. The latex footbed cushions the foot to help reduce foot fatigue, the mesh lining provides enhanced breathability and drying, and comfort technology provides shock absorbing heel cushioning.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <