highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(737632,'UNEEK Sandal','/pm/keenf/keenf737632_465361_jb1.jpg;/pm/keenf/keenf737632_465361_jb2.jpg;/pm/keenf/keenf737632_465361_jb6.jpg;/pm/keenf/keenf737632_465361_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen UNEEK Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Created from two cords and a sole, UNEEK has an entirely new footwear construction that challenges the convention of footwear manufacturing. We began by examining the foot, then redesigned every single piece of the shoe to best compliment the foot\'s shape. We started with one material, the cord, and built off of that, only adding what was absolutely necessary. There is beauty and elegance in its simplicity, which promises one-of-a-kind fit and feel that is unique to UNEEK. It features an anatomical microfiber footbed, a microfiber heel back, a lightweight PU midsole, a free moving cord junction that allows the upper to adjust for custom fit, and a razor-siped high-traction rubber outsole for secure footing.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 9, we recommend purchasing a size 9 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(737696,'Bali','/pm/keenf/keenf737696_463847_jb1.jpg;/pm/keenf/keenf737696_463847_jb2.jpg;/pm/keenf/keenf737696_463847_jb6.jpg;/pm/keenf/keenf737696_463847_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Bali Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Bali is the ideal sandal for poolside or beachfront. It features quick-dry straps, an SBR lining for comfort and moisture control, an EVA footbed with arch support, a compression-molded EVA midsole, and a non-marking rubber outsole.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Polyester Webbing</div>\n            \n		</div><!--end product_specs-->\n	</div>',69.95,69.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(738138,'Tide Rhinestones','/pm/vioni/vioni738138_291562_jb1.jpg;/pm/vioni/vioni738138_291562_jb2.jpg;/pm/vioni/vioni738138_291562_jb3.jpg;/pm/vioni/vioni738138_291562_jb4.jpg;/pm/vioni/vioni738138_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Tide Rhinestones Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                New to the Tide family, Tide Rhinestones is designed with the rebel in mind. A total rock star, this timeless flip flop with bling takes the spotlight.\n            \n                <ul class=\"detail_comp\"><li>Orthaheel Technology\n</li><li>Built-in heel orthotic\n</li><li>Lightweight flexible EVA midsole\n</li><li>TPR rubber outsole\n</li><li>Leather/woven upper straps and toe post\n</li><li>American Podiatric Medical Association seal of approval \n</li></ul>\n            \n                <p><br>Scientifically Proven to Alleviate Heel Pain*</p><p><br>*Based on a peer-reviewed clinical study partially funded by Vionic on people experiencing moderate, non-traumatic heel pain. Vionic contoured sandals were shown to be comparable in effectiveness to Vionic orthotic inserts. \n            \n                </p><p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/vionic/NaturalAlignment.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large.  If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 6. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Durable Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Suede</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(739655,'Hedgehog Fastpack GTX','/pm/theno/theno739655_370558_jb1.jpg;/pm/theno/theno739655_370558_jb2.jpg;/pm/theno/theno739655_370558_jb3.jpg;/pm/theno/theno739655_370558_jb4.jpg;/pm/theno/theno739655_370558_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>The North Face Hedgehog Fastpack GTX Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                This lightweight, waterproof hiker travels fast with the support of a CRADLE GUIDE midsole, CRADLE technology, durable VIBRAM® outsole and a waterproof, breathable GORE-TEX® membrane.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',119.95,119.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(739989,'Leisa Cacti','/pm/thecl/thecl739989_11493_jb1.jpg;/pm/thecl/thecl739989_11493_jb2.jpg;/pm/thecl/thecl739989_11493_jb3.jpg;/pm/thecl/thecl739989_11493_jb4.jpg;/pm/thecl/thecl739989_11493_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Leisa Cacti Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                For effortless style, slip on the Leisa Cacti Sandal by Clarks. The Leisa Cacti features three hook and loop closures for a personal fit and easy on/off wear. The open-toe sandal provides a lightweight EVA outsole that supports and cushions the foot for all day wear. The OrthoLite® foot bed massages the foot and delivers comfort and stability all in one. The Leisa Cacti sandal is topped with a smooth leather upper, detailed stitching, and studded accents combing elegance with comfort.\n            \n                <ul class=\"detail_comp\"><li>Three Hook and Loop Closures\n</li><li>EVA Outsole\n</li><li>OrthoLite® Foot Bed\n</li><li>Leather Upper\n</li><li>Fabric Lining\n</li><li>1  inch Heel\n</li></ul>\n            \n                <br><b><a href=\"/clarks-sandals/category_8504\"><font color=\"blue\"> <br>Shop more Clarks Sandals here</font></a></b>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',63.99,63.99,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(740666,'Wave','/pm/vioni/vioni740666_291562_jb1.jpg;/pm/vioni/vioni740666_291562_jb2.jpg;/pm/vioni/vioni740666_291562_jb3.jpg;/pm/vioni/vioni740666_291562_jb5.jpg;/pm/vioni/vioni740666_291562_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Wave Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Vionic Wave flip flop for men is an all-time bestseller with soft, padded jersey-lined uppers and a nylon-webbed toe post for maximum comfort. This men\'s sandal features an EVA footbed and a durable rubber outsole. The Vionic Wave can accommodate and support the most demanding feet. The Vionic Orthaheel Technology provides unmatched relief, addictive support, and essential stability that helps reduce over-pronation, which can help relieve associated pains.\n            \n                <ul class=\"detail_comp\"><li>Jersey-lined upper\n</li><li>Nylon-webbed toe\n</li><li>EVA footbed \n</li><li>Rubber outsole\n</li><li>Helps with over-pronation \n</li></ul>\n            \n                <p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/vionic/NaturalAlignment.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(741529,'Classic Slip-On','/pm/vansi/vansi741529_28642_jb1.jpg;/pm/vansi/vansi741529_28642_jb2.jpg;/pm/vansi/vansi741529_28642_jb3.jpg;/pm/vansi/vansi741529_28642_jb6.jpg;/pm/vansi/vansi741529_28642_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Classic Slip-On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Featuring a time tested classic. The original Vans vulcanized \"waffle\" outsole completes the package offering incredible flexibility and grip. You\'ll look cooler than your homies. Durable, responsive, and stylish. The ultimate in flexibility and grip. Features classic styling and detailing.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',34.95,34.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(741530,'Authentic','/pm/vansi/vansi741530_28642_jb1.jpg;/pm/vansi/vansi741530_28642_jb2.jpg;/pm/vansi/vansi741530_28642_jb3.jpg;/pm/vansi/vansi741530_28642_jb6.jpg;/pm/vansi/vansi741530_28642_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Authentic Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Authentic is the shoe that has stayed true to its roots and has not changed since its 1966 origin. Now it has become a classic for any casual occasion. The Authentic is the first lace-up skate shoe featuring our signature waffle bottom construction, original vulcanized sole and canvas uppers.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',34.95,34.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(742208,'Classic VN','/pm/kswis/kswis742208_1966_jb1.jpg;/pm/kswis/kswis742208_1966_jb2.jpg;/pm/kswis/kswis742208_1966_jb3.jpg;/pm/kswis/kswis742208_1966_jb4.jpg;/pm/kswis/kswis742208_1966_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>K-Swiss Classic VN Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The iconic K-Swiss Classic features our signature 5 stripe branding, 3-piece toe, and D-rings. The Classic VN is the symbol of Heritage American Tennis.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(743631,'Arizona Birko-Flor Sandal','/pm/birke/birke743631_437419_jb1.jpg;/pm/birke/birke743631_437419_jb2.jpg;/pm/birke/birke743631_437419_jb3.jpg;/pm/birke/birke743631_437419_jb5.jpg;/pm/birke/birke743631_437419_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Birkenstock Arizona Birko-Flor Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                These Birkenstock Arizona Birko-Flor Sandals are anything but boring.  Durable synthetic Birko-Flor upper allows for printed designs, subtle shine, and vibrant colors on the usually earth tone Birkenstock Arizona silhouette. Classic components remain the same like the individually adjustable buckle straps, contoured cork footbed with arch support, a deep heel cup, roomy toe box, and an EVA outsole. Made in Germany, these classic Birkenstock slide sandals are the perfect warm-weather go-to. \n            \n                <ul class=\"detail_comp\"><li>Birko-Flor synthetic upper\n</li><li>Individually adjustable buckle straps\n</li><li>Contoured cork footbed\n</li><li>Suede sockliner\n</li><li>Arch support\n</li><li>Deep heel cup\n</li><li>Roomy toe box\n</li><li>EVA outsole\n</li><li>Made in Germany\n</li></ul>\n            \n                <a href=\"https://www.shoes.com/find-your-size/cp332440%20\"><font color=\"blue\"> <br><b>Find Your Birkenstock Size Here!</b></font></a>\n<p><b>Birkenstock Size Chart: Women</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/birk/birk-sizechart-womens.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large.  If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 7 1/2 we recommend purchasing a size 7. </div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(746449,'Old Skool Canvas Sneaker','/pm/vansi/vansi746449_166793_jb1.jpg;/pm/vansi/vansi746449_166793_jb2.jpg;/pm/vansi/vansi746449_166793_jb3.jpg;/pm/vansi/vansi746449_166793_jb6.jpg;/pm/vansi/vansi746449_166793_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Old Skool Canvas Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Old Skool, Vans classic skate shoe and the first to bare the iconic side stripe, is a low top lace-up with a durable canvas upper, padded tongue and lining, metal eyelets and Vans original Waffle Outsole.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(747157,'Dual Up X2','/pm/bbcin/bbcin747157_465148_jb1.jpg;/pm/bbcin/bbcin747157_465148_jb5.jpg;/pm/bbcin/bbcin747157_465148_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Dual Up X2 Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Dual Up X2 skate shoe has the look of a classic skate shoe with sneaker comfort. Keep your foot safely secured with the elastic lace closure and adjustable hook and loop strap. It has 2x2 double wheels in the heels of the new dual density lightweight outsole.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic Nubuck</div>\n            \n		</div><!--end product_specs-->\n	</div>',41.25,41.25,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(748186,'Ohana Flip Flop','/pm/oluka/oluka748186_381176_jb1.jpg;/pm/oluka/oluka748186_381176_jb6.jpg;/pm/oluka/oluka748186_381176_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>OluKai Ohana Flip Flop Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Ohana means family, and family means nobody gets left behind, especially with the exceptional comfort features of the OluKai Ohana Flip Flop. Lightweight anatomically designed compression molded EVA midsole features ICEBA drop-in footbed for personalized fit. Nonmarking rubber outsole is designed with a reef lug for specialized grip. Water resistant man-made vegan leather upper is durable and breathable with a refined leather-like finish. Soft nylon toe post webbing, embroidered detail, floatabiliy, and laser etched logo are the finishing touch in these simple everyday Olukai sandals. \n            \n                <ul class=\"detail_comp\"><li>Compression molded EVA midsole\n</li><li>ICEBA drop-in footbed\n</li><li>Nonmarking rubber outsole\n</li><li>Reef lug pattern\n</li><li>Vegan leather upper\n</li><li>Nylon toe post\n</li><li>Embroidered detail\n</li><li>Laser etched logo\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',65.00,65.00,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(748194,'Ohana Flip Flop','/pm/oluka/oluka748194_405694_jb1.jpg;/pm/oluka/oluka748194_405694_jb6.jpg;/pm/oluka/oluka748194_405694_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>OluKai Ohana Flip Flop Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                With a breezy design and comfortable features, the Olukai Ohana Flip Flop is a welcome addition to any warm weather wardrobe.  \nThis lightweight sandal is built to be in and around water thanks to the razor siped grippy non-marking rubber sole and lightweight, quick-drying breathable synthetic upper straps that maintain the look and feel of leather. Nylon toe post and compression-molded EVA midsole with ICEVA drop-in footbed ensure that feet stay comfortable and supported all day long. These Olukai flip flops are also vegan-friendly and guaranteed to last.\n\n            \n                <ul class=\"detail_comp\"><li>Razor siped non-marking rubber sole\n</li><li>Vegan leather straps\n</li><li>Nylon toe post\n</li><li>Compression molded EVA midsole\n</li><li>ICEVA drop-in footbed\n</li><li>Vegan friendly\n</li><li>Water resistant\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',65.00,65.00,4,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:30'),(750439,'Tide Toe Post Sandal','/pm/vioni/vioni750439_291562_jb1.jpg;/pm/vioni/vioni750439_291562_jb2.jpg;/pm/vioni/vioni750439_291562_jb3.jpg;/pm/vioni/vioni750439_291562_jb4.jpg;/pm/vioni/vioni750439_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Tide Toe Post Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Tide Toe Post Sandal is sure to have a comfortable fit with its soft woven toe post and foam-lined strap. The biomechanical Tri-planar Motion Control footbed with deep heel cup was designed by podiastrists to help stabilize, support and realign the feet back to their natural position. This sandal will reduce stress on your feet, ankles and knees with its lightweight, flexible medium-density EVA midsole that absorbs shock. The TPR outsole with patterned tread offers increased durability and traction.\n            \n                <p><br>Scientifically Proven to Alleviate Heel Pain*</p><p><br>*Based on a peer-reviewed clinical study partially funded by Vionic on people experiencing moderate, non-traumatic heel pain. Vionic contoured sandals were shown to be comparable in effectiveness to Vionic orthotic inserts. \n            \n        </p></span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TPR</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Woven/Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',69.95,69.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(753873,'Lexi Mary Jane','/pm/wolve/wolve753873_374590_jb1.jpg;/pm/wolve/wolve753873_374590_jb2.jpg;/pm/wolve/wolve753873_374590_jb5.jpg;/pm/wolve/wolve753873_374590_jb6.jpg;/pm/wolve/wolve753873_374590_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hush Puppies Lexi Mary Jane Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Lexi Mary Jane features a hook-and-loop strap to secure your foot. This adjustable strap lets you personalize the fit. The mesh lining of the shoe ensures a dry and breathable microclimate. This anti-bacterial layer also controls odor and moisture formation. Its memory foam footbed cushions every inch of the foot.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True To Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Memory Foam/Mesh</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(753878,'Gavin Hook-and-Loop Shoe','/pm/wolve/wolve753878_374590_jb1.jpg;/pm/wolve/wolve753878_374590_jb2.jpg;/pm/wolve/wolve753878_374590_jb5.jpg;/pm/wolve/wolve753878_374590_jb6.jpg;/pm/wolve/wolve753878_374590_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hush Puppies Gavin Hook-and-Loop Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                You can wear the Gavin shoe with any casual outfit. The vamp is fitted with a broad strap featuring a hook-and-loop closure. This allows for easy wearing and also prevents the foot from slipping out. The shoe has a soft microsuede sockliner for added warmth and comfort. Its memory foam footbed is shaped to mimic the shape of your foot.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True To Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Memory Foam</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(754682,'Soft 7 Sneaker','/pm/eccou/eccou754682_386462_jb1.jpg;/pm/eccou/eccou754682_386462_jb2.jpg;/pm/eccou/eccou754682_386462_jb3.jpg;/pm/eccou/eccou754682_386462_jb4.jpg;/pm/eccou/eccou754682_386462_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>ECCO Soft 7 Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                For a sophisticated, yet casual street style, lace up in the women\'s ECCO Soft VII Sneaker. This edgy sneaker features a rich, full-grain leather and suede upper that are soft to the touch and provide a lightweight feel. All day comfort is guaranteed in the Soft VII as it is leather lined, and equipped with ECCO\'s Comfort Fiber System  , which cushions the foot and provides for a healthy foot environment. The anatomical shaping allows for extreme support and stability. The outsole of this women\'s sneaker is direct-injected with two component PU/TPU for a flexible and durable fit. The ECCO Soft VII is airport-friendly. \n            \n                <ul class=\"detail_comp\"><li>Leather &amp; suede upper\n</li><li>Leather lined\n</li><li>Removable leather covered inlay sole\n</li><li>Comfort Fiber System \n</li><li>Anatomical shaping\n</li><li>PU/TPU outsole\n</li><li>Airport-friendly\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            PU/TPU</div>\n            \n		</div><!--end product_specs-->\n	</div>',90.00,90.00,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(755573,'Krista Strappy Wedge Sandal','/pm/yalee/yalee755573_35558_jb1.jpg;/pm/yalee/yalee755573_35558_jb2.jpg;/pm/yalee/yalee755573_35558_jb3.jpg;/pm/yalee/yalee755573_35558_jb5.jpg;/pm/yalee/yalee755573_35558_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Naot Krista Strappy Wedge Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Three is a magic number, and it shows with the Krista Strappy Wedge Sandal. The gorgeous leather upper has three straps across the top. The middle strap is not only studded, giving sparkle to any outfit, but also stretchy, ensuring you get a perfect fit. The backstrap provides you with added stability and support, while the hook and loop closure gives you adjustability. This flexible and lightweight sandal has an anatomic cork and latex footbed that\'s wrapped in suede, it\'ll mold to the shape of your foot with wear, and protect you with shock absorption and arch support.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Cork/Latex</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',145.00,145.00,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(756180,'Tilden Plain Toe Oxford','/pm/thecl/thecl756180_11493_jb1.jpg;/pm/thecl/thecl756180_11493_jb2.jpg;/pm/thecl/thecl756180_11493_jb3.jpg;/pm/thecl/thecl756180_11493_jb4.jpg;/pm/thecl/thecl756180_11493_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Tilden Plain Toe Oxford Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Clarks Tilden Plain shoe is perfect for formal occasions. It flaunts a sleek and minimal design. The lace-up fastening of the shoe allows for an adjustable fit. This shoe is designed with a low-stacked heel for stability while walking. It is equipped with a TPR outsole and a synthetic lining.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',80.99,80.99,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(756330,'Get Your Kicks Blucher Lace Up','/pm/thero/thero756330_5406_jb2.jpg;/pm/thero/thero756330_5406_jb3.jpg;/pm/thero/thero756330_5406_jb6.jpg;/pm/thero/thero756330_5406_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Rockport Get Your Kicks Blucher Lace Up Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Work hard and play hard with the Get Your Kicks collection. Built lightweight, these shoe provide comfort and versatility for the man on the move. An EVA outsole provides lightweight shock absorption while Strobel construction gives you that forefoot flexibility. EVA with memory foam combined with comfort system designed to provide lightweight shock absorption.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to size</div>\n            \n		</div><!--end product_specs-->\n	</div>',87.45,87.45,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(757098,'Minna Ballet Flat','/pm/vioni/vioni757098_291562_jb1.jpg;/pm/vioni/vioni757098_291562_jb2.jpg;/pm/vioni/vioni757098_291562_jb3.jpg;/pm/vioni/vioni757098_291562_jb4.jpg;/pm/vioni/vioni757098_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Minna Ballet Flat Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                This ballet slipper is anything but flat. The Vionic Minna Ballet Flat is designed with a contrasting toe cap that allows for a play of textures and colors. Leather or calf hair upper features a feminine bow and branded metallic Vionic aglets. Underfoot, biomechanical design helps support natural alignment by providing arch-hugging support, while the flexible, removable, microfiber EVA orthotic insert and TPR outsole further enhance comfort in these easy, chic, APMA approved Vionic ballet flats. \n            \n                <ul class=\"detail_comp\"><li>Toe cap design\n</li><li>Leather or calfhair upper\n</li><li>Bow detail\n</li><li>Metallic aglets\n</li><li>Biomechanical design\n</li><li>Removable EVA insert\n</li><li>TPR outsole\n</li><li>APMA Seal of Acceptance\n</li></ul>\n            \n                <p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"http://www.shoebuy.com//images/desc/vionic/NaturalAlignment.jpg\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Removable Micro-fiber Covered EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,3,0,0,'2018-04-30 09:51:05','2018-04-30 09:51:05'),(757379,'Sk8-Hi Reissue High Top','/pm/vansi/vansi757379_447266_jb1.jpg;/pm/vansi/vansi757379_447266_jb2.jpg;/pm/vansi/vansi757379_447266_jb3.jpg;/pm/vansi/vansi757379_447266_jb6.jpg;/pm/vansi/vansi757379_447266_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Sk8-Hi Reissue High Top Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Sk8-Hi is Vans\' original out-of-the-box skate performance shoe. These \"Off the Wall\" kicks have dressed the feet of pro and amateur skaters since 1966 and today\'s model is just as authentic as the originals. You\'ll enjoy the perfect fit, flexible grip and board feel of these timeless hi tops.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5.</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(762724,'M840v3 Running Shoe','/pm/newba/newba762724_11075_jb1.jpg;/pm/newba/newba762724_11075_jb3.jpg;/pm/newba/newba762724_11075_jb6.jpg;/pm/newba/newba762724_11075_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance M840v3 Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The 840v3 running shoe sports a full-length bed of ABZORB® and polyurethane foam to deliver the ultimate underfoot cushioning experience. This running shoe is ideal for neutral runners seeking a fuller fit for either wider feet or the need to accommodate orthotics.\n            \n                <ul class=\"detail_comp\"><li>Full EVA strobel board</li><li>Polyurethane insert</li><li>No-sew material application</li><li>12 mm drop</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Blown Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic/Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(766169,'D\'Lites Sneaker','/pm/skech/skech766169_395149_jb1.jpg;/pm/skech/skech766169_395149_jb2.jpg;/pm/skech/skech766169_395149_jb3.jpg;/pm/skech/skech766169_395149_jb5.jpg;/pm/skech/skech766169_395149_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers D\'Lites Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The SKECHERS D\'Lites Sneaker is perfect for casual outtings and training sessions alike. Featuring a cushioned Memory Foam insole and padded collar and tongue, this sporty sneaker provides optimum comfort for wherever your day takes you. Contrast mesh panels ensure breathability, stitching and overlay accents add unique detail, and a super lightweight midsole offers shock absorption. Lace up this SKECHERS sneaker and take on your next adventure.\n            \n                <ul class=\"detail_comp\"><li>Smooth leather upper\n</li><li>Lace up sporty training sneaker design\n</li><li>Lace up front with metal top eyelet\n</li><li>Padded collar and tongue\n</li><li>Soft fabric shoe lining\n</li><li>Cushioned comfort insole\n</li><li>Shock absorbing athletic midsole\n</li><li>Light and flexible traction outsole\n</li><li>1 1/4 inch heel\n</li></ul>\n            \n                <a href=\"/skechers-womens-dlites/category_4164\"><font color=\"blue\"> <br><b>Shop Skechers D\'Lites Collection here.</b></font></a>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(766191,'After Burn Memory Fit Final Cut Walking Shoe','/pm/skech/skech766191_41823_jb1.jpg;/pm/skech/skech766191_41823_jb2.jpg;/pm/skech/skech766191_41823_jb3.jpg;/pm/skech/skech766191_41823_jb5.jpg;/pm/skech/skech766191_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers After Burn Memory Fit Final Cut Walking Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A true classic style gets even easier and more comfortable with the SKECHERS After Burn Memory Fit - Final Cut shoe. Smooth leather and synthetic upper in a two strap front athletic walking sneaker with stitching, overlay and per