pically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane</div>\n            \n		</div><!--end product_specs-->\n	</div>',139.95,139.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(768214,'Cobb Hill Gabby Gladiator Bootie','/pm/thero/thero768214_76838_jb1.jpg;/pm/thero/thero768214_76838_jb2.jpg;/pm/thero/thero768214_76838_jb5.jpg;/pm/thero/thero768214_76838_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Rockport Cobb Hill Gabby Gladiator Bootie Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The women\'s Rockport Cobb Hill Gladiator Bootie is the perfect option for transitioning into the warmer seasons. Designed with a leather upper with a cage-like design for on-trend style as well as breathability. The lace up closure makes for a personalized fit and easy adjustability while the peep toe allows for wiggle room. The inner of this Rockport bootie is crafted with soft and supple leather that is textile lined with an EVA footbed for lightweight cushion comfort. The TPR outsole is designed for ensured durability and maximum traction. \n            \n                <ul class=\"detail_comp\"><li>Leather upper\n</li><li>Cage-like design	\n</li><li>Lace up closure\n</li><li>Peep toe\n</li><li>Leather lining \n</li><li>Textile lined EVA footbed\n</li><li>TPR outsole \n</li></ul>\n \n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <s