acoGrip outsole ensures superb traction on a wide range of surfaces. With vegan-friendly construction and a variety of colors and patterns, it\'s no wonder these Chaco sandals have been a reliable favorite since 1989. \n            \n                <ul class=\"detail_comp\"><li>Double-strapped polyester jacquard webbing upper\n</li><li>Toe loop for secure movement\n</li><li>Injection-molded ladder lock buckle\n</li><li>Women\'s specific LUVSEAT PU midsole \n</li><li>Antimicrobial properties for odor control\n</li><li>Non-marking ChacoGrip rubber outsole\n</li><li>Vegan-friendly construction\n</li><li>Versatile pattern and color options \n</li></ul>\n            \n                <br><b><a href=\"/chaco-active-sandals/category_30016\"><font color=\"blue\"> <br>Shop more Chaco sandals here</font></a></b> \n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Polyester</div>\n            \n		</div><!--end product_specs-->\n	</div>',78.95,78.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(770185,'Charton Mix Sneaker','/pm/thecl/thecl770185_19355_jb1.jpg;/pm/thecl/thecl770185_19355_jb2.jpg;/pm/thecl/thecl770185_19355_jb3.jpg;/pm/thecl/thecl770185_19355_jb4.jpg;/pm/thecl/thecl770185_19355_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Charton Mix Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Get on 