       Strut with comfort and style wearing the Fila Royalty Running Shoe. The lace closure allows convenient on and off. Its padded collar and tongue promise essential support to the foot, making each step easy. It features a hook at the collar that provides easy wearing. The lining offers inside comfort. With a slight heel, the shoe helps you walk comfortably. \n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Synthetic/Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',38.45,38.45,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(772546,'Pixie Ankle Strap Sandal','/pm/yalee/yalee772546_402577_jb1.jpg;/pm/yalee/yalee772546_402577_jb2.jpg;/pm/yalee/yalee772546_402577_jb3.jpg;/pm/yalee/yalee772546_402577_jb5.jpg;/pm/yalee/yalee772546_402577_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Naot Pixie Ankle Strap Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Bring a trendy twist to your look with Naot Pixie Ankle Strap Sanda from the Fantasy Collection. A high heel counter offers support. A strap at the vamp and an open toe keeps the foot snug. The bar strap ensures the foot is in place. A low wedge heel provides stability to your stride.\n            \n                <ul class=\"detail_comp\"><li>High Heel Counter</li><li>Suede-wrapped, anatomic cork &amp; latex footbed</li><li>Low Wedge Heel</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 3/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',127.99,127.99,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(772834,'Ulrich Slip On','/pm/mephi/mephi772834_437323_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Mephisto Ulrich Slip On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                This perforated slip-on combines the casual style of a sneaker with exquisite Mephisto comfort. The midsole is crafted with SOFT-AIR Technology that provides breathability, flexibility and protection from shock while walking.\n            \n                <ul class=\"detail_comp\"><li>Slip-on entry</li><li>Soft leather lining</li><li>100% Caoutchouc outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',354.95,354.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(773023,'Samoa Slide','/pm/vioni/vioni773023_291562_jb1.jpg;/pm/vioni/vioni773023_291562_jb2.jpg;/pm/vioni/vioni773023_291562_jb3.jpg;/pm/vioni/vioni773023_291562_jb4.jpg;/pm/vioni/vioni773023_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Samoa Slide Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Samoa is the optimal combination of gilded style and casual comfort, with hook-and-loop closures on the straps for super fit. It\'s an elegant take on a resort-ready style.\n            \n                <ul class=\"detail_comp\"><li>Leather and stretch textile upper with microfiber-covered footbed.</li><li>Lightweight, flexible EVA midsole absorbs shock, reducing stress on feet, ankles, and knees.</li><li>Durable rubber outsole with a patterned tread provides traction on a variety of surfaces.</li><li>Orthaheel Technology is biomechanically designed to hug arches and support feel. Vionic sandals\' built-in orthotic is shown to be effective in helping to treat heel pain (plantar fasciitis).</li><li>Recommended by Dr. Andrew Weil.</li></ul>\n            \n                <p><br>Scientifically Proven to Alleviate Heel Pain*</p><p><br>*Based on a peer-reviewed clinical study partially funded by Vionic on people experiencing moderate, non-traumatic heel pain. Vionic contoured sandals were shown to be comparable in effectiveness to Vionic orthotic inserts. \n            \n                </p><p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"//cdn-ap-ec.yottaa.net/550c587c2106b06b5100362d/www.shoes.com/v~22.17a/images/desc/vionic/NaturalAlignment.jpg?yocs=c_f_&amp;yoloc=ap\">\n<p></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Stretch Textile</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,4,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:30'),(773612,'Faye Slingback','/pm/lowel/lowel773612_412218_jb1.jpg;/pm/lowel/lowel773612_412218_jb2.jpg;/pm/lowel/lowel773612_412218_jb3.jpg;/pm/lowel/lowel773612_412218_jb5.jpg;/pm/lowel/lowel773612_412218_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Comfortiva Faye Slingback Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                There\'s no doubt, you\'ll be looking fashionable sporting the Faye Slingback; a mid heeled shoe with an adjustable hook and loop slingback strap. This modern style has cut outs with flexible stretchy straps and a lightweight sole. Comfortiva\'s Pillowtop® memory foam bed provides all day cushioning support. This is a great casual and comfortable shoe destined to become your personal favorite.\n            \n                <ul class=\"detail_comp\"><li>Slingback bootie design</li><li>Adjustable back strap</li><li>Chunky Heel</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 7 1/2, we recommend purchasing a size 7. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Otago Nubuck</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(774180,'Motion Plus Roller Shoe','/pm/bbcin/bbcin774180_446649_jb1.jpg;/pm/bbcin/bbcin774180_446649_jb5.jpg;/pm/bbcin/bbcin774180_446649_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Motion Plus Roller Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Heelys\' Motion Plus Roller Shoe features a vulcanized style outsole and a large embroidered logo on the quarter. It has low profile, removable wheels in the heel that transform these kicks into skates. Great for the child who always wants to be on the go!\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n		</div><!--end product_specs-->\n	</div>',42.95,42.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(775280,'Pehuea Slip On','/pm/oluka/oluka775280_437061_jb1.jpg;/pm/oluka/oluka775280_437061_jb2.jpg;/pm/oluka/oluka775280_437061_jb6.jpg;/pm/oluka/oluka775280_437061_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>OluKai Pehuea Slip On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"descrip