fants sizes <a href=\"/new-balance-990v4-sneaker/776871\"><font color=\"red\">click here</font></a></b></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 11, we recommend purchasing a size 11 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(777272,'990v4 Hook and Loop Running Shoe','/pm/newba/newba777272_64139_jb1.jpg;/pm/newba/newba777272_64139_jb3.jpg;/pm/newba/newba777272_64139_jb6.jpg;/pm/newba/newba777272_64139_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance 990v4 Hook and Loop Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Style your child\'s first steps with this sleek hook and loop version of the 990v4 Sneaker from New Balance. Designed with a premium upper, its compression molded midsole provides comfort and stability. Now your little one can sport a classic look, just like Mom and Dad.\n            \n                <p><br><b>Available in lace version <a href=\"/new-balance-990v4-sneaker/776871\"><font color=\"red\">here</font></a></b></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Suede</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(777429,'990v4 Running Shoe - Little Kids','/pm/newba/newba777429_64139_jb1.jpg;/pm/newba/newba777429_64139_jb3.jpg;/pm/newba/newba777429_64139_jb6.jpg;/pm/newba/newba777429_64139_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance 990v4 Running Shoe - Little Kids Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Celebrate running wild and feeling fast. The sleek 990v4 Running Shoe from New Balance graduates with classic colors and an old school style. Integrated NDurance® technology offers maximum durability so your slick sneakers can go the distance. Be among the first in your class to rock this craftsman look.\n            \n                <p><br><b>Available in hook and loop enclosure <a href=\"/new-balance-990v4-hook-and-loop-running-shoe/777275\"><font color=\"red\">here</font></a></b></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 11, we recommend purchasing a size 11 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(777953,'Reveal Wingtip Jr.','/pm/flors/flors777953_4638_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Florsheim Reveal Wingtip Jr. Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Watch him walk with confidence in the Reveal Wingtip Jr. He\'s going places, and these stylish oxfords will take him all the way. It won\'t be long until he finds his stride in these elegant lace ups.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run large. For an accurate fit we recommend purchasing a 1/2 size smaller than you typically purchase. For example, if you normally purchase a size 10 1/2, we recommend purchasing a size 10. </div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Textile</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather, Linen/Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(778042,'Jack Tie Sneaker','/pm/eccou/eccou778042_408074_jb1.jpg;/pm/eccou/eccou778042_408074_jb2.jpg;/pm/eccou/eccou778042_408074_jb3.jpg;/pm/eccou/eccou778042_408074_jb4.jpg;/pm/eccou/eccou778042_408074_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>ECCO Jack Tie Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                With a tennis-inspired style, the ECCO Jack Tie Sneaker is ideal for casual wear. It has a direct-injected, two-component polyurethane/ TPU outsole for flexibility and durability. This shoe maintains the perfect inner climate with its removable leather-covered inlay sole with ECFS™ technology. It is equipped with a moisture-absorbent textile lining for breathability.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane/TPU</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Cow Oil Nubuck/Cow Oil Suede</div>\n            \n		</div><!--end product_specs-->\n	</div>',115.00,115.00,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(778990,'Ridge Walker Low Hiking Shoe','/pm/prope/prope778990_367622_jb1.jpg;/pm/prope/prope778990_367622_jb2.jpg;/pm/prope/prope778990_367622_jb3.jpg;/pm/prope/prope778990_367622_jb4.jpg;/pm/prope/prope778990_367622_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Propet Ridge Walker Low Hiking Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Ridge Walker Low can take you from city trails.\n            \n                <ul class=\"detail_comp\"><li>Suede and mesh upper with padded collar and tongue</li><li>Molded counter with support and rubber toe bumper</li><li>EVA midsole with high-traction rubber outsole for cushion, traction, and durable wear</li><li>Waterproof bootie constrction</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Suede/Mesh</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(781740,'Martina Clog','/pm/dansk/dansk781740_328835_jb1.jpg;/pm/dansk/dansk781740_328835_jb2.jpg;/pm/dansk/dansk781740_328835_jb3.jpg;/pm/dansk/dansk781740_328835_jb4.jpg;/pm/dansk/dansk781740_328835_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dansko Martina Clog Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Martina Clog offers a classic Dansko look with a lower heel base along with a leather wrapped EVA footbed that provides optimal arch support and cushioning.\n            \n                <ul class=\"detail_comp\"><li>Leather-wrapped EVA footbed provides optimal arch support and cushioning</li><li>Embedded steel shank provides stability and support</li><li>Lightweight polyurethane midsole with rubber outsole provides shock absorption and energy return</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style is available in whole sizes only and tends to run large. If you normally order a 1/2 size it is recommended that you order the next full size down. For example, if you normally purchase a size 6 1/2 we recommend purchasing a size 6.</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(782069,'Reveal Chukka Boot Jr.','/pm/flors/flors782069_4638_jb1.jpg;/pm/flors/flors782069_4638_jb2.jpg;/pm/flors/flors782069_4638_jb3.jpg;/pm/flors/flors782069_4638_jb4.jpg;/pm/flors/flors782069_4638_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Florsheim Reveal Chukka Boot Jr. Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Reveal Chukka Jr. is a polished, plain-toe ankle boot that boasts fine Florsheim craftsmanship and a well-established design. With its classic look and clean lines, this versatile shoe is an essential for any young man\'s wardrobe.\n            \n                <ul class=\"detail_comp\"><li>Round Toe</li><li>Ankle Boot</li><li>Lace Up</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Textile</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(782417,'Ride 9 Running Shoe','/pm/wolve/wolve782417_249289_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Saucony Ride 9 Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Running enthusiasts come in all ages, even future runners, racers, and marathoners. The Kids\' Ride 9 is designed specifically for your little one, perfect for running around the park, gym class, recess... and with their adults!\n            \n                <p><br><b>Features</b><br></p><ul class=\"detail_comp\"><li>Synthetic, breathable upper with anti-microbial lining</li><li>POWERGRID midsole with compressed EVA for cushioning</li><li>Non-marking TRI-FLEX outsole with rubberized lugs for grip and traction.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            POWERGRID</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TRI-FLEX</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(783132,'Speedcross 4 Trail Running Shoe','/pm/amers/amers783132_439762_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Salomon Speedcross 4 Trail Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                If you\'ve got need for speed, then the Speedcross 4 Trail Running Shoe by Salomon is the perfect option for you. With the SensiFIT™ and Quicklace™construction, it ensures a secure fit and enables one-pull tightening. This shoe is well-equipped with a molded EVA midsole, and an OrthoLite® sock liner for enhanced shock-absorption and cushioning. It features a water-resistant top portion that wicks off mud and WET Traction Contagrip™ outsole keeps you sure-footed.\n            \n                <p><br><b>Features</b><br></p><ul class=\"detail_comp\"><li>SENSIFIT™ construction</li><li>Quicklace™technology</li><li>WET TRACTION CONTAGRIP™ outsole</li><li>OrthoLite® sock liner</li><li>Molded EVA midsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Contragrip®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',129.95,129.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(783263,'Old Skool Lite','/pm/vansi/vansi783263_402627_jb1.jpg;/pm/vansi/vansi783263_402627_jb2.jpg;/pm/vansi/vansi783263_402627_jb3.jpg;/pm/vansi/vansi783263_402627_jb6.jpg;/pm/vansi/vansi783263_402627_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Old Skool Lite Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Old Skool Lite has been re-engineered using modern construction methods to improve fit, increase comfort, and reduce the overall weight. Maintaining the same aesthetic, but with a completely new fit and feel thanks to Vans UltraCush Lite sockliner.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(783267,'Sk8-Hi Lite','/pm/vansi/vansi783267_402614_jb1.jpg;/pm/vansi/vansi783267_402614_jb2.jpg;/pm/vansi/vansi783267_402614_jb3.jpg;/pm/vansi/vansi783267_402614_jb6.jpg;/pm/vansi/vansi783267_402614_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Sk8-Hi Lite Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Sk8-Hi Lite has been re-engineered using modern construction methods to improve fit, increase comfort, and reduce the overall weight. Maintaining the same aesthetic, but with a completely new fit and feel thanks to Vans UltraCush Lite sockliner.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(783940,'JR Hedgehog Hiker WP','/pm/theno/theno783940_468691_jb1.jpg;/pm/theno/theno783940_468691_jb3.jpg;/pm/theno/theno783940_468691_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>The North Face JR Hedgehog Hiker WP Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The JR Hedgehog Hiker WP is a tough, rugged youth version of the iconic hiking shoe, featuring a waterproof HydroSeal® membrane and one-handed lace closure for a secure, easy fit.\n            \n                <ul class=\"detail_comp\"><li>Gusseted tongue provides protection from debris</li><li>Low-profile, high-surface-contact UltrATAC non-marking rubber outsole</li><li>Protective toe cap and heel mudguards</li><li>CMEVA midsole</li><li>Regular lace included</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(785968,'Genesis XPS Running Shoe','/pm/instr/instr785968_397439_jb1.jpg;/pm/instr/instr785968_397439_jb2.jpg;/pm/instr/instr785968_397439_jb3.jpg;/pm/instr/instr785968_397439_jb4.jpg;/pm/instr/instr785968_397439_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Xelero Genesis XPS Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Get more out of your workout with the Genesis XPS Running Shoe. Suitable for roads and easy terrain, this walking and running sneaker offers lightweight cushioning and a seamless lining that wicks away moisture to keep feet dry and cool. Xelero technology provides a dynamic and stable forward motion, while gel pads in the rear- and fore-foot, and removable insoles offer a comfortable custom fit.\n            \n                <ul class=\"detail_comp\"><li>Seamless moisture wicking lining</li><li>High rebound EVA midsole</li><li>Leather and EVA insole</li><li>Gel pads in forefoot and rearfoot</li><li>Xelero technology offers stability</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Mesh</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Made in:</span>\n            \n            USA</div>\n            \n		</div><!--end product_specs-->\n	</div>',174.99,174.99,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(786470,'Oakridge Hiking Shoe','/pm/keenf/keenf786470_162383_jb2.jpg;/pm/keenf/keenf786470_162383_jb3.jpg;/pm/keenf/keenf786470_162383_jb6.jpg;/pm/keenf/keenf786470_162383_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Oakridge Hiking Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Oakridge Hiking Shoe by KEEN is designed to support your active lifestyle. Its hydrophobic mesh lining offers dry comfort. A non-marking rubber outsole leaves no scuff marks, while the 4MM multi-directional lugs provide traction. This lace-up shoe is equipped with a removable, Metatomical EVA footbed and a stability shank that cradles your foot. With the Cleansport NXT technology, this shoe for men maintains a fresh interior.\n            \n                <ul class=\"detail_comp\"><li>Non-marking rubber outsole</li><li>4MM multi-directional lugs</li><li>Removable, Metatomical EVA footbed</li><li>Stability shank</li><li>Hydrophobic mesh lining</li><li>Cleansport NXT technology</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',94.95,94.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(787603,'Flex Advantage 2.0 Missing Link Sneaker','/pm/skech/skech787603_29432_jb1.jpg;/pm/skech/skech787603_29432_jb2.jpg;/pm/skech/skech787603_29432_jb3.jpg;/pm/skech/skech787603_29432_jb5.jpg;/pm/skech/skech787603_29432_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Flex Advantage 2.0 Missing Link Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Find the perfect balance of comfort and style with the SKECHERS Flex Advantage 2.0 - Missing Link shoe. Skech-Knit Mesh one piece fabric upper in a lace up athletic training sneaker with stitching accents. Air Cooled Memory Foam insole.\n            \n                <ul class=\"detail_comp\"><li>Skech-Knit Mesh woven one piece fabric upper</li><li>Stability knit mesh panels for added stability</li><li>Lace up athletic training sneaker design</li><li>Stitching accents</li><li>Nearly seamless upper design</li><li>Side S logo</li><li>Lace up front with reinforced embroidered eyelets</li><li>Padded collar and tongue</li><li>Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>FlexSole lightweight flexible shock absorbing midsole</li><li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(788055,'Maccy II Bow Mary Jane Junior','/pm/drmar/drmar788055_146310_jb1.jpg;/pm/drmar/drmar788055_146310_jb2.jpg;/pm/drmar/drmar788055_146310_jb3.jpg;/pm/drmar/drmar788055_146310_jb4.jpg;/pm/drmar/drmar788055_146310_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dr. Martens Maccy II Bow Mary Jane Junior Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Maccy II Bow Mary Jane features authentic Dr. Martens detailing along with a miniature version of the famous air-cushioned sole.\n            \n                <ul class=\"detail_comp\"><li>An original Dr. Martens air-cushioned sole, hard wearing, with good abrasion and slip resistance</li><li>The sole is cemented to the base of the upper and to the insole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(788455,'GS Pace RN Running Shoe','/pm/under/under788455_463410_jb1.jpg;/pm/under/under788455_463410_jb3.jpg;/pm/under/under788455_463410_jb6.jpg;/pm/under/under788455_463410_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Under Armour GS Pace RN Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Featuring high breathable ventilation and lightweight construction, the Pace RN Running Shoe is perfect for recess and other outdoor activities!\n            \n                <p><br><b>Features</b><br></p><ul class=\"detail_comp\"><li>Dual layer, breathable mesh and leather upper locks into the midfoot for stability</li><li>Anti-microbial treated footbed reduces the risk of odor-causing bacteria and fungus</li><li>Full-length Micro G® foam</li><li>Non-marking rubber outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Mesh/Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.99,44.99,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(792405,'Firebrand II BDry Hiking Shoe','/pm/obozf/obozf792405_420566_jb1.jpg;/pm/obozf/obozf792405_420566_jb2.jpg;/pm/obozf/obozf792405_420566_jb4.jpg;/pm/obozf/obozf792405_420566_jb5.jpg;/pm/obozf/obozf792405_420566_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Oboz Firebrand II BDry Hiking Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Not only will the Firebrand II BDry Hiking Shoe from Oboz take you over the mountain; it will take you over the moon. Your feet will stay cool and dry, thanks to the BDry breathable and waterproof membrane, and they won\'t feel as fatigued, thanks to the premium O FIT Insoles.<br>\n            \n                <br><p></p><ul class=\"detail_comp\"><li>Premium O FIT Insole</li><li>Waterproof nubuck leather upper</li><li>Highly abrasion-resistant textile</li><li>BDry waterproof and breathable interior membrane</li><li>Sawtooth outsole that sheds mud, offers intense traction, and maintains stability</li></ul>\n            \n                <br><p><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/C7N5nWpbrp4\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe></p>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            O FIT Insole</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Sawtooth</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Waterproof Nubuck Leather/Highly Abrasion-Resistant Textile</div>\n            \n		</div><!--end product_specs-->\n	</div>',140.00,140.00,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(792409,'Sawtooth Low Hiking Shoe','/pm/obozf/obozf792409_457884_jb1.jpg;/pm/obozf/obozf792409_457884_jb2.jpg;/pm/obozf/obozf792409_457884_jb3.jpg;/pm/obozf/obozf792409_457884_jb5.jpg;/pm/obozf/obozf792409_457884_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Oboz Sawtooth Low Hiking Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Compared to the one before, your first hike with the Sawtooth Low Hiking Shoe from Oboz will feel like a walk in the park. The grippy Sawtooth outsole and comfy O FIT Insoles will see to that, and enable you to travel further.<br>\n            \n                <br><p></p><ul class=\"detail_comp\"><li>Premium O FIT Insole</li><li>Waterproof nubuck