osure.\n            \n                <ul class=\"detail_comp\"><li>Lightweight outsole for maximum flexibility</li><li>Padded heel collar for comfort</li><li>Alternative closure with hook &amp; loop for easy on/off and adjustability</li><li>Memory foam insole for enhanced comfort</li><li>Decorative buckle detail</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(794462,'Kyle Classic Sneaker','/pm/eccou/eccou794462_422515_jb1.jpg;/pm/eccou/eccou794462_422515_jb2.jpg;/pm/eccou/eccou794462_422515_jb3.jpg;/pm/eccou/eccou794462_422515_jb4.jpg;/pm/eccou/eccou794462_422515_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>ECCO Kyle Classic Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Kyle Classic Sneaker by ECCO blends a retro design with a sports-inspired silhouette. With a breathable and moisture-absorbent textile lining and leather-covered inlay sole, with ECFS™, this lace-up shoe maintains a clean inner climate and ensures air circulation. A direct-injected polyurethane outsole with a heavy cupsole completes this casual sneaker.\n            \n                <ul class=\"detail_comp\"><li>Removable leather-covered inlay sole with ECFS™</li><li>Direct-injected polyurethane outsole</li><li>Breathable and moisture-absorbent textile lining</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Leather covered ECCO Comfort Fibre System</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Cow Suede/Cow Nubuck</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',95.00,95.00,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(794600,'Sk8-Hi Sneaker','/pm/vansi/vansi794600_166793_jb1.jpg;/pm/vansi/vansi794600_166793_jb2.jpg;/pm/vansi/vansi794600_166793_jb3.jpg;/pm/vansi/vansi794600_166793_jb6.jpg;/pm/vansi/vansi794600_166793_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Sk8-Hi Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Vans Sk8-Hi Sneaker is a legendary lace-up high top inspired by the classic Old Skool skate shoe.\n            \n                <ul class=\"detail_comp\"><li>Durable suede and canvas upper</li><li>Supportive padded ankle</li><li>Signature vulcanized Waffle Outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(794613,'Sk8-Mid Reissue V Sneaker','/pm/vansi/vansi794613_166793_jb1.jpg;/pm/vansi/vansi794613_166793_jb2.jpg;/pm/vansi/vansi794613_166793_jb3.jpg;/pm/vansi/vansi794613_166793_jb6.jpg;/pm/vansi/vansi794613_166793_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Sk8-Mid Reissue V Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Sk8-Hi Mid Reissue V Sneaker takes the iconic Vans sidestripe style and adds two hook-and-loop straps for kid-friendly entry.\n            \n                <ul class=\"detail_comp\"><li>Re-enforced toecap to withstand repeated wear</li><li>Padded collar and heel counter for support and flexibility</li><li>Signature rubber waffle outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(795215,'OG 97 Double Up Shiny Dancer Slip On Sneaker','/pm/skech/skech795215_41851_jb1.jpg;/pm/skech/skech795215_41851_jb2.jpg;/pm/skech/skech795215_41851_jb3.jpg;/pm/skech/skech795215_41851_jb5.jpg;/pm/skech/skech795215_41851_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers OG 97 Double Up Shiny Dancer Slip On Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Add a touch of glamour to your day-to-day look with the SKECHERS OG 97 Double Up Shiny Dancer Slip-on Sneaker. The Air Cooled Memory Foam footbed ensures all-day cushioning, while a flexible rubber outsole provides excellent traction. This stylish sneaker features side gore panels for flexibility and a soft textile lining for added comfort. Finished with rhinestone embellishments, this statement-making SKECHERS slip-on sneaker proves that you can never have too much sparkle. \n            \n                <ul class=\"detail_comp\"><li>Lightly distressed metallic microfiber faux-suede fabric upper</li><li>Dual gore panels</li><li>Metallic microfiber edging and heel stripe overlays</li><li>Skechers logo label on heel panel</li><li>Stitching detail</li><li>Soft fabric lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Vulcanized, cushioned platform-style midsole with embossed stripe details</li><li>Flexible rubber traction outsole with star accent</li><li>Weight: 11 oz.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Lightly Distressed Metallic Microfiber Faux-Suede Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',48.00,48.00,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(795230,'Work Relaxed Fit Pettus Boot','/pm/skech/skech795230_41823_jb1.jpg;/pm/skech/skech795230_41823_jb2.jpg;/pm/skech/skech795230_41823_jb3.jpg;/pm/skech/skech795230_41823_jb5.jpg;/pm/skech/skech795230_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Work Relaxed Fit Pettus Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Classic working style gives you all-day comfort in the SKECHERS Work Relaxed Fit®: Pettus boot. Full grain leather upper in a lace up casual comfort ankle height utility work boot with stitching and overlay accents. Memory Foam insole, EH Safe design.\n            \n                Electrical Hazard (EH) Safe design. EH Safe tested ASTM F12412-2011 for protection.\n            \n                <ul class=\"detail_comp\"><li>Lace up casual comfort ankle height work boot design; Stitching accents; Reinforced stitched seams</li><li>Stitched and rolled seam accented moc toe front; Leather overlays on heel and sides; Classic roofer style work boot look</li><li>Embossed side S logo; Padded collar and tongue; Lace up front with metal eyelets</li><li>Soft sueded fabric tongue for added comfort and breathability; Padded collar and thick padded tongue</li><li>Soft fabric boot lining; Relaxed Fit® design for a roomy comfortable fit</li><li>Memory Foam full length cushioned comfort insole; Goodyear Welt construction with stitched topsole trim</li><li>Shock absorbing midsole; Roofer style flexible traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Full Grain Textured Durable Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',94.95,94.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(795486,'High Tide Toe Post Sandal','/pm/vioni/vioni795486_291562_jb1.jpg;/pm/vioni/vioni795486_291562_jb2.jpg;/pm/vioni/vioni795486_291562_jb3.jpg;/pm/vioni/vioni795486_291562_jb4.jpg;/pm/vioni/vioni795486_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology High Tide Toe Post Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Vionic High Tide Toe Post Sandal is a classic women\'s sandal that delivers long-lasting comfort. This style is made with and textile and leather upper that won\'t chafe, and a synthetic lining that is smooth and breathable for optimal comfort. The dual-density midsole delivers cushioning and support in each step and sits atop a stylish wedged heel. Finally, rubber grip outsole ensures reliable traction on various surfaces making these women\'s Vionic sandals the ideal accessory for your next getaway or \"staycation.\" \n            \n                <ul class=\"detail_comp\"><li>Textile &amp; leather upper\n</li><li>Synthetic lining\n</li><li>Dual-density midsole\n</li><li>Cushion comfort\n</li><li>Wedged heel\n</li><li>Rubber grip outsole\n</li></ul>\n            \n                <p> </p>\n<p><b>Vionic Natural Alignment</b></p> <img src=\"http://www.shoebuy.com//images/desc/vionic/NaturalAlignment.jpg?&gt;%0A&lt;p&gt;&lt;/p&gt;%0A%20%20%20%20%20%20%20%20%20%20%20%20%0A%20%20%20%20%20%20%20%20&lt;/span&gt;&lt;/div&gt;<!--end product_description-->%0A%20%20%20%20%20%20%20%20%0A%09%09&lt;div%20class=\" product_specs grid_7>\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            If your foot tends to run wide, it is recommended a wide width be purchased.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Textile</div>\n            \n		</span></div><!--end product_specs-->\n	</div>',69.95,69.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(795583,'Kinvara 8 Running shoe','/pm/wolve/wolve795583_279797_jb1.jpg;/pm/wolve/wolve795583_279797_jb2.jpg;/pm/wolve/wolve795583_279797_jb3.jpg;/pm/wolve/wolve795583_279797_jb6.jpg;/pm/wolve/wolve795583_279797_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Saucony Kinvara 8 Running shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Push your limits with every passing day wearing the Saucony Kinvara 8 running shoe. An EVERUN topsole construction gives your foot continuous cushioning and energy return, and lightweight FlexFilm overlays provide structure and support. Complete with a Tri-Flex design outsole, this men\'s athletic shoe ensures greater ground contact and freedom of movement.\n            \n                <ul class=\"detail_comp\"><li>EVERUN topsole construction</li><li>FlexFilm overlays</li><li>Internal strap system</li><li>Tri-Flex design outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Triflex</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            FlexFilm</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(795610,'Grid Cohesion 10 Road Running Shoe','/pm/wolve/wolve795610_35915_jb1.jpg;/pm/wolve/wolve795610_35915_jb2.jpg;/pm/wolve/wolve795610_35915_jb3.jpg;/pm/wolve/wolve795610_35915_jb6.jpg;/pm/wolve/wolve795610_35915_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Saucony Grid Cohesion 10 Road Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Be it everyday training or conquering the long road ahead, look no further than the Saucony Grid Cohesion 10 Road Running Shoe. This flexible, athletic shoe for men offers stable cushioning with its Heel Grid system. An injection-molded EVA midsole delivers underfoot cushioning, and a mesh upper provides breathability.\n            \n                <ul class=\"detail_comp\"><li>Heel Grid system</li><li>Injection-molded EVA midsole</li><li>Mesh upper</li><li>Plush tongue and collar</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.95,44.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(795921,'Arahi Road Running Shoe','/pm/decke/decke795921_446380_jb1.jpg;/pm/decke/decke795921_446380_jb2.jpg;/pm/decke/decke795921_446380_jb3.jpg;/pm/decke/decke795921_446380_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hoka One One Arahi Road Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Designed with stability and support in mind, the Hoka One One Arahi Road Running Shoe is here to keep you running without the bulk. This road runner doesn\'t cut back on cushioning and support with its lightweight silhouette. Infused into the midsole and wrapped around the heel for stability, J-Frame technology utilizes a sturdier, more dense EVA material to battle overpronation.\n            \n                <ul class=\"detail_comp\"><li>Lightweight design</li><li>J-Frame technology for stability and support</li><li>EVA foam for cushioning</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(796036,'Motion Plus Roller Shoe','/pm/bbcin/bbcin796036_254825_jb1.jpg;/pm/bbcin/bbcin796036_254825_jb2.jpg;/pm/bbcin/bbcin796036_254825_jb5.jpg;/pm/bbcin/bbcin796036_254825_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Motion Plus Roller Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Heelys\' Motion Plus Roller Shoe features a vulcanized style outsole and a large embroidered logo on the quarter. It has low profile, removable wheels in the heel that transform these kicks into skates. Great for someone who always wants to be on the go!\n            \n                <ul class=\"detail_comp\"><li>Removable wheels</li><li>Vulcanized outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Vulcanized</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(796243,'Skech-Air Porter Zevelo Sneaker','/pm/skech/skech796243_41823_jb1.jpg;/pm/skech/skech796243_41823_jb2.jpg;/pm/skech/skech796243_41823_jb3.jpg;/pm/skech/skech796243_41823_jb5.jpg;/pm/skech/skech796243_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Skech-Air Porter Zevelo Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Amazing comfort and laid-back style is a breeze with the SKECHERS Porter - Zevelo shoe. Soft woven canvas fabric upper in a lace up casual comfort sneaker oxford with stitching and overlay accents. Air Cooled Memory Foam insole, Skech-Air midsole.\n            \n                <ul class=\"detail_comp\"><li>Soft fabric collar trim; Lace up casual comfort sneaker oxford design; Stitching accents</li><li>Canvas side and heel panel overlays; Contrast colored fabric edging at heel panel</li><li>Embossed side S logo; Lace up front</li><li>Padded collar; Soft fabric shoe lining</li><li>Air Cooled Memory Foam full length cushioned comfort insole; Shock absorbing midsole</li><li>Skech-Air design midsole with visible midfoot air cushion for added comfort; Vulcanized look midsole with textured detail</li><li>Outsole with visible translucent air cushion detail; Flexible traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Canvas Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',69.95,69.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(796301,'Midi Perforated Slip-On Sneaker','/pm/vioni/vioni796301_291562_jb1.jpg;/pm/vioni/vioni796301_291562_jb2.jpg;/pm/vioni/vioni796301_291562_jb3.jpg;/pm/vioni/vioni796301_291562_jb4.jpg;/pm/vioni/vioni796301_291562_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Midi Perforated Slip-On Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Don\'t let the stylish upper of the Vionic Midi perforated slip-on sneaker fool you, this fun silhouette is designed with major comfort technology true to the Vionic name. Leather upper is perforated with geometric cutouts and finished with dual elastic gore insets. Inside, EVA orthotic footbed is biomechanically designed to support arches and realign your body for optimal comfort. Count on these Vionic sneakers for reliable support for the on-the-go woman.  \n            \n                <ul class=\"detail_comp\"><li>Perforated leather upper</li><li>Orthaheel Technology</li><li>Twin gore panels</li><li>Leather lining</li><li>Textile-covered EVA orthot