698,'Rockadia Trail Running Shoe','/pm/adida/adida799698_458613_jb1.jpg;/pm/adida/adida799698_458613_jb2.jpg;/pm/adida/adida799698_458613_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>adidas Rockadia Trail Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Don\'t let a little mud and uneven terrain slow you down in the adidas Rockadia Trail Running Shoe. These trail running shoes feature zoned protection with protective overlays that offer durable support for off road runs.\n            \n                <p><br><b>Tech Specs &amp; Features:</b><br></p><ul class=\"detail_comp\"><li>Off-road Zoned Protection.</li><br><li>cloudfoam super-plush feel and cushioning.</li><br><li>ADIWEAR extended protection against wear and tear.</li><br></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            BOUNCE</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(800218,'Skech-Air Elment Meron Sneaker','/pm/skech/skech800218_359885_jb1.jpg;/pm/skech/skech800218_359885_jb2.jpg;/pm/skech/skech800218_359885_jb3.jpg;/pm/skech/skech800218_359885_jb5.jpg;/pm/skech/skech800218_359885_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Skech-Air Elment Meron Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Redefine cool with air cushioned comfort and style in the Skechers Skech-Air Elment Meron Sneaker. Smooth leather and synthetic upper in a lace-up casual comfort sneaker oxford with stitching, overlay, and perforation accents. Air Cooled Memory Foam insole, Skech-Air midsole.\n            \n                <p><br><b>Features</b><br></p><ul class=\"detail_comp\"><li>Smooth leather upper with smooth synthetic overlay detail</li><li>Lace-up casual comfort sneaker oxford design</li><li>Soft elastic fabric collar panels for flexible comfort</li><li>Padded tongue</li> <li>Air Cooled Memory Foam full length cushioned comfort insole</li><li>Shock-absorbing Skech-Air design midsole with subtle midfoot air cushion for added comfort</li><li>Sporty midsole with textured detail</li> <li>Outsole grooves with subtle translucent air cushion detail</li> <li>Flexible traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Memory Foam</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(800823,'Burst Donlen Sneaker','/pm/skech/skech800823_41823_jb1.jpg;/pm/skech/skech800823_41823_jb2.jpg;/pm/skech/skech800823_4