\n		</div><!--end product_specs-->\n	</div>',69.95,69.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(801527,'Cobb Hill Hollywood 2 Piece Cuff Sandal','/pm/thero/thero801527_432376_jb1.jpg;/pm/thero/thero801527_432376_jb2.jpg;/pm/thero/thero801527_432376_jb5.jpg;/pm/thero/thero801527_432376_jb6.jpg;/pm/thero/thero801527_432376_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Rockport Cobb Hill Hollywood 2 Piece Cuff Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Up your style game with the Cobb Hill Hollywood 2 Piece Cuff Sandal by Rockport. With an EVA footbed and a wedge heel, this ankle cuff sandal combines fashion and function.\n            \n                <ul class=\"detail_comp\"><li>EVA footbed</li><li>TPR outsole with wood grain finish</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Synthetic</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Synthetic</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',83.95,83.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(802856,'Arla Glison Thong Sandal','/pm/thecl/thecl802856_250230_jb1.jpg;/pm/thecl/thecl802856_250230_jb2.jpg;/pm/thecl/thecl802856_250230_jb3.jpg;/pm/thecl/thecl802856_250230_jb4.jpg;/pm/thecl/thecl802856_250230_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Arla Glison Thong Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Clarks Arla Glison Thong Sandal provides the best of comfort technology with classic feminine appeal. Part of the Clarks® Cloudsteppers Collection, this flip flop features soft fabric that gives it a playful edge and feels delicately soft between the toes. A Clarks Cushion Soft with OrthoLite® footbed ensures optimal comfort while an EVA midsole keeps it feather light which makes this an ultra-wearable sandal with no shortage of personality.\n            \n                <p></p><ul class=\"detail_comp\"><li> Part of the Clarks® Cloudsteppers Collection</li><li>Clarks Cushion Soft comfort technology</li><li>EVA midsole</li><li>Textile lining</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            OrthoLite®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TPR</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',