_431536_jb4.jpg;/pm/drmar/drmar803355_431536_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dr. Martens Pascal 8-Eye Zip Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Part of the brands iconic range, the Dr. Martens Pascal 8-Eye Zip Boot is sure to make you stand out. This combat boot features a lateral curved zip that runs parallel to the eyelets for better ease of entry.\n            \n                <ul class=\"detail_comp\"><li>Goodyear welt construction</li><li>Lateral zip in side</li><li>Lace-up details</li><li>Heel loop</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Shaft Height:</span>\n            \n            7\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Tumbled Leather, Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(803388,'ZEROGRAND Stitchlite Oxford','/pm/coleh/coleh803388_434580_jb1.jpg;/pm/coleh/coleh803388_434580_jb2.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Cole Haan ZEROGRAND Stitchlite Oxford Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                With an all-over knit upper and a fully padded sock lining, Cole Haan\'s ZEROGRAND Stitchlite Oxford offers all-day comfort and style for your leisurely activities.\n            \n                <ul class=\"detail_comp\"