             <ul class=\"detail_comp\"><li>Canvas upper\n</li><li>EVA sockliner\n</li><li>Cushioning at midsole\n</li><li>Lace up closure\n</li><li>Metal eyelets\n</li><li>Rubber outsole\n</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please add 2 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 8.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(803816,'Reedly Salene Wedge Ankle Strap','/pm/thecl/thecl803816_416563_jb1.jpg;/pm/thecl/thecl803816_416563_jb2.jpg;/pm/thecl/thecl803816_416563_jb3.jpg;/pm/thecl/thecl803816_416563_jb4.jpg;/pm/thecl/thecl803816_416563_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Reedly Salene Wedge Ankle Strap Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                On-trend perforated upper is the perfect finishing touch to the Clarks Reedly Salene Wedge Sandal. But styling aside, these Clarks sandals are designed with serious comfort technology including Cushion Soft technology and an Ortholite footbed which ensure a cushy ride with plenty of stability and shock absorption. Finished with a rubber outsole and adjustable hook-and-loop ankle strap, these wedge heel sandals are perfect for the woman who wants it all: comfort and style. \n            \n                <ul class=\"detail_comp\"><li>Part of the Clarks® Collection</li><li>Leather or nubuck upper</li><li>Ankle strap with hook-and-loop closure</li><li>Cushion Soft™ technology</li><li>Synthetic lining</li><li>OrthoLite® footbed</li><li>Polyurethane midsole</li><li>TPR outsole</li><li>2.75-inch wedge</li><li>Weight: 9.4 oz.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 3/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            OrthoLite®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TPR</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Goat Nubuck, Cow Full Grain Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',75.99,75.99,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(803927,'Stasha Hale 4 Criss Cross Slingback','/pm/thecl/thecl803927_435201_jb1.jpg;/pm/thecl/thecl803927_435201_jb2.jpg;/pm/thecl/thecl803927_435201_jb3.jpg;/pm/thecl/thecl803927_435201_jb4.jpg;/pm/thecl/thecl803927_435201_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Stasha Hale 4 Criss Cross Slingback Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Get the best of easy styling and cushioned comfort in the Clarks Stasha Hale 4 Criss Cross Slingback. From the Clarks® Collection, this sandal features Cushion Soft™ technology with an OrthoLite® footbed for impact absorption and underfoot comfort.\n            \n                <p></p><ul class=\"detail_comp\"><li>Part of the Clarks® Collection</li><li>Cushion Soft™ technology</li><li>OrthoLite® footbed</li><li>EVA midsole</li><li>Hook-and-loop closure</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            OrthoLite®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',67.99,67.99,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(804089,'GOwalk 4 Slip-On Sneaker','/pm/skech/skech804089_41823_jb1.jpg;/pm/skech/skech804089_41823_jb2.jpg;/pm/skech/skech804089_41823_jb3.jpg;/pm/skech/skech804089_41823_jb5.jpg;/pm/skech/skech804089_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers GOwalk 4 Slip-On Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Every day is a choice. Choose greatness with the Skechers GOwalk 4 Slip-On Sneaker. Features innovative 5GEN® midsole design and an advanced nearly seamless one-piece mesh fabric upper with Skechers Goga Max insole for the most advanced walking experience ever.\n            \n                Innovative and highly responsive 5GEN® midsole cushioning. 5th-generation design provides a high energy return on every step. Mesh upper engineered to naturally expand with your foot while you walk. Nearly seamless construction for comfortable fit. Bamboo-lined footbed for antibacterial odor control. Goga Pillars® on outsole evolved into a more streamlined design. Skechers Goga Max insole for next-generation cushioning and support. Tapering midfoot design for improved arch support. Weight: 7 1/2 oz. per shoe in a men\'s size 9.\n            \n                <br><ul class=\"detail_comp\"><li>Highly breathable, lightweight, and comfortable athletic mesh fabric upper</li> <li>Synthetic overlays at toe and heel for added durability</li> <li>Featherweight sockliner adapts to the foot while you walk</li> <li>Natural expansion provides a comfortable, natural fit</li> <li>Stabilizing heel fabric overlay panels</li> <li>Quick-Fit Portal on heel for easy pull-on wear</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Goga Max</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Athletic Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',62.45,62.45,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(804125,'GOrun 400 Generate Trainer','/pm/skech/skech804125_41823_jb1.jpg;/pm/skech/skech804125_41823_jb2.jpg;/pm/skech/skech804125_41823_jb3.jpg;/pm/skech/skech804125_41823_jb5.jpg;/pm/skech/skech804125_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers GOrun 400 Generate Trainer Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Skechers GOrun 400 Generate Trainer is a well-cushioned, lightweight trainer perfect for a variety of workouts in and out of the gym. The responsive 5GEN® cushioning midsole and a breathable mesh upper offer an incredibly responsive workout shoe.\n            \n                5GEN® midsole material delivers comfort and response. Goga Run® insole provides shock absorption and support. Breathable sandwich mesh fabric and synthetic upper. Comfortable lightweight and well ventilated upper design. Sole with GOimpulse sensors for responsive traction and ground feel. Parametric midsole construction for support and stability. Weight: 8 oz. per shoe in a men\'s size 9.\n            \n                <br><ul class=\"detail_comp\"><li>Super lightweight sandwich mesh upper</li> <li>Layered mesh for comfort and breathability</li> <li>Synthetic overlays at laces and heel for added support</li> <li>Quick-Fit Portal at heel for added easy wear</li> <li>Ideal for treadmill running and workouts</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Goga Run®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Super Lightweight Sandwich Mesh/Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(804376,'Crest Vibe Sneaker','/pm/wolve/wolve804376_435725_jb1.jpg;/pm/wolve/wolve804376_435725_jb2.jpg;/pm/wolve/wolve804376_435725_jb3.jpg;/pm/wolve/wolve804376_435725_jb5.jpg;/pm/wolve/wolve804376_435725_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Crest Vibe Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Stay adventure-ready as you hit the sea while wearing the Sperry Crest Vibe Sneaker. With a removable, polyurethane molded footbed, this lightweight shoe provides comfort and arch support for confident strides.\n            \n                <ul class=\"detail_comp\"><li>Removable, polyurethane molded footbed</li><li>Vulcanized construction with secure bond between upper and outsole</li><li>Rawhide fixed laces with rustproof eyelets</li><li>Non-marking, vulcanized rubber outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"hig