9.00,109.00,4,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:30'),(804502,'Reggae Slim Vacay Sandal','/pm/skech/skech804502_41823_jb1.jpg;/pm/skech/skech804502_41823_jb2.jpg;/pm/skech/skech804502_41823_jb3.jpg;/pm/skech/skech804502_41823_jb5.jpg;/pm/skech/skech804502_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Reggae Slim Vacay Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Travel anywhere in style and comfort with the Skechers Reggae Slim Vacay Sandal. Smooth faux leather and webbing fabric upper in a casual comfort sport strappy sandal with adjustable convertible straps. Memory Foam insole.\n            \n                <br><ul class=\"detail_comp\"><li>Smooth faux leather upper with webbing fabric straps</li> <li>Instep strap with quick-access buckle detail</li> <li>Heel sling strap with center comfort cushion pad and dual side adjustable hook-and-loop closures</li> <li>Convertible design with removable heel strap</li> <li>Soft fabric strap lining</li> <li>Lightly textured cushioned comfort footbed with Memory Foam cushioned insole</li> <li>Shock absorbing midsole</li> <li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Memory Foam</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Faux Leather/Webbing Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.95,44.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(805149,'Linares Loafer M2G-3095NO','/pm/pikol/pikol805149_436807_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Pikolinos Linares Loafer M2G-3095NO Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Sleek and smart, the Pikolinos Linares Loafer is ideal for casual, everyday wear. This loafer has allover perforations that add edgy detail to finish the look.\n            \n                <ul class=\"detail_comp\"><li>Lining: 75% leather, 25% textile</li><li>Perforated detail</li><li>Style number: M2G-3095</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            5/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',179.95,179.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(805629,'Reveal Cap Toe Oxford, Jr.','/pm/flors/flors805629_4638_jb1.jpg;/pm/flors/flors805629_4638_jb2.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Florsheim Reveal Cap Toe Oxford, Jr. Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Floesheim Reveal Cap Toe Oxford Jr. is a handsome shoe with classic style drawing on over 125 years of Florsheim heritage. Designed for superior comfort and great for school and other formal occasions, these lace ups are built to last.\n            \n                <p><br></p><ul class=\"detail_comp\"><li>Genuine leather upper.</li><li>Breathable leather lining</li><li>Shock-absorbing rubber outsole.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Textile</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(806802,'Parallel Trapezoid Platform Wedge Sandal','/pm/skech/skech806802_41823_jb1.jpg;/pm/skech/skech806802_41823_jb2.jpg;/pm/skech/skech806802_41823_jb3.jpg;/pm/skech/skech806802_41823_jb5.jpg;/pm/skech/skech806802_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Parallel Trapezoid Platform Wedge Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Versatile style and wear-anywhere comfort align perfectly in the Skechers Cali Parallel Trapezoid Platform Wedge Sandal. Soft suede upper in a wedge-heeled casual comfort heel-sling fashion sandal with Memory Foam comfort footbed.\n            \n                <br><ul class=\"detail_comp\"><li>Soft suede upper</li> <li>Cutout designs on front with center panel overlay</li> <li>Heel slingback strap with adjustable hook-and-loop closure</li> <li>Smooth leather and soft fabric strap lining</li> <li>Memory Foam full-length cushioned comfort footbed</li> <li>Lightweight platform wedge sole</li> <li>1 inch midsole height</li> <li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Memory Foam</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Suede</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(807422,'GOwalk 4 Magnificent Slip-On','/pm/skech/skech807422_70027_jb1.jpg;/pm/skech/skech807422_70027_jb2.jpg;/pm/skech/skech807422_70027_jb3.jpg;/pm/skech/skech807422_70027_jb5.jpg;/pm/skech/skech807422_70027_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers GOwalk 4 Magnificent Slip-On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Every day is a choice. Choose greatness with the Skechers GOwalk 4 Magnificent Slip-On. Features innovative 5GEN® midsole design and a woven canvas fabric upper with Skechers Goga Max® insole for the most advanced walking experience ever.\n            \n                Innovative and highly responsive 5GEN® midsole cushioning. 5th-generation design provides a high energy return on every step. Soft woven canvas fabric upper engineered to naturally expand with your foot while you walk. Lightweight soft fabric upper for comfortable fit. Bamboo-lined footbed for antibacterial odor control. Goga Pillars® on outsole evolved into a more streamlined design. Skechers Goga Max insole for next-generation cushioning and support. Tapering midfoot design for improved arch support. Weight: 6 1/2 oz. per shoe in a men\'s size 9.\n            \n                <br><ul class=\"detail_comp\"><li>Soft woven canvas fabric upper</li> <li>Smooth flexible fabric design</li> <li>Highly breathable, lightweight, and comfortable upper design</li> <li>Featherweight sockliner adapts to the foot while you walk</li> <li>Natural expansion provides a comfortable, natural fit</li> <li>Stabilizing heel fabric overlay panels</li> <li>Quick-Fit Portal on heel for easy pull-on wear</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Goga Max</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Canvas Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',45.50,45.50,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(807654,'Original Kids Glitter Finish Rain Boot','/pm/hunte/hunte807654_439140_jb1.jpg;/pm/hunte/hunte807654_439140_jb2.jpg;/pm/hunte/hunte807654_439140_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hunter Original Kids Glitter Finish Rain Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The waterproof Hunter Original Kids Glitter Finish Rain Boot is modeled after the original women\'s boot made from 28 natural rubber parts. The glitter finish adds fun and sparkle.\n            \n                <ul class=\"detail_comp\"><li>Adjustable buckle</li><li>Textile lining</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Shaft Height:</span>\n            \n            11\" (Size 8)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Circumference:</span>\n            \n            13.5\" (Size 8)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Nylon</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',80.00,80.00,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(807655,'Original Kids Metal Rain Boot','/pm/hunte/hunte807655_439142_jb1.jpg;/pm/hunte/hunte807655_439142_jb2.jpg;/pm/hunte/hunte807655_439142_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hunter Original Kids Metal Rain Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The waterproof Hunter Original Kids Metal Boot is modeled after the original women\'s boot made from 28 natural rubber parts. The metal finish adds a fun and stylish twist.\n            \n                <ul class=\"detail_comp\"><li>Adjustable buckle</li><li>Textile lining</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Shaft Height:</span>\n            \n            11\" (Size 8)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Circumference:</span>\n            \n            13.5\" (Size 8)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Nylon</div>\n  