r807786_442388_jb4.jpg;/pm/caler/caler807786_442388_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sam Edelman Felicia Ballet Flat Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                With a charm-adorned bow accent, the Sam Edelman Felicia Ballet Flat certainly doesn\'t fall flat. This elasticized slip-on goes with everything and will easily become a wardrobe staple for seasons to come.\n            \n                <ul class=\"detail_comp\"><li>Elasticized topline </li><li>Leather lining </li><li>Padded insole </li><li>Imported </li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            3/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(807789,'Yaro Ankle Strap Sandal','/pm/caler/caler807789_452907_jb1.jpg;/pm/caler/caler807789_452907_jb2.jpg;/pm/caler/caler807789_452907_jb3.jpg;/pm/caler/caler807789_452907_jb4.jpg;/pm/caler/caler807789_452907_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sam Edelman Yaro Ankle Strap Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A wardrobe must, the Sam Edelman Yaro Sandal is that essential style that manages to work with everything. Adjustable ankle strap runs parallel to a minimal toe strap in a barely-there upper that maximizes exposure for a major leg-lengthening effect. Covered heel is sizeable but sturdy thanks to the chunky block design. Pair these Sam Edelman sandals with cocktails and L.B.D.\'s or coffee and joggers for a dose of on-trend cool. \n            \n                <ul class=\"detail_comp\"><li>Suede, fabric, or leather upper</li><li>Adjustable ankle strap with buckle closure</li><li>Synthetic lining</li><li>Manmade insole</li><li>Manmade outsole</li><li>4-inch covered block heel</li><li>Weight: 10 oz.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,4,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:30'),(807802,'Gigi Thong Sandal','/pm/caler/caler807802_439349_jb1.jpg;/pm/caler/caler807802_439349_jb2.jpg;/pm/caler/caler807802_439349_jb3.jpg;/pm/caler/caler807802_439349_jb4.jpg;/pm/caler/caler807802_439349_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sam Edelman Gigi Thong Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The iconic Sam Edelman Gigi Thong Sandal is a warm-weather must. This flat sandal features a adjustable ankle strap and signature padded sock for all-day comfortable wear. Palm Beach chic, this goes with everything from white jeans to a printed sundress.\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.00,39.00,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(807805,'Carrin Platform Espadrille','/pm/caler/caler807805_57118_jb1.jpg;/pm/caler/caler807805_57118_jb2.jpg;/pm/caler/caler807805_57118_jb3.jpg;/pm/caler/caler807805_57118_jb4.jpg;/pm/caler/caler807805_57118_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sam Edelman Carrin Platform Espadrille Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Your favorite platform sneaker gets a beachy upgrade in the Sam Edelman Carrin Platform Espadrille. Everything about this style is easy. From the slip-on upper with elastic gore inserts to the braided raffia midsole, this minimalist design will help you go with the flow. The perfect everyday espadrille, these Sam Edelman slip-ons are available in a ton of different colors, patterns, and materials to help you complete your look. \n            \n                <ul class=\"detail_comp\"><li>1.5-inch braided raffia platform </li><li>Twin gore</li><li>Contrast stitching </li><li>Tonal piping </li><li>Slip-on style </li><li>Synthetic lining </li><li>Manmade sole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',89.95,89.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(807810,'Hazel Pointed Toe Stiletto Heel Pump','/pm/caler/caler807810_57118_jb1.jpg;/pm/caler/caler807810_57118_jb2.jpg;/pm/caler/caler807810_57118_jb3.jpg;/pm/caler/caler807810_57118_jb4.jpg;/pm/caler/caler807810_57118_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sam Edelman Hazel Pointed Toe Stiletto Heel Pump Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Basic is anything but boring with the Sam Edelman Hazel pointed toe pump. Classic detailing like a perfectly pointed toe, mid-height covered stiletto heel, and a low cut vamp meet modern fit technology including a lightly padded sockliner for the perfect combination of style and comfort. These sleek Sam Edelman heels pair as well with cocktail dresses as they do casual wear, so whether you prefer a statement-making pattern or a classic black or nude the Hazel is the perfect finishing touch. \n            \n                <ul class=\"detail_comp\"><li>Leather or fabric or suede or polyurethane or lace upper</li><li>Fit Technology</li><li>Low-cut vamp</li><li>Padded sockliner</li><li>Synthetic insole</li><li>Leather outsole</li><li>3.75-inch heel</li></ul>\n            \n                <iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/oxXq-VN7Vuk?rel=0\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            3 3/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',72.00,72.00,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(807956,'455 Classic Running Shoe - Grade School','/pm/newba/newba807956_11075_jb1.jpg;/pm/newba/newba807956_11075_jb3.jpg;/pm/newba/newba807956_11075_jb6.jpg;/pm/newba/newba807956_11075_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance 455 Classic Running Shoe - Grade School Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Children will love to wear the New Balance 455 Classic Running Shoe. It comes in fun, bright colors that will match their energetic personality. The durable leather and mesh upper provides long-lasting wear and protection.\n            \n                <p><br></p><ul class=\"detail_comp\"><li>Leather and mesh upper</li><li>Injection-molded EVA (IMEVA) midsole for firm, yet flexible cushioning.</li><li>Rubber sole</li><li>Style ID: KR455</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            IMEVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.95,44.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(808210,'Ngage 1.0 Lace-Up Sneaker','/pm/vioni/vioni808210_291562_jb1.jpg;/pm/vioni/vioni808210_291562_jb2.jpg;/pm/vioni/vioni808210_291562_jb3.jpg;/pm/vioni/vioni808210_291562_jb5.jpg;/pm/vioni/vioni808210_291562_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vionic with Orthaheel Technology Ngage 1.0 Lace-Up Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Vionic Ngage 1.0 Lace-Up Sneaker was developed with synergy in mind, with its insole, midsole, and outsole engineered in to a single dual-density unit for improved dynamic function. Memory foam lines the insole for instant comfort, and 1st Ray technology facilitates improved flexibility beneath the first metatarsal.\n            \n                <br><ul class=\"detail_comp\"><li>Manmade and textile upper</li><li>Footbed/outsole: co-molded proprietary EVA compound with rubber outsole</li><li>Recommended by Dr. Andrew Weil</li><li>U.S. patent pending</li></ul>\n            \n                <br><ul class=\"detail_comp\"><li>Vionic brand\'s biomechanical technology is shown to be an effective treatment for heel pain.</li><li>Vionic brand\'s biomechanical footbed supports you from the ground up.</li><li>By building biomechanical technology into premium footwear, Vionic brings together the best of science and style.</li><li>For the greatest comfort, we recommend wearing your new Vionic footwear for just a few hours for the first few days to allow your feet to adjust to the new level of orthotic comfort and support. Within one to two weeks you should find the product completely comfortable and supportive.</li></ul>\n            \n                <p> </p><p><b>Vionic Natural Alignment</b></p> <img src=\"//images/desc/vionic/NaturalAlignment.jpg?&gt;&lt;p&gt;&lt;/p&gt;%0A%20%20%20%20%20%20%20%20%20%20%20%20%0A%20%20%20%20%20%20%20%20&lt;/span&gt;&lt;/div&gt;<!--end product_description-->%0A%20%20%20%20%20%20%20%20%0A%09%09&lt;div%20class=\" product_specs grid_7>\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            Length runs a bit short. We recommend ordering a half size larger than you normally wear.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Co-Molded Proprietary EVA Compound</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic/Textile</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</span></div><!--end product_specs-->\n	</div>',83.95,83.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(808282,'455 Classic AC Running Shoe - Grade School','/pm/newba/newba808282_11075_jb1.jpg;/pm/newba/newba808282_11075_jb3.jpg;/pm/newba/newba808282_11075_jb6.jpg;/pm/newba/newba808282_11075_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance 455 Classic AC Running Shoe - Grade School Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Children will love to wear the New Balance 455 Classic AC (Alternative Closure) Running Shoe. It comes in fun, bright colors that will match their energetic personality. The durable leather and mesh upper provides long-lasting wear and protection, and the alternative closure ensures a more secure fit.\n            \n                <p><br></p><ul class=\"detail_comp\"><li>Leather and mesh upper</li><li>Injection-molded EVA (IMEVA) midsole for firm, yet flexible cushioning.</li><li>Rubber sole</li><li>Alternative hook and loop closure</li><li>Style ID: KA455</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            IMEVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic/Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.95,44.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(808333,'OOriginal Thong Sandal','/pm/oofos/oofos808333_440242_jb1.jpg;/pm/oofos/oofos808333_440242_jb2.jpg;/pm/oofos/oofos808333_440242_jb3.jpg;/pm/oofos/oofos808333_440242_jb4.jpg;/pm/oofos/oofos808333_440242_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Oofos OOriginal Thong Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                More than just a flip flop, the Oofos OOriginal Thong Sandal features patented Oofoam technology, designed to cradle your arches and cushion sore joints after a workout. This shock-absorbent recovery sandal is so light it floats.\n            \n                <ul class=\"detail_comp\"><li>Absorbs 37% more shock than other materials</li><li>Reduces stress on sore feet, knees and lower back</li><li>Cradles your arches</li><li>Biomechanically designed footbed allows natural motion</li><li>Soft, conforming toe post eliminates toe chafing</li><li>Shower/beach-ready; moisture resistant; doesn\'t retain smell</li><li>Durable OOfoam holds its cushion</li><li>Machine washable</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style.  All sizing is listed in MEN\'S SIZES.  If you would like to purchase a Women\'s size please subtract 2 sizes to convert to Men\'s.  For example, if you would like to order a Women\'s size 6, please order a size 4.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            OOfoam</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(808891,'Elite Flex Muzzin Bungee Lace Shoe','/pm/skech/skech808891_41824_jb1.jpg;/pm/skech/skech808891_41824_jb2.jpg;/pm/skech/skech808891_41824_jb3.jpg;/pm/skech/skech808891_41824_jb5.jpg;/pm/skech/skech808891_41824_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Elite Flex Muzzin Bungee Lace Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Keep your style perfectly flexible and amazingly comfortable with the SKECHERS Elite Flex - Muzzin Bungee Lace Shoe. Skech Knit Mesh fabric and synthetic upper in a slip on bungee laced sporty comfort walking and training sneaker with interwoven tweed pattern. Air Cooled Memory Foam insole, highly flexible comfort midsole.\n            \n                <ul class=\"detail_comp\"><li>Smooth synthetic 3D printed side panel overlays for added durability</li><li>Woven-in sporty tweed-look design with contrast color detail</li><li>Side stitched seam details; Side S logo; Bungee stretch laced front panel for laced-look and slip on ease</li><li>High apex front and heel for added comfort; Heel panel overlay with SKECHERS logo and top pull on tab</li><li>Center fabric stripe with pull on instep tab; Padded collar; Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Elite Flex midsole with superior impact cushioning protection and remarkable energy return; Highly flexible articulated midsole and outsole design for freedom of movement; Textured channel design midsole finish</li><li>Flexible outsole with flexible articulated traction design</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Skech Knit Mesh Nearly One Piece Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(808894,'Elite Flex Bungee Lace Shoe','/pm/skech/skech808894_56053_jb1.jpg;/pm/skech/skech808894_56053_jb2.jpg;/pm/skech/skech808894_56053_jb3.jpg;/pm/skech/skech808894_56053_jb5.jpg;/pm/skech/skech808894_56053_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Elite Flex Bungee Lace Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Make your sporty style more flexible and comfortable with the SKECHERS Elite Flex Bungee Lace Shoe. Unique flat knit mesh fabric and synthetic upper in a slip on bungee laced sporty comfort walking and training sneaker with interwoven designs. Air Cooled Memory Foam insole, highly flexible comfort midsole.\n            \n                <ul class=\"detail_comp\"><li>Smooth synthetic side panel overlays for added durability; Interwoven ventilating panels</li><li>Bungee stretch laced front panel for laced-look and slip on ease</li><li>High apex front and heel for added comfort; Center fabric stripe with pull on instep tab</li><li>Padded collar; Stitched detail and stretch fabric at collar; Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Elite Flex midsole with superior impact cushioning protection and remarkable energy return</li><li>Highly flexible articulated midsole and outsole design for freedom of movement; Textured channel design midsole finish</li><li>Flexible outsole with flexible articulated traction design</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Flat Knit Mesh Nearly One Piece Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(810714,'Haniger Training Sneaker','/pm/skech/skech810714_41823_jb1.jpg;/pm/skech/skech810714_41823_jb2.jpg;/pm/skech/skech810714_41823_jb3.jpg;/pm/skech/skech810714_41823_jb5.jpg;/pm/skech/skech810714_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Haniger Training Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A classic look training shoe gets updated comfort in the SKECHERS Haniger Training Sneaker. Smooth leather and synthetic upper in a lace up athletic sporty training sneaker with stitching, overlay and perforation detail. Memory Foam insole, shock absorbing midsole, durable rubber outsole.\n            \n                <ul class=\"detail_comp\"><li>Synthetic overlays</li><li>Perforation accents on front and side panels for cooling effect</li><li>Contrast colored collar and lace area trim</li><li>Toe, side and heel overlays for added stability</li><li>Heel overlay panel with pull on fabric top tab</li><li>Lace up front with contrast colored TPU top eyelet</li><li>Padded collar and tongue; Soft fabric shoe lining</li><li>Memory Foam full length cushioned comfort insole</li><li>Supportive shock absorbing lighter weight midsole design</li><li>Classic style 1 1/2 inch fuller athletic heel</li><li>Flexible rubber durable high traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(810716,'Haniger Casspi Training Sneaker','/pm/skech/skech810716_41823_jb1.jpg;/pm/skech/skech810716_41823_jb2.jpg;/pm/skech/skech810716_41823_jb3.jpg;/pm/skech/skech810716_41823_jb5.jpg;/pm/skech/skech810716_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Haniger Casspi Training Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Instant sporty training style and comfort comes in the SKECHERS Haniger - Casspi Training Sneaker. Smooth leather and synthetic upper in a two strap front athletic sporty training sneaker with stitching, overlay and perforation detail. Memory Foam insole, shock absorbing midsole, durable rubber outsole.\n            \n                <ul class=\"detail_comp\"><li>Synthetic overlays</li><li>Synthetic toe, side and heel overlay detail</li><li>Front and side perforation vents for cooling effect</li><li>Side S logo</li><li>Heel panel with fabric pull on top tab</li><li>Two strap front design for easy access</li><li>Dual adjustable hook and loop closures for a precise fit</li><li>Padded collar and tongue; Soft fabric shoe lining</li><li>Memory Foam full length cushioned comfort insole</li><li>Supportive shock absorbing lighter weight midsole design</li><li>Classic style 1 1/4 inch fuller athletic heel</li><li>Flexible rubber durable high traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(811491,'Probaby Cowboy Boot','/pm/ariat/ariat811491_237244_jb1.jpg;/pm/ariat/ariat811491_237244_jb3.jpg;/pm/ariat/ariat811491_237244_jb5.jpg;/pm/ariat/ariat811491_237244_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Ariat Probaby Cowboy Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Whether you\'re headed to the farm, the fair, or anywhere in between, the Ariat Probaby Cowboy Boot is a easy way to step into style.\n            \n                <br><ul class=\"detail_comp\"><li>Classic four-row stitch pattern</li><li>Exclusive Ariat® Booster Bed</li><li>Everlon combination EVA and blown rubber outsole</li><li>Fatbaby toe</li><li>4LR footbed</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            4LR</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Everlon</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(811692,'Emiline Loafer','/pm/caler/caler811692_58095_jb1.jpg;/pm/caler/caler811692_58095_jb2.jpg;/pm/caler/caler811692_58095_jb3.jpg;/pm/caler/caler811692_58095_jb4.jpg;/pm/caler/caler811692_58095_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Naturalizer Emiline Loafer Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Naturalizer Emiline Loafer is a stylish flat with a microfiber upper lining that lends a soft touch to every step. Naturalizer N5 Contour Technology delivers the support and comfort that you need.\n            \n                <ul class=\"detail_comp\"><li>Contoured footbed features extra cushioning with a molded dual density foam</li><li>Patent pending contoured insole board and built in heel cup</li><li>Breathable lining</li><li>Flexible sole</li><li>Lightweight materials</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            5/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This style tends to run small.  For an accurate fit we recommend purchasing a 1/2 size larger than you typically purchase.  For example, if you normally purchase a size 7, we recommend purchasing a size 7 1/2.</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather, Nubuck, Brocade, or Velvet</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',62.30,62.30,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(811834,'Bailey Bow II Kids Boot','/pm/decke/decke811834_443762_jb1.jpg;/pm/decke/decke811834_443762_jb2.jpg;/pm/decke/decke811834_443762_jb3.jpg;/pm/decke/decke811834_443762_jb5.jpg;/pm/decke/decke811834_443762_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>UGG Bailey Bow II Kids Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The UGG Bailey Bow II Boot is an ideal pick to keep your little one\'s foot dry and warm during chilly days. This boot features a plush UGGpure™ wool insole that naturally wicks moisture away, and the Treadlite by UGG&amp;$8482; outsole that provides increased cushioning, durability, and traction.\n            \n                <ul class=\"detail_comp\"><li>Treadlite by UGG™ outsole</li><li>Cushioned foam insole lined with 17mm UGGpure™ wool</li><li>17mm Twinface upper</li><li>Fixed bows along back shaft</li><li>Pretreated to repel moisture and stains</li><li>Nylon binding</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Shaft Height:</span>\n            \n            6\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            UGGpure™ Wool</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Treadlite by UGG™</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Twinface</div>\n            \n		</div><!--end product_specs-->\n	</div>',149.95,149.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(811860,'Alexey II Mid Calf Boot','/pm/decke/decke811860_443762_jb1.jpg;/pm/decke/decke811860_443762_jb2.jpg;/pm/decke/decke811860_443762_jb3.jpg;/pm/decke/decke811860_443762_jb4.jpg;/pm/decke/decke811860_443762_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>UGG Alexey II Mid Calf Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Ensure your child\'s foot stays dry and warm with the UGG Alexey II Mid Calf Boot. The UGGpure™ wool insole naturally wicks moisture away, while the Treadlite by UGG™ outsole provides increased cushioning, durability, and traction. This shoe features a sheepskin vamp and heel counter lining that not only regulates body temperature but also adds comfort.\n            \n                <ul class=\"detail_comp\"><li>Treadlite by UGG™ outsole</li><li>10mm curly UGGpure™ wool insole</li><li>10mm Twinface shaft</li><li>10mm sheepskin vamp and heel counter lining</li><li>Pretreated to repel moisture and stains</li><li>Soft suede vamp and heel counter</li><li>Microsuede binding</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            UGGpure™ Wool</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Treadlite by UGG™</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Twinface</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',127.95,127.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(811900,'Old Skool V Sneaker','/pm/vansi/vansi811900_443857_jb1.jpg;/pm/vansi/vansi811900_443857_jb2.jpg;/pm/vansi/vansi811900_443857_jb3.jpg;/pm/vansi/vansi811900_443857_jb6.jpg;/pm/vansi/vansi811900_443857_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans Old Skool V Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Vans Old Skool V Sneaker features suede and canvas uppers, single-wrap foxing tape, triple hook-and-loop straps, and Vans original waffle outsoles for grip and traction.\n            \n                <p><br></p><ul class=\"detail_comp\"><li>Triple hook-and-loop straps</li><li>Vans waffle grip rubber outsole.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Suede/Canvas</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(811933,'Stinson ATR 4 Trail Running Shoe','/pm/decke/decke811933_456700_jb1.jpg;/pm/decke/decke811933_456700_jb2.jpg;/pm/decke/decke811933_456700_jb3.jpg;/pm/decke/decke811933_456700_jb5.jpg;/pm/decke/decke811933_456700_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hoka One One Stinson ATR 4 Trail Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Built on a new wider last, the Hoka One One Stinson ATR 4 Trail Running Shoe has a much improved fit, appropriate to what you\'re going to put it through. This versatile All Terrain performer features a wider flare in the forefoot and toe, which allied with the shoe\'s cushion and durability, means you can go farther and longer. And with more lugs, more tightly packed, you can be surefooted whatever the conditions. The Stinson 4 truly puts the All Terrain in ATR. It\'s aggressive-looking and aggressive doing, taking you far and wide in comfort.\n            \n                <p></p><ul class=\"detail_comp\"><li>Speedframe construction for midfoot capture and support</li><li>Reinforced open mesh completes a durable, breathable package</li><li>Molded OrthoLite® sock liner</li><li>Updated with a wider platform and more accommodating fit</li><li>Stable late stage Meta-Rocker</li><li>4mm lugs provide all-terrain traction</li><li>Podular outsole design provides stability on uneven terrain.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',129.95,129.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(811954,'Speedgoat 2 Trail Running Shoe','/pm/decke/decke811954_456700_jb1.jpg;/pm/decke/decke811954_456700_jb2.jpg;/pm/decke/decke811954_456700_jb3.jpg;/pm/decke/decke811954_456700_jb5.jpg;/pm/decke/decke811954_456700_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hoka One One Speedgoat 2 Trail Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Speedgoat 2 Trail Running Shoe is designed to attack all breeds of technical trail. And with this bold, fully redesigned iteration, it has improved fit, stability, and durability. Built on a new last, the wider midsole creates a more stable platform for the foot and offers a wider toe box with reinforced areas where your feet need them. The outsole features deeper, more aggressive Vibram® lugs which hold up to all kinds of rugged terrain, while the more forgiving upper offers improved comfort up top. This is one fast, tough trail running shoe.\n            \n                <p></p><ul class=\"detail_comp\"><li>Midfoot cage construction designed for stability and lockdown/foot capture</li><li>Open engineered mesh construction to maximize breathability and support</li><li>Reinforced speed frame construction for durability on the trail.</li><li>CMEVA foam midsole absorbs impact points and offers stable footing.</li><li>Vibram® MegaGrip hi-traction outsole with 5mm lugs</li><li>Multidirectional lugs for supreme grip on varied terrain.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',139.95,139.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(811955,'Hupana Running Shoe','/pm/decke/decke811955_456692_jb1.jpg;/pm/decke/decke811955_456692_jb2.jpg;/pm/decke/decke811955_456692_jb3.jpg;/pm/decke/decke811955_456692_jb5.jpg;/pm/decke/decke811955_456692_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hoka One One Hupana Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                <p>Named for the Maori word for \"spring back,\" the Hoka One One Hupana Running Shoe provides quick responsiveness, due to its full RMAT® midsole and outsole, creates a sensation of flying just above the ground. The Hupana is a shoe you can wear all day. From run to workout to running around town, this agile little number features the renowned HOKA cushion feel, and the responsive and lightweight full RMAT® midsole and outsole provides a unique combination of durability and responsiveness. With its clean lines, versatility and fit, the Hupana is a shoe you\'ll want to add to your running shoe collection today.</p>\n            \n                <br><p></p><ul class=\"detail_comp\"><li>Runner Type: Neutral</li><li>Open knit pattern for maximum breathability</li><li>Seamless construction to minimize hotspots and irritation</li><li>Molded OrthoLite® sock liner</li><li>Full RMAT® midsole for a responsive, dynamic ride</li><li>Full RMAT® outsole for high rebound cushioning and traction</li><li>Outsole siping for improved traction and precise flexibility.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Weight:</span>\n            \n            8.2 oz. (Weight is based on a US size 9)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            RMAT®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            RMAT®</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Mesh/Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',114.95,114.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(811966,'Bondi LTR Walking Shoe','/pm/decke/decke811966_446219_jb1.jpg;/pm/decke/decke811966_446219_jb2.jpg;/pm/decke/decke811966_446219_jb3.jpg;/pm/decke/decke811966_446219_jb5.jpg;/pm/decke/decke811966_446219_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hoka One One Bondi LTR Walking Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Hoka One One Bondi LTR Walking Shoe provides all the comfort enhancing features for which HOKA has become lauded for in the running world. Comfort reigns supreme in this sneaker, it has an ultra-size midsole that provides signature HOKA cushioning and stability. A full grain leather upper tops off this working cushy offering for the walking/working consumer.\n            \n                <p></p><ul class=\"detail_comp\"><li>Full grain leather upper</li><li>Supportive TPU heel frame</li><li>Early stage Meta-Rocker for smooth ride</li><li>Full EVA midsole provides signature HOKA ONE ONE cushioning</li><li>Flat-waisted geometry provides inherent stability</li><li>Strategic rubber placement provides durability</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Full Grain Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',159.95,159.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(813602,'Force Roller Shoe','/pm/bbcin/bbcin813602_446630_jb1.jpg;/pm/bbcin/bbcin813602_446630_jb5.jpg;/pm/bbcin/bbcin813602_446630_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Force Roller Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Heelys Force Roller Shoe is a trendy low profile sneaker with a removeable wheel and a lace up closure.\n            \n                <br><ul class=\"detail_comp\"><li>Lace up closure</li><li>Removeable roller wheel</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',48.75,48.75,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(813607,'Piper Roller Shoe','/pm/bbcin/bbcin813607_465160_jb1.jpg;/pm/bbcin/bbcin813607_465160_jb5.jpg;/pm/bbcin/bbcin813607_465160_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Heelys Piper Roller Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Transform your casual look with the Heelys Piper Roller Shoe. This mid height sneaker will take your look up a notch and the signature Heelys removeable wheel adds a fun final touch.\n            \n                <br><ul class=\"detail_comp\"><li>Lace up closure</li><li>Removeable roller wheel</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(815045,'Norsen Lace Sneaker','/pm/thecl/thecl815045_19454_jb1.jpg;/pm/thecl/thecl815045_19454_jb2.jpg;/pm/thecl/thecl815045_19454_jb3.jpg;/pm/thecl/thecl815045_19454_jb4.jpg;/pm/thecl/thecl815045_19454_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Norsen Lace Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Redefine your casual styling with the stylishly appealing Clarks Norsen Lace Sneaker. From the Clarks® Artisan Collection, this lace-up sneaker features the Gait Mapping technology that delivers excellent support and stability.\n            \n                <ul class=\"detail_comp\"><li>Part of the Clarks® Artisan Collection</li><li>Gait Mapping technology</li><li>Removable molded polyurethane footbed</li><li>Textile lining and sockliner</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane Molded</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Leather/Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Cow Full Grain Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',106.99,106.99,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(815057,'Skech-Air Porter Elden Sneaker','/pm/skech/skech815057_56099_jb1.jpg;/pm/skech/skech815057_56099_jb2.jpg;/pm/skech/skech815057_56099_jb3.jpg;/pm/skech/skech815057_56099_jb5.jpg;/pm/skech/skech815057_56099_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Skech-Air Porter Elden Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Find the perfect blend of style and wearable comfort in the SKECHERS Porter - Elden Sneaker. Smooth oiled leather upper in a lace up casual oxford with stitching and overlay accents. Air Cooled Memory Foam insole, Skech-Air midsole.\n            \n                <ul class=\"detail_comp\"><li>Mesh fabric collar and tongue edging trim</li><li>Lace up casual comfort sneaker oxford design</li><li>Rounded plain toe front</li><li>Lightly rubbed leather finish</li><li>Stitching detail on sides and heel panel</li><li>Heel panel detail with pull on fabric tab</li><li>Lace up front with metal eyelets</li><li>Lightly padded tongue</li><li>Soft fabric shoe lining</li><li>Classic Fit design</li><li>Air Cooled Memory Foam full length cushioned comfort insole</li><li>Shock absorbing midsole</li><li>Skech-Air design midsole with visible midfoot air cushion for added comfort</li><li>Vulcanized look midsole with textured detail</li><li>Outsole with visible translucent air cushion detail</li><li>Flexible traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Oiled Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',69.95,69.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(815393,'S Lights Glimmer Lites Sneaker','/pm/skech/skech815393_76194_jb1.jpg;/pm/skech/skech815393_76194_jb2.jpg;/pm/skech/skech815393_76194_jb3.jpg;/pm/skech/skech815393_76194_jb5.jpg;/pm/skech/skech815393_76194_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers S Lights Glimmer Lites Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Air cushioned comfort and sporty cool light-up fun combine in the SKECHERS S Lights: Air Lites Sneaker. Glitter finish fabric and shiny patent synthetic upper in a bungee stretch laced slip on athletic sporty training sneaker with stitching accents and air cushion sole. Light-up sole with on/off switch.\n            \n                <ul class=\"detail_comp\"><li>Shiny patent finish synthetic overlays</li><li>Fabric with all over colorful stitching accents and striping</li><li>Three color criss crossing stitching accents</li><li>Contrast colored stripe detail on side panels</li><li>Bungee laced front panel for easy slip on fit</li><li>Instep strap with Skechers logo and clever on/off switch for lights</li><li>Adjustable side hook and loop closure for easy fit</li><li>Padded collar and tongue</li><li>Soft fabric shoe lining</li><li>Cushioned comfort insole</li><li>Layered shock absorbing midsole</li><li>Unique translucent midsole with air cushion pods for energy return</li><li>Two-color lights in midsole blink or chase with every step</li><li>On/Off switch on side of shoe deactivates light-up feature</li><li>Note: Toddler sizes do not feature the on/off switch</li><li>Air cushioned pods provide flexibiilty and support</li><li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Glitter Finish Woven Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(816278,'Flex Appeal 2.0 Newsmaker Training Sneaker','/pm/skech/skech816278_41823_jb1.jpg;/pm/skech/skech816278_41823_jb2.jpg;/pm/skech/skech816278_41823_jb3.jpg;/pm/skech/skech816278_41823_jb5.jpg;/pm/skech/skech816278_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Flex Appeal 2.0 Newsmaker Training Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Sporty style and comfort that\'s always worth a mention comes in the SKECHERS Flex Appeal 2.0 - Newsmaker Sneaker. Soft athletic mesh fabric and synthetic upper in a lace up athletic training and walking sneaker with stitching accents and Air Cooled Memory Foam insole.\n            \n                <ul class=\"detail_comp\"><li>Grid patterned cooling weave design</li><li>Stitching detail on laces, collar and heel</li><li>Side S logo</li><li>Fabric heel stripe overlay with pull on top tab</li><li>Smooth synthetic overlay at lace area for added durability</li><li>Lace up front</li><li>Padded collar and tongue</li><li>Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>FlexSole 2.0 lightweight shock absorbing midsole</li><li>Super flexible rubber traction outsole</li><li>Contrast colored midsole stripe</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(816588,'Kotaro 4 AC Sneaker','/pm/wolve/wolve816588_375884_jb1.jpg;/pm/wolve/wolve816588_375884_jb2.jpg;/pm/wolve/wolve816588_375884_jb3.jpg;/pm/wolve/wolve816588_375884_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Saucony Kotaro 4 AC Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Saucony Kotaro 4 A/C Sneaker features a durable and breathable leather and mesh upper and pro-lock technology that offers a secure fit. The non-marking outsole has rubber traction pods strategically placed that cover high impact zones for greater durability\n            \n                <br><ul class=\"detail_comp\"><li>Alternative closure for effortless on/off and adjustability</li><li>Pro-lock technology for a secure fit</li><li>Leather and mesh upper provide durability and breathability</li><li>Antimicrobial treatment lining to lessen the risk of odor causing bacteria</li><li>4mm heel to toe drop for a closer to the ground feel</li><li>EVA midsole is lightweight and cushioning</li><li>Non-marking outsole with strategically placed rubber traction pods that cover high impact zones for greater durability</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA+Mesh</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather/Mesh</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',35.96,35.96,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(816723,'Gamefish Slip On','/pm/wolve/wolve816723_92741_jb1.jpg;/pm/wolve/wolve816723_92741_jb2.jpg;/pm/wolve/wolve816723_92741_jb3.jpg;/pm/wolve/wolve816723_92741_jb5.jpg;/pm/wolve/wolve816723_92741_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Gamefish Slip On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Make a smooth transition from the boardwalk to the beach with the Sperry Gamefish Slip On. The patented SON-R Technology™ provides an interactive footbed for greater stability and agility, while the removable compression-molded EVA footbed maximizes comfort. In addition, the Gamefish features a molded Hydro Grip™ rubber outsole with Adaptive Wave-Siping™, which disperses water underfoot to reduce slippage on dry and wet surfaces alike.\n            \n                <ul class=\"detail_comp\"><li>Part of the Top-Sider Collection</li><li>SON-R Technology™</li><li>Adaptive Wave-Siping™</li><li>Removable, compression-molded EVA insole</li><li>EVA midsole and outsole</li><li>Gore panels</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Full Grain Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(817581,'FuelCore Urge v2 Running Shoe - Grade School','/pm/newba/newba817581_11075_jb1.jpg;/pm/newba/newba817581_11075_jb3.jpg;/pm/newba/newba817581_11075_jb6.jpg;/pm/newba/newba817581_11075_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance FuelCore Urge v2 Running Shoe - Grade School Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n		