ogy that offers unbeatable comfort while walking.\n            \n                <ul class=\"detail_comp\"><li>Soft Air Technology reduces shock for extraordinary comfort while walking</li><li>Removable insole allows custom orthotics</li><li>Lace up closure</li><li>Rubber outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',428.95,428.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(820099,'Rialto Lace Sneaker','/pm/keenf/keenf820099_142620_jb1.jpg;/pm/keenf/keenf820099_142620_jb2.jpg;/pm/keenf/keenf820099_142620_jb6.jpg;/pm/keenf/keenf820099_142620_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Rialto Lace Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Whether you are running up peaks or down trails, the versatile Keen Rialto Lace Sneaker is perfect for anything. This waterproof shoe has been designed with a direct-attach polyurethane midsole and high-traction rubber outsole for enhanced comfort and support on a range of surfaces. Moreover, the Cleansport NXT™ technology offers excellent odor control for a pleasant wearing experience.\n            \n                <ul class=\"detail_comp\"><li>Waterproof</li><li>Cleansport NXT™ technology</li><li>Made in USA</li><li>Breathable mesh lining</li><li>Removable, microfiber-wrapped polyurethane footbed</li><li>Direct-attach polyurethane midsole for resilient cushioning</li><li>High-traction rubber outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Full Grain Leather</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Made in:</span>\n            \n            USA</div>\n            \n		</div><!--end product_specs-->\n	</div>',139.95,139.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(820122,'Hikeport Waterproof Sneaker - Big Kid','/pm/keenf/keenf820122_452287_jb1.jpg;/pm/keenf/keenf820122_452287_jb2.jpg;/pm/keenf/keenf820122_452287_jb6.jpg;/pm/keenf/keenf820122_452287_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Hikeport Waterproof Sneaker - Big Kid Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Watch your child enjoy any outdoor setting in comfort with the Keen Hikeport Waterproof Sneaker. Featuring the Cleansport NXT™ technology, this hiking shoe provides natural odor control for optimum freshness. The waterproof Keen.Dry® membrane offer