        \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(822934,'Original Kids Rain Boot','/pm/hunte/hunte822934_426742_jb1.jpg;/pm/hunte/hunte822934_426742_jb2.jpg;/pm/hunte/hunte822934_426742_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Hunter Original Kids Rain Boot Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                With a reflective back strap and graded leg heights, the Hunter Original Kids\' Rain Boot is the perfect pick for your growing child.\n            \n                <ul class=\"detail_comp\"><li>Handcrafted</li><li>Reflective back strap</li><li>Graded leg heights</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Shaft Height:</span>\n            \n            10.8\" (Size 2)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Circumference:</span>\n            \n            12.2\" (Size 2)</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Textile Lining</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',80.00,80.00,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(825011,'RB4250 ZPrint Work Athletic Steel Toe Oxford','/pm/warso/warso825011_455602_jb1.jpg;/pm/warso/warso825011_455602_jb2.jpg;/pm/warso/warso825011_455602_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Reebok Work RB4250 ZPrint Work Athletic Steel Toe Oxford Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A multi-dimensional cushioning masterpiece with controlled flexibility and responsiveness for the work day, the Reebok Work ZPrint Work Athletic Steel Toe Oxford is engineered for excellent foot-tracking and cushioning. Underfoot materials come in three different densities, a foot-mapped 3D foam midsole that cushions on impact and propels at takeoff, a grid perimeter for stability, and the third in contact with the ground for abrasion and slip resistance.\n            \n                <br><p></p><ul class=\"detail_comp\"><li>Lightweight, seamless textile upper</li><li>Low-cut design for maximum ankle stability and quick stride transitions</li><li>Multi-density cushioning platform for stride control and quick response</li><li>Foot-mapped 3D foam midsole with deep flex grooves</li><li>Strategically-sized rubber nodes on the sole for enhanced flexibility and slip-resistance</li><li>MemoryTech Massage footbed adapts to the contours of your foot</li><li>Steel Toe meets ASTM F2413 safety standards</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            MemoryTech Massage Cushion Footbed</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Textile,Mesh</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',94.99,94.99,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(825119,'Launch 5 Running Shoe','/pm/brook/brook825119_465212_jb1.jpg;/pm/brook/brook825119_465212_jb2.jpg;/pm/brook/brook825119_465212_jb3.jpg;/pm/brook/brook825119_465212_jb5.jpg;/pm/brook/brook825119_465212_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Brooks Launch 5 Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Springy and fast with zero distractions, the Brooks Launch 5 Running Shoe for runners with a balanced neutral stride offers BioMoGo DNA midsole cushioning and rebounding rubber create a springy feel underfoot. The Midfoot Transition Zone is shaped to go from heel to toe quickly. The one-piece mesh upper and internal bootie are so light and breezy, they feel like they\'re not even there.\n            \n                <ul class=\"detail_comp\"><p></p><p></p><li>Runner Type: Neutral</li><li>BioMoGo DNA midsole cushioning</li><li>Midfoot Transition Zone quick transition</li><li>One-piece mesh upper and internal bootie</li><li>Added blown rubber</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            BioMoGo DNA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(825579,'Wedgie Bootie','/pm/steve/steve825579_2073_jb1.jpg;/pm/steve/steve825579_2073_jb2.jpg;/pm/steve/steve825579_2073_jb3.jpg;/pm/steve/steve825579_2073_jb4.jpg;/pm/steve/steve825579_2073_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Steve Madden Wedgie Bootie Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The perfect shoe for the sneaker-obsessed girl who needs a little extra lift, the Steve Madden Wedgie Bootie is an on-trend choice that delivers. Internal wedge is camouflaged beneath a suede upper with tonal stitching and sneaker construction. Dual side zips are functional and edgy. White contrast midsole is that sporty finishing touch that makes these Steve Madden Booties your new go-to.  \n            \n                <ul class=\"detail_comp\"><li>Suede upper</li><li>Zipper at both sides</li><li>Pull tab at back</li><li>Fabric lining</li><li>Rubber outsole</li><li>2.75-inch wedge</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:<