ou comfortable all day long. The upper is treated with the 3M Scotchgard™ protector to obtain stain resistance, while the steel shank and TPU outsole deliver support and durability, respectively.\n            \n                <ul class=\"detail_comp\"><li>Part of the Lillie Collection</li><li>Leather lining</li><li>Upper treated with 3M Scotchgard™ protector</li><li>Dansko Natural Arch™ technology</li><li>Leather-covered, removable, molded polyurethane footbed with memory foam</li><li>Molded hidden wedge for comfort</li><li>Embedded steel shank for support</li><li>Durable TPU outsole</li></ul>\n            \n                <p> </p> <p><b>Dansko Fit Guide:</b></p> <img src=\"http://www.shoebuy.com/images/desc/dansko/danskofitguide.jpg&gt;%0A%20%20%20%20%20%20%20%20%20%20%20%20%0A%20%20%20%20%20%20%20%20&lt;/span&gt;&lt;/div&gt;<!--end product_description-->%0A%20%20%20%20%20%20%20%20%0A%09%09&lt;div%20class=\" product_specs grid_7>\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Memory Foam/Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            TPU</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Nubuck or Nappa Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</span></div><!--end product_specs-->\n	</div>',144.95,144.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(826090,'Danae Slingback Sandal','/pm/dansk/dansk826090_350432_jb1.jpg;/pm/dansk/dansk826090_350432_jb3.jpg;/pm/dansk/dansk826090_350432_jb4.jpg;/pm/dansk/dansk826090_350432_jb5.jpg;/pm/dansk/dansk826090_350432_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dansko Danae Slingback Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Nothing says spring like the perforated upper and open design of the Dansko Danae slingback sandal. All-season styling points like a faux wood platform and block heel, perforated nubuck or Nappa upper, and an open toe make these sandals feel contemporary and versatile at the same time. Comfort features like a molded EVA footbed, embedded stability shank, leather lining, and adjustable hook-and-loop strap mean you\'ll never sacrifice comfort for style. \n            \n                <ul class=\"detail_comp\"><li>Part of the Decatur Collection</li><li>Leather upper</li><li>Adjustable ankle strap with hook-and-loop closure</li><li>Embedded shank</li><li>Leather lining</li><li>Leather-wrapped, molded EVA footbed</li><li>Polyurethane outsole with lightweight frame</li><li>3.25-inch block heel</li><li>Weight: 13 oz.</li><li>Approved by the American Podiatric Medical Association</li></ul>\n            \n                <p> </p> <p><b>Dansko Fit Guide:</b></p> <img src=\"http://www.shoebuy.com/images/desc/dansko/danskofitguide.jpg&gt;%0A%20%20%20%20%20%20%20%20%20%20%20%20%0A%20%20%20%20%20%20%20%20&lt;/span&gt;&lt;/div&gt;<!--end product_description-->%0A%20%20%20%20%20%20%20%20%0A%09%09&lt;div%20class=\" product_specs grid_7>\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            3 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n      