 <ul class=\"detail_comp\"><li> Genuine leather upper</li><li> FootShape Everyday Comfort</li><li> Stack height: 23 mm</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            7/8\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n		</div><!--end product_specs-->\n	</div>',130.00,130.00,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(829633,'8000 Ubal Sneaker','/pm/rockp/rockp829633_88997_jb1.jpg;/pm/rockp/rockp829633_88997_jb2.jpg;/pm/rockp/rockp829633_88997_jb3.jpg;/pm/rockp/rockp829633_88997_jb6.jpg;/pm/rockp/rockp829633_88997_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Dunham 8000 Ubal Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The 800 Ubal Sneaker has a classic look made for walking. It has a durable rubber outsole, premium Leather uppers, and superior underfoot cushioning.\n            \n                <br><ul class=\"detail_comp\"><li>Lace up sneaker</li><li>Cushioned</li><li>Leather</li><li>Rubber outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Synthetic</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',129.95,129.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(829671,'Soft 7 Retro Slip On','/pm/eccou/eccou829671_401783_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>ECCO Soft 7 Retro Slip On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Take your casual look to a whole new level with the ECCO Soft 7 Retro Slip On. Featuring a leather-covered insole with the ECCO Comfort Fiber System™, this lightweight sneaker keeps your foot fresh and dry. Moreover, a soft lining ensures a perfect interior, while a direct-injected polyurethane and TPU outsole delivers flexibility with each stride.\n            \n                <ul class=\"detail_comp\"><li>Removable, leather-covered insole with ECCO Comfort Fiber System™</li><li>Soft lining</li><li>Anatomical last for comfort</li><li>Twin gore panels</li><li>Perforated detail</li><li>Direct-injected polyurethane and TPU outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane/TPU</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Cow Leather or Nubuck Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',149.95,149.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(829685,'BIOM Hybrid Tie Hydromax Golf Shoe','/pm/eccou/eccou829685_366130_jb1.jpg;/pm/eccou/eccou829685_366130_jb2.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>ECCO BIOM Hybrid Tie Hydromax Golf Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Regardless of the swing you adopt, the high-performance ECCO BIOM® Hybrid Tie HYDROMAX® Golf Shoe will keep you supported. A masterclass in form and function, this professional-standard golf shoe uses the E-DTS® Hybrid Technology for 800 traction points and exceptional grip. The breathable upper is treated with HYDROMAX® and an anti-stain formula for excellent protection from the elements. Moreover, the removable Technical Insole System with silicon printing helps prevent unwanted foot movement during the swing, and an anatomical last shape delivers optimum support.\n            \n                <ul class=\"detail_comp\"><li>E-DTS® Hybrid technology</li><li>HYDROMAX®-treated upper</li><li>Removable Technical Insole System with silicon printing</li><li>TPU molded traction bars</li><li>Anatomical last shape</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Textile</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Synthetic</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',159.95,159.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(829899,'Ultra Flex Statements Sneaker','/pm/skech/skech829899_70027_jb1.jpg;/pm/skech/skech829899_70027_jb2.jpg;/pm/skech/skech829899_70027_jb3.jpg;/pm/skech/skech829899_70027_jb5.jpg;/pm/skech/skech829899_70027_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Ultra Flex Statements Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Show off your increased flexibility in sporty style and comfort with the SKECHERS Ultra Flex - Statements Sneaker. Skech Knit Mesh fabric upper in a slip on laced front sporty comfort walking and training sneaker with interwoven texture designs. Air Cooled Memory Foam insole, highly flexible comfort midsole.\n            \n                <ul class=\"detail_comp\"><li>Stretch knit collar panel</li><li>Solid color design with knit-in texture detailing</li><li>Interwoven ventilating panels</li><li>Side S logo</li><li>Laced front panel for precise fit and feel</li><li>Soft stretch collar for easy slip on fit</li><li>Heel fabric stripe with pull on top tab</li><li>Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Ultra Flex midsole with superior impact cushioning protection and remarkable energy return</li><li>Highly flexible articulated midsole and outsole design for freedom of movement</li><li>Textured channel design midsole finish</li><li>Flexible outsole with flexible articulated traction design</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Skech Knit Mesh Nearly One Piece Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(830450,'Striper II CVO Washed Sneaker','/pm/wolve/wolve830450_264674_jb1.jpg;/pm/wolve/wolve830450_264674_jb2.jpg;/pm/wolve/wolve830450_264674_jb3.jpg;/pm/wolve/wolve830450_264674_jb5.jpg;/pm/wolve/wolve830450_264674_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Striper II CVO Washed Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Lightweight and flexible, the Sperry Top-Sider Striper II CVO Washed Sneaker is a must-have in every man\'s casual wardrobe. This lace-up sneaker features a removable, full-length, molded polyurethane footbed that lends absolute comfort, and a non-marking rubber outsole with molded Wave-Siping™ for superior wet and dry traction. Further, keeping your foot relaxed all day is the vulcanized construction.\n            \n                <ul class=\"detail_comp\"><br><p></p><p></p><li>Lightweight, flexible, vulcanized construction</li><li>Genuine rawhide laces</li><li>Removable, full-length, molded polyurethane footbed</li><li>Slip-resistant, non-marking rubber outsole with molded Wave-Siping™</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Canvas</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(830461,'Seaport Penny Loafer','/pm/wolve/wolve830461_59448_jb1.jpg;/pm/wolve/wolve830461_59448_jb2.jpg;/pm/wolve/wolve830461_59448_jb3.jpg;/pm/wolve/wolve830461_59448_jb5.jpg;/pm/wolve/wolve830461_59448_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Seaport Penny Loafer Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Borrowed from the boys, the Sperry Seaport penny loafer is a classic silhouette with a history as a polished staple. Slip-on style features moccasin construction, a notched tongue, and vamp strap with signature penny keeper cutout and is finished with a foam sockliner, low stacked heel, and rubber outsole. Fun color and material options mean these Sperry shoes are as at home in the yacht club, as they are on the street. \n            \n                <ul class=\"detail_comp\"><li>Leather upper</li><li>Strobel construction</li><li>Leather welt</li><li>Flat strap penny keeper design</li><li>Moc-stitching detail</li><li>Leather sockliner</li><li>Full-length cushioned memory foam insole</li><li>Durable rubber outsole with Wave-Siping™</li><li>.8-inch heel</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Patent Leather or Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(830474,'Seaside Nautical Perforated Slip On','/pm/wolve/wolve830474_4593_jb1.jpg;/pm/wolve/wolve830474_4593_jb2.jpg;/pm/wolve/wolve830474_4593_jb3.jpg;/pm/wolve/wolve830474_4593_jb5.jpg;/pm/wolve/wolve830474_4593_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sperry Top-Sider Seaside Nautical Perforated Slip On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Sperry Top-Sider Seaside Nautical Perforated Slip On will make you believe that basic need not always be bland. Thanks to the breathable and moisture-wicking Dri-Lex® lining, this casual slip-on keeps your foot cool and dry. Plus, the slip-resistant, non-marking rubber outsole with razor-cut Wave-Siping™ offers wet and dry traction. Designed with perforations, this durable sneaker features a memory foam footbed with arch support for absolute comfort.\n            \n                <ul class=\"detail_comp\"><br><p></p><p></p><li>Breathable, moisture-wicking Dri-Lex® lining</li><li>Durable construction</li><li>Perforated detail</li><li>Twin gore panels</li><li>Memory foam footbed with arch support</li><li>Slip-resistant, non-marking rubber outsole with razor-cut Wave-Siping™</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(830578,'S Lights Litebeams Slip-On Sneaker','/pm/skech/skech830578_92307_jb1.jpg;/pm/skech/skech830578_92307_jb2.jpg;/pm/skech/skech830578_92307_jb3.jpg;/pm/skech/skech830578_92307_jb5.jpg;/pm/skech/skech830578_92307_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers S Lights Litebeams Slip-On Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Give her some sporty fun style in a flash with the Skechers S Lights: Litebeams Slip-On Sneaker. Athletic mesh fabric and smooth synthetic upper in a slip on bungee laced light up sporty sneaker with multi color light up midsole.\n            \n                <ul class=\"detail_comp\"><li>Glitter metallic synthetic overlays and instep strap</li><li>Metallic mesh heel and tongue panels</li><li>Colorful pretty geometric print pattern on fabric upper</li><li>Contrast colored metallic glitter finish synthetic overlays at toe, heel and laces</li><li>Metallic thread stripe detail on heel panel</li><li>Bungee stretch laced front panel for easy slip on fit</li><li>Glitter finish synthetic instep strap</li><li>Instep strap with printed Skechers logo</li><li>Adjustable side hook and loop closure</li><li>Padded collar and tongue</li><li>Contrast colored mesh fabric tongue and collar trim</li><li>Soft fabric shoe lining</li><li>Color accented midsole trim</li><li>Unique colorful translucent midsole side pods</li><li>Colorful lights in midsole blink and chase with every step!</li><li>Flexible nonmarking traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Sporty Woven Nearly One Piece Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(830594,'Turboshift Adjustable Strap Sneaker','/pm/skech/skech830594_80374_jb1.jpg;/pm/skech/skech830594_80374_jb2.jpg;/pm/skech/skech830594_80374_jb3.jpg;/pm/skech/skech830594_80374_jb5.jpg;/pm/skech/skech830594_80374_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Turboshift Adjustable Strap Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Sporty style and comfort comes through in the clutch with the SKECHERS Turboshift Sneaker. Smooth mesh fabric and synthetic upper in a lace up athletic sporty training sneaker with stitching and overlay accents. Reflective detail for high visibility.\n            \n                <ul cl