e:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Simulated Leather</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(831598,'680v5 Running Shoe - Alternative Closure','/pm/newba/newba831598_474682_jb1.jpg;/pm/newba/newba831598_474682_jb3.jpg;/pm/newba/newba831598_474682_jb6.jpg;/pm/newba/newba831598_474682_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>New Balance 680v5 Running Shoe - Alternative Closure Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The New Balance 680v5 Running Shoe for infants introduces the blend of performance and style to little feet. It has a no-sew material application, hook-and-loop alternative closure and a rubber outsole so they can get their first steps with confidence and comfort.\n            \n                <ul class=\"detail_comp\"><br><p></p><p></p><li>Alternative, hook-and-loop closure</li><li>Breathable leather and mesh upper</li><li>Injection-molded EVA midsole</li><li>Style: KA680</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather,Mesh</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',39.95,39.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(831978,'Plymouth Road Running Shoe','/pm/asics/asics831978_332987_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>ASICS Plymouth Road Running Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Outlast the competition with the lightweight and durable ASICS Plymouth Road Running Shoe. Featuring neutral cushioning and an EVA midsole, this men\'s sneaker offers comfort with every step.\n            \n                <ul class=\"detail_comp\"><br><p></p><p></p><li>EVA midsole</li><li>Neutral cushioning</li><li>Synthetic overlays</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(832853,'SR Lights Lux Light Up Sneaker - Preschool','/pm/wolve/wolve832853_463054_jb1.jpg;/pm/wolve/wolve832853_463054_jb2.jpg;/pm/wolve/wolve832853_463054_jb3.jpg;/pm/wolve/wolve832853_463054_jb5.jpg;/pm/wolve/wolve832853_463054_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Stride Rite SR Lights Lux Light Up Sneaker - Preschool Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Be it a fun session at school or picnic time with family, the Stride Rite SR Lights Lux Light Up Sneaker will not let down. A lightweight EVA outsole offers flexibility to this light-up shoe and a memory foam insole ensures lasting comfort for your boy\'s foot.\n            \n                <ul class=\"detail_comp\"><li>Adjustable hook-and-loop strap</li><li>Memory foam insole</li><li>Antimicrobial mesh lining</li><li>Lightweight EVA outsole for maximum flexibility</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Mesh/Memory Foam</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Mesh</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Textile</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(833134,'Terrabite Turbary Trail Shoe','/pm/skech/skech833134_42965_jb1.jpg;/pm/skech/skech833134_42965_jb2.jpg;/pm/skech/skech833134_42965_jb3.jpg;/pm/skech/skech833134_42965_jb5.jpg;/pm/skech/skech833134_42965_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Terrabite Turbary Trail Shoe Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Start your own paths in off-road sporty style and trail-walking comfort with the SKECHERS Terrabite - Turbary Trail Shoe. Smooth action leather, synthetic and mesh fabric upper in a lace up athletic sporty comfort trail walking and hiking high top sneaker with stitching and overlay accents. Air Cooled Memory Foam insole, comfort all terrain outsole.\n            \n                <ul class=\"detail_comp\"><li>Tough synthetic overlays</li><li>Mesh fabric panels for cooling effect</li><li>Water repellent upper design</li><li>Synthetic toe and heel bumper overlays</li><li>Side panels with contrast colored overlay trim</li><li>Stabilizing heel and side panels</li><li>Pull on heel tab</li><li>Lace up front with metal top eyelets</li><li>High top design for added stability and comfort</li><li>Padded collar and tongue</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Well cushioned flexible shock absorbing midsole</li><li>Stabilized supportive trail style midsole design</li><li>Stabilized midfoot panel</li><li>High traction rubber flexible trail outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Durable Action Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',74.95,74.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(833335,'Skech-Air Mega Sneaker','/pm/skech/skech833335_70716_jb1.jpg;/pm/skech/skech833335_70716_jb2.jpg;/pm/skech/skech833335_70716_jb3.jpg;/pm/skech/skech833335_70716_jb5.jpg;/pm/skech/skech833335_70716_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Skech-Air Mega Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Extreme comfort and fun style with the SKECHERS Skech-Air Mega Sneaker. Leather and mesh fabric upper in a laced athletic sporty training sneaker with stitching accents, Air Cooled Memory Foam insole and translucent air cushion sole.\n            \n                <ul class=\"detail_comp\"><li>Smooth metallic leather upper</li><li>Synthetic printed overlays</li><li>Mesh fabric upper for cooling effect</li><li>Contrast colored stripe detail on side panels</li><li>Side S logo</li><li>Side Skech-Air Mega logo detail</li><li>Padded collar and tongue</li><li>Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Layered shock absorbing midsole</li><li>New design translucent midsole with airbag cushion</li><li>Aggressive design airbag cushion provides flexibility and support</li><li>Rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            3/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Metallic Leather/Synthetic/Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(833344,'Relaxed Fit Rovato Texon Sneaker','/pm/skech/skech833344_56177_jb1.jpg;/pm/skech/skech833344_56177_jb2.jpg;/pm/skech/skech833344_56177_jb3.jpg;/pm/skech/skech833344_56177_jb5.jpg;/pm/skech/skech833344_56177_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Relaxed Fit Rovato Texon Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Classic casual style and refreshing supportive comfort star in the SKECHERS Relaxed Fit®: Rovato - Texon Sneaker. Smooth and distressed leather upper in a lace up casual comfort sneaker oxford with stitching and overlay accents. Air Cooled Memory Foam insole.\n            \n                <ul class=\"detail_comp\"><li>Lightly distressed crackle finish leather overlays</li><li>Stitched dual seam accented bicycle toe front</li><li>Distressed leather overlays at toe, sides and heel panel</li><li>Contrast colored fabric overlay detail on sides</li><li>Embossed side S logo and tongue panel SKECHERS logo detail</li><li>Perforation detail on front and side panels for cooling effect</li><li>Lace up front with metal top eyelet</li><li>Padded collar and tongue</li><li>Soft fabric shoe lining</li><li>Relaxed Fit® design for a roomy comfortable fit</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Shock absorbing lightweight flexible midsole</li><li>Sculpted designs and accent color detail on midsole</li><li>Flexible rubber traction outsole</li> </ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/2\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(833857,'Skech-Air Mega Azide Sneaker','/pm/skech/skech833857_70716_jb1.jpg;/pm/skech/skech833857_70716_jb2.jpg;/pm/skech/skech833857_70716_jb3.jpg;/pm/skech/skech833857_70716_jb5.jpg;/pm/skech/skech833857_70716_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Skech-Air Mega Azide Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Maximize the sporty cool style and air cushioned rebound wearing the SKECHERS Skech-Air Mega - Azide Sneaker. Sporty mesh fabric and synthetic upper in a slip on athletic sporty training sneaker with stitching accents, Air Cooled Memory Foam insole and translucent air cushion sole.\n            \n                <ul class=\"detail_comp\"><li>Smooth synthetic overlays at toe and heel</li><li>Mesh fabric nearly one piece upper design</li><li>Woven-in sporty stripe designs on front and side panels</li><li>Side S logo</li><li>Stretch laced front panel for easy slip on fit</li><li>Instep strap with SKECHERS logo detail</li><li>Adjustable side hook and loop closure for a precise fit</li><li>Skech-Air Mega side logo design detail</li><li>Padded collar and tongue</li><li>Heel panel with pull on top tab</li><li>Soft fabric shoe lining</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Layered shock absorbing midsole</li><li>Bold \'air bag\' continuous air cushioned midsole provides mega air cushioning</li><li>Aggressive design air cushioned pods provide flexibility and support</li><li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Lightweight Sporty Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(833873,'S Lights Energy Lights Zargo High Top Sneaker','/pm/skech/skech833873_41823_jb1.jpg;/pm/skech/skech833873_41823_jb2.jpg;/pm/skech/skech833873_41823_jb3.jpg;/pm/skech/skech833873_41823_jb5.jpg;/pm/skech/skech833873_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers S Lights Energy Lights Zargo High Top Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The future of light up footwear arrives with the SKECHERS S Lights: Energy Lights - Zargo High Top Sneaker. Soft woven canvas fabric upper in a lace up classic high top sneaker with amazing color changing sole light up effect. Bright colorful lights can light up in seven different solid colors, blinking lights and color sequences for 11 different light up options. Switch on tongue for complete control, and fully rechargeable too!\n            \n                <ul class=\"detail_comp\"><li>Amazing new light up function design</li><li>Translucent midsole fully encloses bright LED lights around the midsole edge</li><li>Press the \'Start\' button on the tongue, and the midsole lights up in a solid red \'Red Fire\' color</li><li>Lights change color with each press: Red Fire, Cool Blue, Alien Green, Purple, Teal, Neon Lime, White</li><li>Pick your favorite color and light up the night!</li><li>Next, a fun white blinking light for a fun look</li><li>Next, all seven colors pulse in \'Rainbow Dance\' slow sequence</li><li>Next, all seven colors switch in \'Pop N Glow\' fast sequence</li><li>Next, colors do \'Full Show\' slow sequence then two fast sequences</li><li>It\'s like a dance party in a shoe</li><li>Tongue flap reveals the Energy Lights\' coolest feature - they\'re rechargeable!</li><li>Shoes should enjoy 5 to 6 hours of continuous lighting on full charge</li><li>Plug in the included charger into any USB port and charge them up</li></ul>\n            \n                <ul class=\"detail_comp\"><li>Clean, classic high top look can be worn by both boys and girls</li><li>For women, convert two whole sizes - a kids\' size 5 is a women\'s size 7</li><li><li>Canvas fabric overlays at toe, sides and heel</li><li>Breathable lightweight design</li><li>Embossed side S logo</li><li>Lace up front with extra side eyelet for lacing detail</li><li>Padded collar and tongue</li><li>High top design with peaked front for walking comfort</li><li>SKECHERS logo on tongue with \'Start\' button feature</li><li>Clean vulcanized-look translucent midsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Canvas Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',44.95,44.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(835255,'Trainer Lite Jazzy Jumpers Sneaker','/pm/skech/skech835255_227137_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Trainer Lite Jazzy Jumpers Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Add more sparkle to her sporty sneaker style easily with the SKECHERS Trainer Lite -- Jazzy Jumpers Sneaker. Soft sporty metallic mesh fabric upper in a slip on stretch laced sporty casual training and walking sneaker with sporty metallic design accents.\n            \n                <ul class=\"detail_comp\"><li>Nearly one piece fabric upper</li><li>Woven-in metallic heathered jersey knit fabric design</li><li>Solid-color metallic woven-in detail at toe, sides and heel</li><li>Translucent 3D printed synthetic overlay detail for added stability</li><li>Side S logo</li><li>Fabric heel stripe overlay with pull on top loop</li><li>Stretch bungee laced front panel for easy slip on fit</li><li>Glitter synthetic instep strap with bold SKECHERS logo</li><li>Adjustable strap with hook and loop closure for a precise fit</li><li>Padded collar and tongue</li><li>Soft fabric shoe lining</li><li>Cushioned comfort insole</li><li>Shock absorbing supportive midsole</li><li>Flexible nonmarking traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',36.95,36.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(836292,'Grayson Slip-On','/pm/keenf/keenf836292_465742_jb1.jpg;/pm/keenf/keenf836292_465742_jb2.jpg;/pm/keenf/keenf836292_465742_jb6.jpg;/pm/keenf/keenf836292_465742_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Keen Grayson Slip-On Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The KEEN Grayson Slip-On is the perfect marriage of simplicity and functionality. Featuring the Luftcell dual-density outsole, infused with air, this lightweight slip-on offers all-day comfort. Moreover, a direct-attach polyurethane midsole provides excellent cushioning with each stride.\n            \n                <ul class=\"detail_comp\"><li>Luftcell, dual-density polyurethane outsole</li><li>Leather-lined polyurethane footbed</li><li>Direct-attach polyurethane midsole</li><li>Durable upper</li><li>Deconstructed design</li><li>Twin gore panels</li><li>Pull tab</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            American Hide Leather</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Made in:</span>\n            \n            Thailand</div>\n            \n		</div><!--end product_specs-->\n	</div>',109.95,109.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(836334,'Relaxed Fit Reggae Fest Marlin Mule Sandal','/pm/skech/skech836334_41823_jb1.jpg;/pm/skech/skech836334_41823_jb2.jpg;/pm/skech/skech836334_41823_jb3.jpg;/pm/skech/skech836334_41823_jb5.jpg;/pm/skech/skech836334_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Relaxed Fit Reggae Fest Marlin Mule Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Finding the best sporty style and comfort gets easier with the SKECHERS Relaxed Fit®: Reggae Fest - Marlin Mule Sandal. Mesh fabric and synthetic upper in a slip on low backed bungee laced sporty casual comfort trail walking open sided sneaker with stitching and overlay accents. Air Cooled Memory Foam insole, classic Reggae outsole.\n            \n                <ul class=\"detail_comp\"><li>Smooth synthetic overlays</li><li>Unique open side design for cooling comfort</li><li>Striped web fabric side stripe overlays</li><li>Synthetic and mesh overlays at toe, sides and heel</li><li>Contrast colored edging trim detailing</li><li>Bungee stretch elastic laced front panel for easy slip on fit</li><li>Lowered back design for easy slip on comfort</li><li>Soft fabric shoe lining</li><li>Relaxed Fit® design for a roomy comfortable fit</li><li>Fabric topped footbed</li><li>Air Cooled Memory Foam cushioned comfort insole</li><li>Reggae design supportive shock absorbing midsole</li><li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Lightweight Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(837004,'Nudu Ankle Strap Sandal','/pm/sassh/sassh837004_466990_jb1.jpg;/pm/sassh/sassh837004_466990_jb2.jpg;/pm/sassh/sassh837004_466990_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>SAS Nudu Ankle Strap Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A two-toned design and decorative stitching give the SAS Nudu Ankle Strap Sandal unique style. The plush, contoured insole is covered in soft Super Suede and cradles your foot\'s natural curves and arches. The upper is padded for ultimate comfort, while the adjustable straps let you tailor your fit.<br>\n            \n                <br><p></p><ul class=\"detail_comp\"><li>Multi-Layered Tripad® Comfort: The multi-layered insole provides superior comfort to compliment the comfort of the Tripad® footbed to cushion the three pressure points of your foot: the inside ball, outside ball, and the heel.</li><li>The broad, contoured footbed with a soft Super Suede cover is molded so the natural arches and curves of your foot are cradled in the sandal. This allows you to maximize the shock absorbing qualities of multilayers of comfort.</li><li>SAS Foot-Shape® Last: This special last follows the natural shape and contour of your foot, providing all-day comfort.</li><li>SAS All Day Comfort Sole: The wide sole base provides increased stability and maximum shock absorbency. This feature, along with the contoured footbed and multi-layered insole, works to \"rebound\" every step and provide you with all-day cushioned comfort.</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Polyurethane</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Made in:</span>\n            \n            USA</div>\n            \n		</div><!--end product_specs-->\n	</div>',132.95,132.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(837129,'Ariella Ankle Strap Sandal','/pm/caler/caler837129_58158_jb1.jpg;/pm/caler/caler837129_58158_jb2.jpg;/pm/caler/caler837129_58158_jb3.jpg;/pm/caler/caler837129_58158_jb4.jpg;/pm/caler/caler837129_58158_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Sam Edelman Ariella Ankle Strap Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                A go-to city sandal with sleek styling, the Sam Edelman Ariella Ankle Strap Sandal is a wear-with-anything wear-to-anything shoe. Minimal upper is limited to a toe strap and adjustable ankle strap. 4-inch heel adds unabashed height. Wear with confidence and the pairing possibilities are endless. \n            \n                <br><ul class=\"detail_comp\"><li>Ankle strap with buckle closure</li><li>Stiletto heel</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',99.95,99.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(837153,'Poppy Plush Strappy Sandal','/pm/aerog/aerog837153_282718_jb1.jpg;/pm/aerog/aerog837153_282718_jb5.jpg;/pm/aerog/aerog837153_282718_jb6.jpg;/pm/aerog/aerog837153_282718_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>A2 by Aerosoles Poppy Plush Strappy Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Up your fierce factor with the A2 Poppy Plush Strappy Sandal, a bold wedge that embraces the lace up gladiator trend. What looks like ghillie lacing is really a mini side buckle that finds your perfect fit adjustment. A covered platform wedge gets pleasantly interrupted by a slice of cork-like material. CORE COMFORT includes memory foam footbeds for dawn-to-dusk comfort.\n            \n                <br><ul class=\"detail_comp\"><li>Platform Height: 0.75\"</li><li>Core Comfort</li><li>Memory Foam Footbed</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            3 3/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Faux Suede</div>\n            \n            <div class=\"item\">\n            \n            Imported</div>\n            \n		</div><!--end product_specs-->\n	</div>',69.95,69.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(837913,'Energy Lights E-Pro Glitter Glow High Top Sneaker','/pm/skech/skech837913_29416_jb1.jpg;/pm/skech/skech837913_29416_jb2.jpg;/pm/skech/skech837913_29416_jb3.jpg;/pm/skech/skech837913_29416_jb5.jpg;/pm/skech/skech837913_29416_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Energy Lights E-Pro Glitter Glow High Top Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Add some sparkle to the lights with the SKECHERS S Lights: Energy Lights E-Pro - Glitter Glow High Top Sneaker. Smooth leather and glitter finish blend fabric upper in a lace up classic high top sneaker with amazing color changing sole light up effect. Bright colorful lights can light up in seven different solid colors, blinking lights and color sequences for 11 different light up options. Switch on tongue for complete control, and fully rechargeable too!\n            \n                <ul class=\"detail_comp\"><li>Amazing new light up function design</li><li>Translucent midsole fully encloses bright LED lights around the midsole edge</li><li>Press the \'Start\' button on the tongue, and the midsole lights up in a solid red \'Red Fire\' color</li><li>Lights change color with each press: Red Fire, Cool Blue, Alien Green, Purple, Teal, Neon Lime, White</li><li>Pick your favorite color and light up the night!</li><li>Next, a fun white blinking light for a fun look</li><li>Next, all seven colors pulse in \'Rainbow Dance\' slow sequence</li><li>Next, all seven colors switch in \'Pop N Glow\' fast sequence</li><li>Next, colors do \'Full Show\' slow sequence then two fast sequences</li><li>It\'s like a dance party in a shoe</li><li>Tongue flap reveals the Energy Lights\' coolest feature - they\'re rechargeable!</li><li>Shoes should enjoy 5 to 6 hours of continuous lighting on full charge</li><li>Plug in the included charger into any USB port and charge them up</li></ul>\n            \n                <ul class=\"detail_comp\"><li>For women, convert two whole sizes - a kids\' size 5 is a women\'s size 7</li><li>Leather and glitter finish synthetic overlays at toe, sides and heel</li><li>Embossed side S logo</li><li>Lace up front</li><li>Padded collar and tongue</li><li>High top design with peaked front for walking comfort</li><li>SKECHERS logo on tongue with \'Start\' button feature</li><li>Clean vulcanized-look translucent midsole</li><li>Non-marking traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Leather/Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',49.95,49.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(837949,'S Lights Energy Lights Shiny Bright High Top','/pm/skech/skech837949_321974_jb1.jpg;/pm/skech/skech837949_321974_jb2.jpg;/pm/skech/skech837949_321974_jb3.jpg;/pm/skech/skech837949_321974_jb5.jpg;/pm/skech/skech837949_321974_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers S Lights Energy Lights Shiny Bright High Top Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The future of light up footwear arrives with the SKECHERS S Lights: Energy Lights High Top Sneaker. Shiny metallic patent-finish synthetic upper in a lace up classic high top clean sneaker with amazing color changing sole light up effect. Bright colorful lights can light up in seven different solid colors, blinking lights and color sequences for 11 different light up options. Switch on tongue for complete control, and fully rechargeable too!\n            \n                <ul class=\"detail_comp\"><li>Amazing light up function design</li><li>Translucent midsole fully encloses bright LED lights around the midsole edge</li><li>Press the \'Start\' button on the tongue, and the midsole lights up in a solid red \'Red Fire\' color</li><li>Lights change color with each press: Red Fire, Cool Blue, Alien Green, Purple, Teal, Neon Lime, White</li><li>Pick your favorite color and light up the night!</li><li>Next, a fun white blinking light for a fun look</li><li>Next, all seven colors pulse in \'Rainbow Dance\' slow sequence</li><li>Next, all seven colors switch in \'Pop N Glow\' fast sequence</li><li>Next, colors do \'Full Show\' slow sequence then two fast sequences</li><li>It\'s like a dance party in a shoe</li><li>Tongue flap reveals the Energy Lights\' coolest feature - they\'re rechargeable!</li><li>Shoes should enjoy 5 to 6 hours of continuous lighting on full charge</li><li>Plug in the included charger into any USB port and charge them up</li></ul>\n            \n                <ul class=\"detail_comp\"><li>Also can be worn by women - convert two whole sizes down</li><li>For example, a women\'s size 8 is a kids\' size 6</li><li>Iridescent metallic panels at toe, sides and collar for unique rainbow metallic look</li><li>Perforation accents for added comfort</li><li>Embossed side S logo</li><li>Lace up front</li><li>Padded collar and tongue</li><li>High top design with peaked front for walking comfort</li><li>SKECHERS logo on tongue with \'Start\' button feature</li><li>Clean vulcanized-look translucent midsole</li><li>Flexible traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Shiny Metallic Patent-Finish Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',59.95,59.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(838107,'UltraRange Rapidweld Sneaker','/pm/vansi/vansi838107_434349_jb1.jpg;/pm/vansi/vansi838107_434349_jb2.jpg;/pm/vansi/vansi838107_434349_jb3.jpg;/pm/vansi/vansi838107_434349_jb6.jpg;/pm/vansi/vansi838107_434349_jb7.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Vans UltraRange Rapidweld Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The Vans UltraRange Rapidweld Sneaker is a breathable mesh, nylon and suede sneaker with rapidweld details and sock-fit bootie construction for an elevated fit. It features an UltraCush midsole for lightweight comfort and cushioning, plus a durable co-molded rubber mini lug outsole to reduce glue and improve finishing.\n            \n                <br><ul class=\"detail_comp\"><li>Breathable mesh, nylon and suede upper</li><li>Sock-fit bootie construction</li><li>Ultracush midsole</li><li>Durable co-molded rubber mini lug outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            This is a UNISEX style. All sizing is listed in MEN\'S SIZES. If you would like to purchase a Women\'s size please subtract 1.5 sizes to convert to Men\'s. For example, if you would like to order a Women\'s size 6, please order a size 4.5\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Insole:</span>\n            \n            UltraCush</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Rubber</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Mesh</div>\n            \n		</div><!--end product_specs-->\n	</div>',79.95,79.95,3,0,0,'2018-04-30 09:51:06','2018-04-30 09:51:06'),(839275,'Parallel Piazza Slingback Wedge Sandal','/pm/skech/skech839275_41823_jb1.jpg;/pm/skech/skech839275_41823_jb2.jpg;/pm/skech/skech839275_41823_jb3.jpg;/pm/skech/skech839275_41823_jb5.jpg;/pm/skech/skech839275_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers Parallel Piazza Slingback Wedge Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Sophisticated confident style combines with soft warm-weather comfort in the SKECHERS Cali Parallel - Piazza Slingback Wedge Sandal. Smooth nubuck-textured synthetic and stretch fabric upper in a wedge heeled dress casual comfort heel sling slide sandal with Memory Foam comfort footbed.\n            \n                <ul class=\"detail_comp\"><li>Stretch fabric crossed instep straps for easy slip on fit </li><li>Open toe front design</li><li>Front slide band with tapered center design</li><li>All over perforation detailing on front and heel straps for cooling effect</li><li>Center stretch fabric cross straps for added comfort</li><li>Heel sling back strap with lightly padded interior</li><li>Stitched edging trim</li><li>Smooth synthetic and soft fabric strap lining</li><li>Memory Foam full length cushioned comfort footbed</li><li>Lightweight platform wedge sole</li><li>1 inch midsole height</li><li>Flexible rubber traction outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            2 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Smooth Soft Nubuck-Textured Synthetic</div>\n            \n		</div><!--end product_specs-->\n	</div>',54.95,54.95,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(839336,'Leisa Lakia Slide Sandal','/pm/thecl/thecl839336_19454_jb1.jpg;/pm/thecl/thecl839336_19454_jb2.jpg;/pm/thecl/thecl839336_19454_jb3.jpg;/pm/thecl/thecl839336_19454_jb4.jpg;/pm/thecl/thecl839336_19454_jb5.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Clarks Leisa Lakia Slide Sandal Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Premium materials and sports features give the Clarks Leisa Lakia Slide Sandal an elevated look and long-term walkability.\n            \n                <br><ul class=\"detail_comp\"><li>Cushion Soft padding</li><li>Hook and loop straps</li><li>Ortholite footbed</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Heel Height:</span>\n            \n            1 1/4\"</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            EVA</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Full Grain Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',67.99,67.99,4,0,0,'2018-04-30 09:51:30','2018-04-30 09:51:30'),(840947,'S Lights Energy Lights Halation High Top Sneaker','/pm/skech/skech840947_41823_jb1.jpg;/pm/skech/skech840947_41823_jb2.jpg;/pm/skech/skech840947_41823_jb3.jpg;/pm/skech/skech840947_41823_jb5.jpg;/pm/skech/skech840947_41823_jb6.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers S Lights Energy Lights Halation High Top Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The future of light up footwear arrives with the SKECHERS S Lights: Energy Lights - Halation High Top Sneaker. Soft woven mesh fabric and synthetic upper in a lace up classic high top sneaker with amazing color changing sole light up effect. Bright colorful lights can light up in seven different solid colors, blinking lights and color sequences for 11 different light up options. Switch on tongue for complete control, and fully rechargeable too!\n            \n                <ul class=\"detail_comp\"><li>Amazing light up function design</li><li>Translucent midsole fully encloses bright LED lights around the midsole edge</li><li>Press the \'Start\' button on the tongue, and the midsole lights up in a solid red \'Red Fire\' color</li><li>Lights change color with each press: Red Fire, Cool Blue, Alien Green, Purple, Teal, Neon Lime, White</li><li>Pick your favorite color and light up the night!</li><li>Next, a fun white blinking light for a fun look</li><li>Next, all seven colors pulse in \'Rainbow Dance\' slow sequence</li><li>Next, all seven colors switch in \'Pop N Glow\' fast sequence</li><li>Next, colors do \'Full Show\' slow sequence then two fast sequences</li><li>It\'s like a dance party in a shoe</li><li>Tongue flap reveals the Energy Lights\' coolest feature - they\'re rechargeable!</li><li>Shoes should enjoy 5 to 6 hours of continuous lighting on full charge</li><li>Plug in the included charger into any USB port and charge them up</li></ul>\n            \n                <ul class=\"detail_comp\"><li>Clean, classic high top look can be worn by both boys and girls</li><li>For women, convert two whole sizes - a kids\' size 5 is a women\'s size 7</li><li>Smooth synthetic overlays at toe, laces and heel</li><li>Breathable lightweight design</li><li>Side S logo</li><li>Lace up front with extra side eyelet for lacing detail</li><li>Padded collar and tongue</li><li>High top design with peaked front for walking comfort</li><li>SKECHERS logo on tongue with \'Start\' button feature</li><li>Clean vulcanized-look translucent midsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Nearly One Piece Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',66.45,66.45,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42'),(841479,'F-13 Perforated Fitness High Top','/pm/filau/filau841479_54668_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Fila F-13 Perforated Fitness High Top Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                Kick start your day with the Fila F-13 Perforated Fitness High Top. This athletic sneaker is styled with branding at the quarter and midsole, and the F-Box logo on the tongue and hook-and-loop ankle strap.\n            \n                <ul class=\"detail_comp\"><li>Perforated upper</li><li>Branding at quarter and midsole</li><li>F-Box logo on tongue and hook-and-loop ankle strap</li><li>Gum outsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Outsole:</span>\n            \n            Gum</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Leather</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,2,0,0,'2018-04-30 09:50:26','2018-04-30 09:50:26'),(842585,'S Lights Energy Lights Ritzy Knits Sneaker','/pm/skech/skech842585_162521_jb1.jpg','_','<div class=\"product_information clearfix\">	\n		<h2>Skechers S Lights Energy Lights Ritzy Knits Sneaker Product Description</h2>\n		<br>\n		<div class=\"product_description grid_15\">\n			<span itemprop=\"description\">\n            \n                The future of light up footwear arrives with the SKECHERS S Lights: Energy Lights - Ritzy Knits Sneaker. Soft woven mesh fabric and synthetic upper in a lace up classic sporty sneaker with amazing color changing sole light up effect. Bright colorful lights can light up in seven different solid colors, blinking lights and color sequences for 11 different light up options. Switch on tongue for complete control, and fully rechargeable too!\n            \n                <ul><li>Amazing new light up function design</li><li>Translucent midsole fully encloses bright LED lights around the midsole edge</li><li>Press the \'Start\' button on the tongue, and the midsole lights up in a solid red \'Red Fire\' color</li><li>Lights change color with each press: Red Fire, Cool Blue, Alien Green, Purple, Teal, Neon Lime, White</li><li>Pick your favorite color and light up the night!</li><li>Next, a fun white blinking light for a fun look</li><li>Next, all seven colors pulse in \'Rainbow Dance\' slow sequence</li><li>Next, all seven colors switch in \'Pop N Glow\' fast sequence</li><li>Next, colors do \'Full Show\' slow sequence then two fast sequences</li><li>It\'s like a dance party in a shoe</li><li>Tongue flap reveals the Energy Lights\' coolest feature - they\'re rechargeable!</li><li>Shoes should enjoy 5 to 6 hours of continuous lighting on full charge</li><li>Plug in the included charger into any USB port and charge them up</li></ul>\n            \n                <ul><li>Clean, classic sporty sneaker look</li><li>For women, convert two whole sizes - a girls\' size 5 is a women\'s size 7</li><li>Soft woven nearly one piece mesh fabric upper</li><li>Lace up casual sporty sneaker design</li><li>Mesh fabric with woven-in contrast colored designs</li><li>Colorful striping woven detail at sides and heel panel</li><li>Smooth synthetic overlays at toe, laces and heel</li><li>Color mesh fabric with sporty woven-in design</li><li>Side S logo</li><li>Lace up front</li><li>Padded collar and tongue</li><li>SKECHERS logo on tongue with \'Start\' button feature</li><li>Clean vulcanized-look translucent midsole</li></ul>\n            \n        </span></div><!--end product_description-->\n        \n		<div class=\"product_specs grid_7\" data-yo-baynote=\"true\">\n        \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Fit:</span>\n            \n            True to Size</div>\n            \n            <div class=\"item\">\n            \n            <span class=\"highlight\">Upper:</span>\n            \n            Soft Woven Nearly One Piece Mesh Fabric</div>\n            \n		</div><!--end product_specs-->\n	</div>',64.95,64.95,1,0,0,'2018-04-30 09:50:42','2018-04-30 09:50:42');
